/*Data for the table `drugbank` */

insert  into `drugbank`(`drugbank_Name`,`drugbank_id`,`drugbank_Type`,`Groups`,`Description`,`Structure`,`CAS_number`,`Weight`,`has_Pathway_table`,`has_target_table`,`KEGG_Drug`,`KEGG_Drug_link`,`drugbank_url`) values ('Choline','DB00122','Small Molecule','Approved, Nutraceutical','A basic constituent of lecithin that is found in many plants and animal organs. It is important as a precursor of acetylcholine, as a methyl donor in various metabolic processes, and in lipid metabolism.','DB00122.svg','62-49-7','Average: 104.1708','true','true','D07690','http://www.genome.jp/dbget-bin/www_bget?drug:D07690','https://www.drugbank.ca/drugs/DB00122'),('Masoprocol','DB00179','Small Molecule','Approved, Investigational','A potent lipoxygenase inhibitor that interferes with arachidonic acid metabolism. The compound also inhibits formyltetrahydrofolate synthetase, carboxylesterase, and cyclooxygenase to a lesser extent. It also serves as an antioxidant in fats and oils. [PubChem]','DB00179.svg','27686-84-6','Average: 302.3649','None','true','None','None','https://www.drugbank.ca/drugs/DB00179'),('Tramadol','DB00193','Small Molecule','Approved, Investigational','A narcotic analgesic proposed for moderate to severe pain. It may be habituating. Tramadol is also prepared as a variable release capsules, marketed under the brand name ConZip. For example, a 150 mg capsule will contain 37.5 mg of the immediate release form and 112.5 mg of the extended release form.','DB00193.svg','27203-92-5','Average: 263.3752','true','true','D08623','http://www.genome.jp/dbget-bin/www_bget?drug:D08623','https://www.drugbank.ca/drugs/DB00193'),('Mesalazine','DB00244','Small Molecule','Approved','An anti-inflammatory agent, structurally related to the salicylates, which is active in inflammatory bowel disease. It is considered to be the active moiety of sulphasalazine. (From Martindale, The Extra Pharmacopoeia, 30th ed)','DB00244.svg','89-57-6','Average: 153.1354','None','true','D00377','http://www.genome.jp/dbget-bin/www_bget?drug:D00377','https://www.drugbank.ca/drugs/DB00244'),('Methysergide','DB00247','Small Molecule','Approved','An ergot derivative that is a congener of lysergic acid diethylamide. It antagonizes the effects of serotonin in blood vessels and gastrointestinal smooth muscle, but has few of the properties of other ergot alkaloids. Methysergide is used prophylactically in migraine and other vascular headaches and to antagonize serotonin in the carcinoid syndrome.','DB00247.svg','361-37-5','Average: 353.458','None','true','None','None','https://www.drugbank.ca/drugs/DB00247'),('Morphine','DB00295','Small Molecule','Approved, Investigational','The principal alkaloid in opium and the prototype opiate analgesic and narcotic. Morphine has widespread effects in the central nervous system and on smooth muscle. In January, 2017, morphine was approved for the treatment of chronic pain.','DB00295.svg','57-27-2','Average: 285.3377','true','true','D08233','http://www.genome.jp/dbget-bin/www_bget?drug:D08233','https://www.drugbank.ca/drugs/DB00295'),('Acetaminophen','DB00316','Small Molecule','Approved','Acetaminophen, also known as paracetamol, is commonly used for its analgesic and antipyretic effects. Its therapeutic effects are similar to salicylates, but it lacks anti-inflammatory, antiplatelet, and gastric ulcerative effects.','DB00316.svg','103-90-2','Average: 151.1626','true','true','D00217','http://www.genome.jp/dbget-bin/www_bget?drug:D00217','https://www.drugbank.ca/drugs/DB00316'),('Codeine','DB00318','Small Molecule','Approved, Illicit','An opioid analgesic related to morphine but with less potent analgesic properties and mild sedative effects. It also acts centrally to suppress cough.','DB00318.svg','76-57-3','Average: 299.3642','true','true','D03580','http://www.genome.jp/dbget-bin/www_bget?drug:D03580','https://www.drugbank.ca/drugs/DB00318'),('Hydromorphone','DB00327','Small Molecule','Approved, Illicit','An opioid analgesic derived from morphine and used mainly as an analgesic. It has a shorter duration of action and is more potent than morphine. [PubChem]','DB00327.svg','466-99-9','Average: 285.3377','true','true','C07042','http://www.genome.jp/dbget-bin/www_bget?cpd:C07042','https://www.drugbank.ca/drugs/DB00327'),('Indomethacin','DB00328','Small Molecule','Approved, Investigational','Indomethacin is a non-steroidal antiinflammatory agent (NSAIA) with antiinflammatory, analgesic and antipyretic activity. Its pharmacological effect is thought to be mediated through inhibition of the enzyme cyclooxygenase (COX), the enzyme responsible for catalyzes the rate-limiting step in prostaglandin synthesis via the arachidonic acid pathway.','DB00328.svg','53-86-1','Average: 357.788','true','true','D00141','http://www.genome.jp/dbget-bin/www_bget?drug:D00141','https://www.drugbank.ca/drugs/DB00328'),('Methadone','DB00333','Small Molecule','Approved','A synthetic opioid that is used as the hydrochloride. It is an opioid analgesic that is primarily a mu-opioid agonist. It has actions and uses similar to those of morphine. It also has a depressant action on the cough center and may be given to control intractable cough associated with terminal lung cancer. Methadone is also used as part of the treatment of dependence on opioid drugs, although prolonged use of methadone itself may result in dependence. (From Martindale, The Extra Pharmacopoeia, 30th ed, p1082-3).','DB00333.svg','76-99-3','Average: 309.4452','true','true','C07163','http://www.genome.jp/dbget-bin/www_bget?cpd:C07163','https://www.drugbank.ca/drugs/DB00333'),('Nabumetone','DB00461','Small Molecule','Approved','Nabumetone is a nonsteroidal anti-inflammatory drug (NSAID) of the arylalkanoic acid family (which includes diclofenac). Marketed under the brand name Relafen, it has been shown to have a slightly lower risk of gastrointestinal side effects than most other non-selective NSAIDs.','DB00461.svg','42924-53-8','Average: 228.2863','true','true','D00425','http://www.genome.jp/dbget-bin/www_bget?drug:D00425','https://www.drugbank.ca/drugs/DB00461'),('Ketorolac','DB00465','Small Molecule','Approved','A pyrrolizine carboxylic acid derivative structurally related to indomethacin. It is an NSAID and is used principally for its analgesic activity. (From Martindale The Extra Pharmacopoeia, 31st ed)','DB00465.svg','74103-06-3','None','true','true','C07062','http://www.genome.jp/dbget-bin/www_bget?cpd:C07062','https://www.drugbank.ca/drugs/DB00465'),('Celecoxib','DB00482','Small Molecule','Approved, Investigational','is a non-steroidal anti-inflammatory drug (NSAID) used in the treatment of osteoarthritis, rheumatoid arthritis, acute pain, painful menstruation and menstrual symptoms, and is also used to reduce numbers of colon and rectum polyps in patients with familial adenomatous polyposis. It is marketed by Pfizer under the brand name','DB00482.svg','169590-42-5','Average: 381.372','true','true','D00567','http://www.genome.jp/dbget-bin/www_bget?drug:D00567','https://www.drugbank.ca/drugs/DB00482'),('Oxycodone','DB00497','Small Molecule','Approved, Illicit, Investigational','Oxycodone is a semisynthetic derivative of codeine that acts as a narcotic analgesic more potent and addicting than codeine. An extended-release (ER) form of oxycodone (Xtampza ER) was approved for the management of daily, around-the-clock pain management in April, 2016.','DB00497.svg','76-42-6','Average: 315.3636','true','true','D05312','http://www.genome.jp/dbget-bin/www_bget?drug:D05312','https://www.drugbank.ca/drugs/DB00497'),('Tolmetin','DB00500','Small Molecule','Approved','A non-steroidal anti-inflammatory agent (anti-inflammatory agents, NON-steroidal) similar in mode of action to indomethacin. [PubChem]','DB00500.svg','26171-23-3','Average: 257.2845','true','true','None','None','https://www.drugbank.ca/drugs/DB00500'),('Piroxicam','DB00554','Small Molecule','Approved, Investigational','A cyclooxygenase inhibiting, non-steroidal anti-inflammatory agent (NSAID) that is well established in treating rheumatoid arthritis and osteoarthritis and used for musculoskeletal disorders, dysmenorrhea, and postoperative pain. Its long half-life enables it to be administered once daily. [PubChem]','DB00554.svg','36322-90-4','Average: 331.346','true','true','D00127','http://www.genome.jp/dbget-bin/www_bget?drug:D00127','https://www.drugbank.ca/drugs/DB00554'),('Carbamazepine','DB00564','Small Molecule','Approved, Investigational','An anticonvulsant used to control grand mal and psychomotor or focal seizures. Its mode of action is not fully understood, but some of its actions resemble those of phenytoin; although there is little chemical resemblance between the two compounds, their three-dimensional structure is similar. [PubChem]','DB00564.svg','298-46-4','Average: 236.2686','true','true','D00252','http://www.genome.jp/dbget-bin/www_bget?drug:D00252','https://www.drugbank.ca/drugs/DB00564'),('Fenoprofen','DB00573','Small Molecule','Approved','An anti-inflammatory analgesic and antipyretic highly bound to plasma proteins. It is pharmacologically similar to aspirin, but causes less gastrointestinal bleeding. [PubChem]','DB00573.svg','29679-58-1','Average: 242.2699','true','true','D00968','http://www.genome.jp/dbget-bin/www_bget?drug:D00968','https://www.drugbank.ca/drugs/DB00573'),('Valdecoxib','DB00580','Small Molecule','Approved, Investigational, Withdrawn','Valdecoxib was removed from the Canadian, U.S., and E.U. markets in 2005 due to concerns about possible increased risk of heart attack and stroke.','DB00580.svg','181695-72-7','Average: 314.359','true','true','119607','http://pubchem.ncbi.nlm.nih.gov/summary/summary.cgi?cid=119607','https://www.drugbank.ca/drugs/DB00580'),('Diclofenac','DB00586','Small Molecule','Approved, Vet approved','A non-steroidal anti-inflammatory agent (NSAID) with antipyretic and analgesic actions. It is primarily available as the sodium salt. [PubChem]','DB00586.svg','15307-86-5','None','true','true','D07816','http://www.genome.jp/dbget-bin/www_bget?drug:D07816','https://www.drugbank.ca/drugs/DB00586'),('Sulindac','DB00605','Small Molecule','Approved, Investigational','Sulindac is a nonsteroidal anti-inflammatory agent (NSAIA) of the arylalkanoic acid class that is marketed in the U.S. by Merck as Clinoril. Like other NSAIAs, it may be used in the treatment of acute or chronic inflammatory conditions. Sulindac is a prodrug, derived from sulfinylindene, that is converted in vivo to an active sulfide compound by liver enzymes. The sulfide metabolite then undergoes enterohepatic circulation; it is excreted in the bile and then reabsorbed from the intestine. This is thought to help maintain constant blood levels with reduced gastrointestinal side effects. Some studies have shown sulindac to be relatively less irritating to the stomach than other NSAIA\'s except for drugs of the cyclooxygenase-2 (COX-2) inhibitor class. The exact mechanism of its NSAIA properties is unknown, but it is thought to act on enzymes COX-1 and COX-2, inhibiting prostaglandin synthesis.','DB00605.svg','38194-50-2','Average: 356.411','true','true','D00120','http://www.genome.jp/dbget-bin/www_bget?drug:D00120','https://www.drugbank.ca/drugs/DB00605'),('Chloroquine','DB00608','Small Molecule','Approved, Investigational, Vet approved','The prototypical antimalarial agent with a mechanism that is not well understood. It has also been used to treat rheumatoid arthritis, systemic lupus erythematosus, and in the systemic therapy of amebic liver abscesses.','DB00608.svg','54-05-7','Average: 319.872','None','true','D02366','http://www.genome.jp/dbget-bin/www_bget?drug:D02366','https://www.drugbank.ca/drugs/DB00608'),('Adenosine','DB00640','Small Molecule','Approved, Investigational','A nucleoside that is composed of adenine and d-ribose. Adenosine or adenosine derivatives play many important biological roles in addition to being components of DNA and RNA. Adenosine itself is a neurotransmitter.','DB00640.svg','58-61-7','Average: 267.2413','true','true','D00045','http://www.genome.jp/dbget-bin/www_bget?drug:D00045','https://www.drugbank.ca/drugs/DB00640'),('Dextropropoxyphene','DB00647','Small Molecule','Approved, Illicit, Investigational, Withdrawn','Dextropropoxyphene is an analgesic in the opioid category, patented (1955) and manufactured by Eli Lilly and Company. It is intended to treat mild pain and also has antitussive and local anaesthetic effects. The drug has been taken off the market in Europe and the US due to concerns of fatal overdoses and heart arrhythmias. An estimated 10 million patients have used these products.','DB00647.svg','469-62-5','Average: 339.4712','true','true','C07406','http://www.genome.jp/dbget-bin/www_bget?cpd:C07406','https://www.drugbank.ca/drugs/DB00647'),('Magnesium sulfate','DB00653','Small Molecule','Approved, Investigational, Vet approved','A small colorless crystal used as an anticonvulsant, a cathartic, and an electrolyte replenisher in the treatment of pre-eclampsia and eclampsia. It causes direct inhibition of action potentials in myometrial muscle cells. Excitation and contraction are uncoupled, which decreases the frequency and force of contractions. (From AMA Drug Evaluations Annual, 1992, p1083)','DB00653.svg','7487-88-9','Average: 120.368','None','true','D01108','http://www.genome.jp/dbget-bin/www_bget?drug:D01108','https://www.drugbank.ca/drugs/DB00653'),('Sumatriptan','DB00669','Small Molecule','Approved, Investigational','A serotonin agonist that acts selectively at 5HT1 receptors. It is used in the treatment of migraine disorders. A transdermal patch version of sumatriptan is currently in phase I trials in the U.S. under the code name NP101 (NuPathe).','DB00669.svg','103628-46-2','Average: 295.4','None','true','D00451','http://www.genome.jp/dbget-bin/www_bget?drug:D00451','https://www.drugbank.ca/drugs/DB00669'),('Sufentanil','DB00708','Small Molecule','Approved, Investigational','An opioid analgesic that is used as an adjunct in anesthesia, in balanced anesthesia, and as a primary anesthetic agent. [PubChem]','DB00708.svg','56030-54-7','Average: 386.551','true','true','D05938','http://www.genome.jp/dbget-bin/www_bget?drug:D05938','https://www.drugbank.ca/drugs/DB00708'),('Flurbiprofen','DB00712','Small Molecule','Approved, Investigational','Flurbiprofen, a propionic acid derivative, is a nonsteroidal anti-inflammatory agent (NSAIA) with antipyretic and analgesic activity. Oral formulations of flurbiprofen may be used for the symptomatic treatment of rheumatoid arthritis, osteoarthritis and anklylosing spondylitis. Flurbiprofen may also be used topically prior to ocular surgery to prevent or reduce intraoperative miosis. Flurbiprofen is structurally and pharmacologically related to fenoprofen, ibuprofen, and ketoprofen.','DB00712.svg','5104-49-4','Average: 244.2609','true','true','D00330','http://www.genome.jp/dbget-bin/www_bget?drug:D00330','https://www.drugbank.ca/drugs/DB00712'),('Etodolac','DB00749','Small Molecule','Approved, Investigational, Vet approved','Etodolac is a non-steroidal anti-inflammatory drug (NSAID) with anti-inflammatory, analgesic and antipyretic properties. Its therapeutic effects are due to its ability to inhibit prostaglandin synthesis. It is indicated for relief of signs and symptoms of rheumatoid arthritis and osteoarthritis.','DB00749.svg','41340-25-4','Average: 287.3535','true','true','D00315','http://www.genome.jp/dbget-bin/www_bget?drug:D00315','https://www.drugbank.ca/drugs/DB00749'),('Olopatadine','DB00768','Small Molecule','Approved','Used to treat allergic conjunctivitis (itching eyes), olopatadine inhibits the release of histamine from mast cells. It is a relatively selective histamine H1 antagonist that inhibits the in vivo and in vitro type 1 immediate hypersensitivity reaction including inhibition of histamine induced effects on human conjunctival epithelial cells.','DB00768.svg','113806-05-6','Average: 337.4122','true','true','C07789','http://www.genome.jp/dbget-bin/www_bget?cpd:C07789','https://www.drugbank.ca/drugs/DB00768'),('Naproxen','DB00788','Small Molecule','Approved, Vet approved','An anti-inflammatory agent with analgesic and antipyretic properties. Both the acid and its sodium salt are used in the treatment of rheumatoid arthritis and other rheumatic or musculoskeletal disorders, dysmenorrhea, and acute gout.','DB00788.svg','22204-53-1','None','true','true','D00118','http://www.genome.jp/dbget-bin/www_bget?drug:D00118','https://www.drugbank.ca/drugs/DB00788'),('Alfentanil','DB00802','Small Molecule','Approved, Illicit','A short-acting opioid anesthetic and analgesic derivative of fentanyl. It produces an early peak analgesic effect and fast recovery of consciousness. Alfentanil is effective as an anesthetic during surgery, for supplementation of analgesia during surgical procedures, and as an analgesic for critically ill patients. [PubChem]','DB00802.svg','71195-58-9','Average: 416.5172','true','true','C08005','http://www.genome.jp/dbget-bin/www_bget?cpd:C08005','https://www.drugbank.ca/drugs/DB00802'),('Phenylbutazone','DB00812','Small Molecule','Approved, Vet approved','A drug that has anti-inflammatory, antipyretic, and analgesic activities. It is especially effective in the treatment of ankylosing spondylitis. It also is useful in rheumatoid arthritis and Reiter\'s syndrome (investigational indication). Although phenylbutazone is effective in gouty arthritis, risk/benefit considerations indicate that this drug should not be employed for this disease. (From AMA Drug Evaluations Annual, 1994, p1822)','DB00812.svg','50-33-9','Average: 308.3743','true','true','D00510','http://www.genome.jp/dbget-bin/www_bget?drug:D00510','https://www.drugbank.ca/drugs/DB00812'),('Fentanyl','DB00813','Small Molecule','Approved, Illicit, Investigational, Vet approved','A potent narcotic analgesic, abuse of which leads to habituation or addiction. It is primarily a mu-opioid agonist. Fentanyl is also used as an adjunct to general anesthetics, and as an anesthetic for induction and maintenance. (From Martindale, The Extra Pharmacopoeia, 30th ed, p1078)','DB00813.svg','437-38-7','Average: 336.4705','true','true','D00320','http://www.genome.jp/dbget-bin/www_bget?drug:D00320','https://www.drugbank.ca/drugs/DB00813'),('Meloxicam','DB00814','Small Molecule','Approved, Vet approved','Meloxicam is a nonsteroidal anti-inflammatory drug (NSAID) used to relieve the symptoms of arthritis, primary dysmenorrhea, fever; and as an analgesic, especially where there is an inflammatory component. It is closely related to piroxicam. In Europe it is marketed under the brand names Movalis, Melox, and Recoxa. In North America it is generally marketed under the brand name Mobic. In Latin America, the drug is marketed as Tenaron. [Wikipedia]','DB00814.svg','71125-38-7','Average: 351.401','true','true','D00969','http://www.genome.jp/dbget-bin/www_bget?drug:D00969','https://www.drugbank.ca/drugs/DB00814'),('Carprofen','DB00821','Small Molecule','Approved, Vet approved, Withdrawn','Carprofen is a non-steroidal anti-inflammatory drug (NSAID) that is used by veterinarians as a supportive treatment for the relief of arthritic symptoms in geriatric dogs. Carprofen was previously used in human medicine for over 10 years (1985-1995). It was generally well tolerated, with the majority of adverse effects being mild, such as gastro-intestinal pain and nausea, similar to those recorded with aspirin and other non-steroidal anti-inflammatory drugs. It is no longer marketed for human usage, after being withdrawn on commercial grounds. [Wikipedia]','DB00821.svg','53716-49-7','Average: 273.714','true','true','C18364','http://www.genome.jp/dbget-bin/www_bget?cpd:C18364','https://www.drugbank.ca/drugs/DB00821'),('Nalbuphine','DB00844','Small Molecule','Approved','A narcotic used as a pain medication. It appears to be an agonist at kappa opioid receptors and an antagonist or partial agonist at mu opioid receptors. Nalbuphine is the only opioid analgesic that is not a controlled substance in the United States.','DB00844.svg','20594-83-6','Average: 357.4434','true','true','D08246','http://www.genome.jp/dbget-bin/www_bget?drug:D08246','https://www.drugbank.ca/drugs/DB00844'),('Levorphanol','DB00854','Small Molecule','Approved','A narcotic analgesic that may be habit-forming. It is nearly as effective orally as by injection.','DB00854.svg','77-07-6','Average: 257.3706','true','true','D08123','http://www.genome.jp/dbget-bin/www_bget?drug:D08123','https://www.drugbank.ca/drugs/DB00854'),('Diflunisal','DB00861','Small Molecule','Approved, Investigational','Diflunisal, a salicylate derivative, is a nonsteroidal anti-inflammatory agent (NSAIA) with pharmacologic actions similar to other prototypical NSAIAs. Diflunisal possesses anti-inflammatory, analgesic and antipyretic activity. Though its mechanism of action has not been clearly established, most of its actions appear to be associated with inhibition of prostaglandin synthesis via the arachidonic acid pathway. Diflunisal is used to relieve pain accompanied with inflammation and in the symptomatic treatment of rheumatoid arthritis and osteoarthritis.','DB00861.svg','22494-42-4','Average: 250.1976','true','true','D00130','http://www.genome.jp/dbget-bin/www_bget?drug:D00130','https://www.drugbank.ca/drugs/DB00861'),('Remifentanil','DB00899','Small Molecule','Approved','Remifentanil (marketed by Abbott as Ultiva) is a potent ultra short-acting synthetic opioid analgesic drug. It is given to patients during surgery to relieve pain and as an adjunct to an anaesthetic. Remifentanil is a specific mu-type-opioid receptor agonist. Hence, it causes a reduction in sympathetic nervous system tone, respiratory depression and analgesia.','DB00899.svg','132875-61-7','Average: 376.4467','true','true','C08021','http://www.genome.jp/dbget-bin/www_bget?cpd:C08021','https://www.drugbank.ca/drugs/DB00899'),('Amantadine','DB00915','Small Molecule','Approved','An antiviral that is used in the prophylactic or symptomatic treatment of influenza A. It is also used as an antiparkinsonian agent, to treat extrapyramidal reactions, and for postherpetic neuralgia. The mechanisms of its effects in movement disorders are not well understood but probably reflect an increase in synthesis and release of dopamine, with perhaps some inhibition of dopamine uptake. [PubChem]','DB00915.svg','768-94-5','Average: 151.2487','None','true','C06818','http://www.genome.jp/dbget-bin/www_bget?cpd:C06818','https://www.drugbank.ca/drugs/DB00915'),('Buprenorphine','DB00921','Small Molecule','Approved, Illicit, Investigational, Vet approved','Buprenorphine is a derivative of the opioid alkaloid thebaine that is a more potent (25 - 40 times) and longer lasting analgesic than morphine. It appears to act as a partial agonist at mu and kappa opioid receptors and as an antagonist at delta receptors. The lack of delta-agonist activity has been suggested to account for the observation that buprenorphine tolerance may not develop with chronic use.','DB00921.svg','52485-79-7','Average: 467.6401','true','true','D07132','http://www.genome.jp/dbget-bin/www_bget?drug:D07132','https://www.drugbank.ca/drugs/DB00921'),('Salicylic acid','DB00936','Small Molecule','Approved, Investigational, Vet approved','A compound obtained from the bark of the white willow and wintergreen leaves, and also prepared synthetically. It has bacteriostatic, fungicidal, and keratolytic actions. Its salts, the salicylates, are used as analgesics.','DB00936.svg','69-72-7','Average: 138.1207','true','true','D00097','http://www.genome.jp/dbget-bin/www_bget?drug:D00097','https://www.drugbank.ca/drugs/DB00936'),('Meclofenamic acid','DB00939','Small Molecule','Approved, Vet approved','A non-steroidal anti-inflammatory agent with antipyretic and antigranulation activities. It also inhibits prostaglandin biosynthesis. [PubChem]','DB00939.svg','644-62-2','Average: 296.149','None','true','D02341','http://www.genome.jp/dbget-bin/www_bget?drug:D02341','https://www.drugbank.ca/drugs/DB00939'),('Acetylsalicylic acid','DB00945','Small Molecule','Approved, Vet approved','The prototypical analgesic used in the treatment of mild to moderate pain. It has anti-inflammatory and antipyretic properties and acts as an inhibitor of cyclooxygenase which results in the inhibition of the biosynthesis of prostaglandins. Acetylsalicylic acid also inhibits platelet aggregation and is used in the prevention of arterial and venous thrombosis. (From Martindale, The Extra Pharmacopoeia, 30th ed, p5)','DB00945.svg','50-78-2','Average: 180.1574','true','true','D00109','http://www.genome.jp/dbget-bin/www_bget?drug:D00109','https://www.drugbank.ca/drugs/DB00945'),('Hydrocodone','DB00956','Small Molecule','Approved, Illicit','Narcotic analgesic related to codeine, but more potent and more addicting by weight. It is used also as cough suppressant.','DB00956.svg','125-29-1','Average: 299.3642','true','true','D08045','http://www.genome.jp/dbget-bin/www_bget?drug:D08045','https://www.drugbank.ca/drugs/DB00956'),('Bromfenac','DB00963','Small Molecule','Approved','Bromfenac is a nonsteroidal anti-inflammatory drug (NSAID) for ophthalmic use. Ophthalmic NSAIDs are becoming a cornerstone for the management of ocular pain and inflammation. Their well-characterized anti-inflammatory activity, analgesic property, and established safety record have also made NSAIDs an important tool to optimize surgical outcomes.','DB00963.svg','91714-94-2','Average: 334.165','true','true','60726','http://pubchem.ncbi.nlm.nih.gov/summary/summary.cgi?cid=60726','https://www.drugbank.ca/drugs/DB00963'),('Oxaprozin','DB00991','Small Molecule','Approved','Oxaprozin is a non-narcotic, non-steroidal anti-inflammatory drug (NSAID), used to relieve the inflammation, swelling, stiffness, and joint pain associated with osteoarthritis and rheumatoid arthritis.','DB00991.svg','21256-18-8','Average: 293.3166','true','true','D00463','http://www.genome.jp/dbget-bin/www_bget?drug:D00463','https://www.drugbank.ca/drugs/DB00991'),('Ketoprofen','DB01009','Small Molecule','Approved, Vet approved','Ketoprofen, a propionic acid derivative, is a nonsteroidal anti-inflammatory agent (NSAIA) with analgesic and antipyretic properties.','DB01009.svg','22071-15-4','Average: 254.2806','true','true','D00132','http://www.genome.jp/dbget-bin/www_bget?drug:D00132','https://www.drugbank.ca/drugs/DB01009'),('Ibuprofen','DB01050','Small Molecule','Approved','Ibuprofen, a propionic acid derivative, is a prototypical nonsteroidal anti-inflammatory agent (NSAIA) with analgesic and antipyretic properties.','DB01050.svg','15687-27-1','Average: 206.2808','true','true','D00126','http://www.genome.jp/dbget-bin/www_bget?drug:D00126','https://www.drugbank.ca/drugs/DB01050'),('Diphenoxylate','DB01081','Small Molecule','Approved, Illicit','A meperidine congener used as an antidiarrheal, usually in combination with atropine. At high doses, it acts like morphine. Its unesterified metabolite difenoxin has similar properties and is used similarly. It has little or no analgesic activity. This medication is classified as a Schedule V under the Controlled Substances Act by the Food and Drug Administration (FDA) and the DEA in the United States when used in preparations. When diphenoxylate is used alone, it is classified as a Schedule II.','DB01081.svg','915-30-0','Average: 452.5873','true','true','D00301','http://www.genome.jp/dbget-bin/www_bget?drug:D00301','https://www.drugbank.ca/drugs/DB01081'),('Oxymorphone','DB01192','Small Molecule','Approved, Investigational, Vet approved','An opioid analgesic with actions and uses similar to those of morphine, apart from an absence of cough suppressant activity. It is used in the treatment of moderate to severe pain, including pain in obstetrics. It may also be used as an adjunct to anesthesia (From Martindale, The Extra Pharmacopoeia, 30th ed, p1092). On June 8, 2017, FDA requested Endo Pharmaceuticals to remove the medication from the market due to opioid misuse and abuse risks associated with the product\'s injectable reformulation.','DB01192.svg','76-41-5','Average: 301.3371','true','true','C08019','http://www.genome.jp/dbget-bin/www_bget?cpd:C08019','https://www.drugbank.ca/drugs/DB01192'),('Mitoxantrone','DB01204','Small Molecule','Approved, Investigational','An anthracenedione-derived antineoplastic agent. [PubChem]','DB01204.svg','65271-80-9','Average: 444.4809','None','true','C11195','http://www.genome.jp/dbget-bin/www_bget?cpd:C11195','https://www.drugbank.ca/drugs/DB01204'),('Magnesium salicylate','DB01397','Small Molecule','Approved','Magnesium salicylate is a common analgesic and non-steroidal anti-inflammatory drug (NSAID) used to treat mild to moderate muscular pain. It is also used to treat headaches, general back pain, and certain joint pains like arthritis.','DB01397.svg','18917-89-0','Average: 298.531','true','true','C07995','http://www.genome.jp/dbget-bin/www_bget?cpd:C07995','https://www.drugbank.ca/drugs/DB01397'),('Antipyrine','DB01435','Small Molecule','Approved, Investigational','An analgesic and antipyretic that has been given by mouth and as ear drops. Antipyrine is often used in testing the effects of other drugs or diseases on drug-metabolizing enzymes in the liver. (From Martindale, The Extra Pharmacopoeia, 30th ed, p29)','DB01435.svg','60-80-0','Average: 188.2258','true','true','D01776','http://www.genome.jp/dbget-bin/www_bget?drug:D01776','https://www.drugbank.ca/drugs/DB01435'),('Bezitramide','DB01459','Small Molecule','Experimental, Illicit, Withdrawn','Bezitramide is a narcotic analgesic which was discovered in 1961, clinically tested around the 1970\'s [1], and marketed under the name Burgodin(R). After cases of fatal overdose in the Netherlands in 2004 the drug was withdrawn from the market.','DB01459.svg','15301-48-1','Average: 492.6114','None','None','None','None','https://www.drugbank.ca/drugs/DB01459'),('Ecgonine','DB01525','Small Molecule','Experimental, Illicit','None','DB01525.svg','481-37-8','Average: 185.2203','None','None','91460','http://pubchem.ncbi.nlm.nih.gov/summary/summary.cgi?cid=91460','https://www.drugbank.ca/drugs/DB01525'),('Carfentanil','DB01535','Small Molecule','Illicit, Investigational, Vet approved','Carfentanil or carfentanyl (Wildnil) is an analogue of the popular synthetic opioid analgesic fentanyl, and is one of the most potent opioids known (also the most potent opioid used commercially). Carfentanil was first synthesized in 1974 by a team of chemists at Janssen Pharmaceutica which included Paul Janssen. It has a quantitative potency approximately 10,000 times that of morphine and 100 times that of fentanyl, with activity in humans starting at about 1 microgram. It is marketed under the trade name Wildnil as a general anaesthetic agent for large animals. Carfentanil is intended for large-animal use only as its extreme potency makes it inappropriate for use in humans. Currently sufentanil, approximately 10â€“20 times less potent (500 to 1000 times the efficacy of morphine per weight) than carfentanil, is the maximum strength fentanyl analog for use in humans.','DB01535.svg','59708-52-0','Average: 394.5066','true','true','46505501','http://pubchem.ncbi.nlm.nih.gov/summary/summary.cgi?sid=46505501','https://www.drugbank.ca/drugs/DB01535'),('Dihydromorphine','DB01565','Small Molecule','Experimental, Illicit','A semisynthetic analgesic used in the study of narcotic receptors. It has abuse potential. [PubChem]','DB01565.svg','509-60-4','Average: 287.3535','true','true','C11782','http://www.genome.jp/dbget-bin/www_bget?cpd:C11782','https://www.drugbank.ca/drugs/DB01565'),('Etoricoxib','DB01628','Small Molecule','Approved, Investigational','Etoricoxib is a new COX-2 selective inhibitor. Current therapeutic indications are: treatment of rheumatoid arthritis, osteoarthritis, ankylosing spondylitis, chronic low back pain, acute pain and gout. Like any other COX-2 selective inhibitor, Etoricoxib selectively inhibits isoform 2 of cyclo-oxigenase enzyme (COX-2). This reduces the generation of prostaglandins (PGs) from arachidonic acid.','DB01628.svg','202409-33-4','Average: 358.842','true','true','D03710','http://www.genome.jp/dbget-bin/www_bget?drug:D03710','https://www.drugbank.ca/drugs/DB01628'),('Castanospermine','DB01816','Small Molecule','Experimental','None','DB01816.svg','79831-76-8','Average: 189.209','None','true','None','None','https://www.drugbank.ca/drugs/DB01816'),('7-Nitroindazole','DB02207','Small Molecule','Experimental','None','DB02207.svg','2942-42-9','Average: 163.1335','None','true','None','None','https://www.drugbank.ca/drugs/DB02207'),('Nimesulide','DB04743','Small Molecule','Approved, Investigational, Withdrawn','Nimesulide is a relatively COX-2 selective, non-steroidal anti-inflammatory drug (NSAID) with analgesic and antipyretic properties. Its approved indications are the treatment of acute pain, the symptomatic treatment of osteoarthritis and primary dysmenorrhoea in adolescents and adults above 12 years old. Due to concerns about the risk of hepatotoxicity, nimesulide has been withdrawn from market in many countries.','DB04743.svg','51803-78-2','Average: 308.31','None','true','4495','http://pubchem.ncbi.nlm.nih.gov/summary/summary.cgi?cid=4495','https://www.drugbank.ca/drugs/DB04743'),('PTC299','DB05173','Small Molecule','Investigational','PTC299 is a novel, orally administered small-molecule designed to inhibit the production of vascular endothelial growth factor (VEGF) in tumors. Overexpression of VEGF plays a key role in multiple diseases including cancer and macular degeneration. PTC299 was discovered through PTC\'s GEMS technology by targeting the post-transcriptional processes that regulate VEGF formation, and is currently being developed for the treatment of cancer.','DB05173.svg','None','None','None','None','None','None','https://www.drugbank.ca/drugs/DB05173'),('Samarium (153Sm) lexidronam','DB05273','Small Molecule','Approved, Investigational','Samarium Sm 153 lexidronam is a radioactive medication used to treat pain caused by cancer that has spread to the bone. It is a radiopharmaceutical. Radiopharmaceuticals are radioactive agents that may be used to diagnose some diseases by studying the function of the body\'s organs or to treat certain diseases.Samarium Sm 153 lexidronam is used to help relieve the bone pain that may occur with certain kinds of cancer. The radioactive samarium is taken up in the bone cancer area and gives off radiation that helps provide relief of pain.','DB05273.svg','122575-21-7','Average: 586.021','None','None','None','None','https://www.drugbank.ca/drugs/DB05273'),('Icatibant','DB06196','Small Molecule','Approved, Investigational','Icatibant (Firazyr) is a synthetic peptidomimetic drug consisting of ten amino acids, and acts as an effective and specific antagonist of bradykinin B2 receptors. It has been approved in the EU for use in hereditary angioedema, and is under investigation for a number of other conditions in which bradykinin is thought to play a significant role. Icatibant currently has orphan drug status in the United States and FDA approved on August 25, 2011.','DB06196.svg','130308-48-4','Average: 1304.522','None','true','None','None','https://www.drugbank.ca/drugs/DB06196'),('Nitrous oxide','DB06690','Small Molecule','Approved, Vet approved','Nitrous oxide, commonly known as \"laughing gas\", is a chemical compound with the chemical formula N2O. At room temperature, it is a colorless non-flammable gas, with a pleasant, slightly sweet odor and taste. It is used in surgery and dentistry for its anesthetic and analgesic effects. It is known as \"laughing gas\" due to the euphoric effects of inhaling it, a property that has led to its recreational use as an inhalant drug [Wikipedia].','DB06690.svg','10024-97-2','Average: 44.0128','None','None','None','None','https://www.drugbank.ca/drugs/DB06690'),('Ketobemidone','DB06738','Small Molecule','Approved, Investigational','Ketobemidone is a powerful opioid analgesic. Its effectiveness against pain is in the same range as morphine, and it also has some NMDA-antagonist properties. This makes it useful for some types of pain that don\'t respond well to other opioids. The most commonly cited equalisation ratio for analgesic doses is 25 mg of ketobemidone hydrobromide to 60 mg of morphine hydrochloride or sulfate and circa 8 mg of ketobemidone by injection.','DB06738.svg','469-79-4','Average: 247.3327','true','true','None','None','https://www.drugbank.ca/drugs/DB06738'),('Seratrodast','DB06739','Small Molecule','Approved','Seratrodast (INN) is a thromboxane receptor antagonist used primarily in the treatment of asthma.','DB06739.svg','112665-43-7','Average: 354.446','None','true','None','None','https://www.drugbank.ca/drugs/DB06739'),('Drotaverine','DB06751','Small Molecule','Approved, Investigational','Drotaverine (INN, also known as drotaverin) is an antispasmodic drug, structurally related to papaverine. Drotaverine is a selective inhibitor of phosphodiesterase 4, and has no anticholinergic effects. Drotaverine has been shown to possess dose-dependant analgesic effects in animal models. One small study has shown drotaverine to be eliminated mainly non-renally.','DB06751.svg','14009-24-6','Average: 397.5072','None','true','None','None','https://www.drugbank.ca/drugs/DB06751'),('Nepafenac','DB06802','Small Molecule','Approved, Investigational','Nepafenac is a non-steroidal anti-inflammatory prodrug (NSAID) usually sold as a prescription eye drop. It is used to treat pain and inflammation associated with cataract surgery.','DB06802.svg','78281-72-8','Average: 254.2839','true','true','None','None','https://www.drugbank.ca/drugs/DB06802'),('Ferulic acid','DB07767','Small Molecule','Experimental','None','DB07767.svg','1135-24-6','Average: 194.184','None','true','None','None','https://www.drugbank.ca/drugs/DB07767'),('Kebuzone','DB08940','Small Molecule','Experimental','Kebuzone (also known as ketophenylbutazone ) is a non-steroidal anti-inflammatory drug.','DB08940.svg','853-34-9','Average: 322.3578','None','None','None','None','https://www.drugbank.ca/drugs/DB08940'),('Dimetotiazine','DB08967','Small Molecule','Approved','Dimetotiazine has considerable antiemetic & serotonin antagonistic action used mainly in allergic skin conditions.','DB08967.svg','7456-24-8','Average: 391.55','None','None','310264930','http://pubchem.ncbi.nlm.nih.gov/summary/summary.cgi?sid=310264930','https://www.drugbank.ca/drugs/DB08967'),('Pholcodine','DB09209','Small Molecule','Approved, Illicit','Pholcodine formula is 3-o-morpholinoethylmorphine and it is classified as an antitussive which is defined as an opioid cough suppressant. It belongs to the opioid family of compounds and it is widely used.','DB09209.svg','509-67-1','Average: 398.4953','None','true','None','None','https://www.drugbank.ca/drugs/DB09209'),('Loxoprofen','DB09212','Small Molecule','Approved, Investigational','Loxoprofen (INN) is a non-steroidal anti-inflammatory drug in the propionic acid derivatives group, which also includes ibuprofen and naproxen, among others. It is marketed in Brazil, Mexico and Japan by Sankyo as its sodium salt, loxoprofen sodium, under the trade name Loxonin, Argentina as Oxeno and in India as Loxomac. It is available in these countries for oral administration, and a transdermal preparation was approved for sale in Japan in January 2006.','DB09212.svg','68767-14-6','Average: 246.3016','None','true','None','None','https://www.drugbank.ca/drugs/DB09212'),('Curcumin','DB11672','Small Molecule','Approved, Investigational','Curcumin, also known as diferuloylmethane, is an active component in the golden spice turmeric (Curcuma longa) and in','DB11672.svg','458-37-7','Average: 368.3799','None','true','None','None','https://www.drugbank.ca/drugs/DB11672'),('Mizoribine','DB12617','Small Molecule','Investigational','Mizoribine has been investigated for the treatment of Rheumatoid Arthritis.','DB12617.svg','50924-49-7','Average: 259.216','None','None','None','None','https://www.drugbank.ca/drugs/DB12617'),('Apocynin','DB12618','Small Molecule','Investigational','Acetovanillone has been used in trials studying the treatment of Bronchial Asthma and Chronic Obstructive Pulmonary Disease.','DB12618.svg','498-02-2','Average: 166.1739','None','None','None','None','https://www.drugbank.ca/drugs/DB12618'),('Higenamine','DB12779','Small Molecule','Investigational','Higenamine is under investigation in clinical trial NCT01451229 (Pharmacokinetics and Pharmacodynamics of Higenamine in Chinese Healthy Subjects).','DB12779.svg','5843-65-2','Average: 271.3111','None','None','None','None','https://www.drugbank.ca/drugs/DB12779'),('Fentiazac','DB13217','Small Molecule','Experimental','None','DB13217.svg','18046-21-4','Average: 329.8','None','None','None','None','https://www.drugbank.ca/drugs/DB13217'),('Bufexamac','DB13346','Small Molecule','Approved, Experimental','Bufexamac is a non-steroidal anti-inflammatory drug (NSAID) under the market name Droxaryl, Malipuran, Paraderm and Parfenac. It is typically administered topically for the treatment of subacute and chronic eczema of the skin, including atopic eczema and other inflammatory dermatoses, as well as sunburn and other minor burns, and itching. It has also been used in suppositories in combination with local anaesthetics indicated for haemorrhoids. The use of bufexamac has been discontinued in Canada and the United States, which may be due to undetermined clinical efficacy and a high prevalence of contact sensitization','DB13346.svg','2438-72-4','Average: 223.272','None','true','None','None','https://www.drugbank.ca/drugs/DB13346'),('Aloxiprin','DB13509','Small Molecule','Experimental','None','DB13509.svg','9014-67-9','Average: 282.119','None','None','None','None','https://www.drugbank.ca/drugs/DB13509'),('Pranoprofen','DB13514','Small Molecule','Experimental, Investigational','None','DB13514.svg','52549-17-4','Average: 255.2686','None','None','None','None','https://www.drugbank.ca/drugs/DB13514');

