/*Table structure for table `drugbank_target` */

DROP TABLE IF EXISTS `drugbank_target`;

CREATE TABLE `drugbank_target` (
  `target_name` varchar(200) NOT NULL,
  `Kind` varchar(200) DEFAULT NULL,
  `Organism` varchar(200) DEFAULT NULL,
  `General_Function` text,
  `Specific_Function` text,
  `Gene_Name` varchar(200) DEFAULT NULL,
  `Molecular_Weight` varchar(200) DEFAULT NULL,
  `drugbank_id` varchar(200) DEFAULT NULL,
  `Gene_sequence` text,
  PRIMARY KEY (`target_name`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

