insert  into `drugbank_target`(`target_name`,`Kind`,`Organism`,`General_Function`,`Specific_Function`,`Gene_Name`,`Molecular_Weight`,`drugbank_id`,`Gene_sequence`) values ('3-phosphoinositide-dependent protein kinase 1','None','Human','Protein serine/threonine kinase activity','Serine/threonine kinase which acts as a master kinase, phosphorylating and activating a subgroup of the AGC family of protein kinases. Its targets include: protein kinase B (PKB/AKT1, PKB/AKT2, PKB/AKT3), p70 ribosomal protein S6 kinase (RPS6KB1), p90 ribosomal protein S6 kinase (RPS6KA1, RPS6KA2 and RPS6KA3), cyclic AMP-dependent protein kinase (PRKACA), protein kinase C (PRKCD and PRKCZ), serum and glucocorticoid-inducible kinase (SGK1, SGK2 and SGK3), p21-activated kinase-1 (PAK1), protein kinase PKN (PKN1 and PKN2). Plays a central role in the transduction of signals from insulin by providing the activating phosphorylation to PKB/AKT1, thus propagating the signal to downstream targets controlling cell proliferation and survival, as well as glucose and amino acid uptake and storage. Negatively regulates the TGF-beta-induced signaling by: modulating the association of SMAD3 and SMAD7 with TGF-beta receptor, phosphorylating SMAD2, SMAD3, SMAD4 and SMAD7, preventing the nuclear translocation of SMAD3 and SMAD4 and the translocation of SMAD7 from the nucleus to the cytoplasm in response to TGF-beta. Activates PPARG transcriptional activity and promotes adipocyte differentiation. Activates the NF-kappa-B pathway via phosphorylation of IKKB. The tyrosine phosphorylated form is crucial for the regulation of focal adhesions by angiotensin II. Controls proliferation, survival, and growth of developing pancreatic cells. Participates in the regulation of Ca(2+) entry and Ca(2+)-activated K(+) channels of mast cells. Essential for the motility of vascular endothelial cells (ECs) and is involved in the regulation of their chemotaxis. Plays a critical role in cardiac homeostasis by serving as a dual effector for cell survival and beta-adrenergic response. Plays an important role during thymocyte development by regulating the expression of key nutrient receptors on the surface of pre-T cells and mediating Notch-induced cell growth and proliferative responses. Provides negative feedback inhibition to toll-like receptor-mediated NF-kappa-B activation in macrophages. Isoform 3 is catalytically inactive.','PDPK1','63151.305','DB00482','>lcl|BSEQ0021289|3-phosphoinositide-dependent protein kinase 1 (PDPK1)\nATGGCCAGGACCACCAGCCAGCTGTATGACGCCGTGCCCATCCAGTCCAGCGTGGTGTTA\nTGTTCCTGCCCATCCCCATCAATGGTGAGGACCCAGACTGAGTCCAGCACGCCCCCTGGC\nATTCCTGGTGGCAGCAGGCAGGGCCCCGCCATGGACGGCACTGCAGCCGAGCCTCGGCCC\nGGCGCCGGCTCCCTGCAGCATGCCCAGCCTCCGCCGCAGCCTCGGAAGAAGCGGCCTGAG\nGACTTCAAGTTTGGGAAAATCCTTGGGGAAGGCTCTTTTTCCACGGTTGTCCTGGCTCGA\nGAACTGGCAACCTCCAGAGAATATGCGATTAAAATTCTGGAGAAGCGACATATCATAAAA\nGAGAACAAGGTCCCCTATGTAACCAGAGAGCGGGATGTCATGTCGCGCCTGGATCACCCC\nTTCTTTGTTAAGCTTTACTTCACATTTCAGGACGACGAGAAGCTGTATTTCGGCCTTAGT\nTATGCCAAAAATGGAGAACTACTTAAATATATTCGCAAAATCGGTTCATTCGATGAGACC\nTGTACCCGATTTTACACGGCTGAGATTGTGTCTGCTTTAGAGTACTTGCACGGCAAGGGC\nATCATTCACAGGGACCTTAAACCGGAAAACATTTTGTTAAATGAAGATATGCACATCCAG\nATCACAGATTTTGGAACAGCAAAAGTCTTATCCCCAGAGAGCAAACAAGCCAGGGCCAAC\nTCATTCGTGGGAACAGCGCAGTACGTTTCTCCAGAGCTGCTCACGGAGAAGTCCGCCTGT\nAAGAGTTCAGACCTTTGGGCTCTTGGATGCATAATATACCAGCTTGTGGCAGGACTCCCA\nCCATTCCGAGCTGGAAACGAGTATCTTATATTTCAGAAGATCATTAAGTTGGAATATGAC\nTTTCCAGAAAAATTCTTCCCTAAGGCAAGAGACCTCGTGGAGAAACTTTTGGTTTTAGAT\nGCCACAAAGCGGTTAGGCTGTGAGGAAATGGAAGGATACGGACCTCTTAAAGCACACCCG\nTTCTTCGAGTCCGTCACGTGGGAGAACCTGCACCAGCAGACGCCTCCGAAGCTCACCGCT\nTACCTGCCGGCTATGTCGGAAGACGACGAGGACTGCTATGGCAATTATGACAATCTCCTG\nAGCCAGTTTGGCTGCATGCAGGTGTCTTCGTCCTCCTCCTCACACTCCCTGTCAGCCTCC\nGACACGGGCCTGCCCCAGAGGTCAGGCAGCAACATAGAGCAGTACATTCACGATCTGGAC\nTCGAACTCCTTTGAACTGGACTTACAGTTTTCCGAAGATGAGAAGAGGTTGTTGTTGGAG\nAAGCAGGCTGGCGGAAACCCTTGCCTAACAGGACGTATTATCTGA'),('5\'-AMP-activated protein kinase catalytic subunit alpha-1','None','Human','Tau-protein kinase activity','Catalytic subunit of AMP-activated protein kinase (AMPK), an energy sensor protein kinase that plays a key role in regulating cellular energy metabolism. In response to reduction of intracellular ATP levels, AMPK activates energy-producing pathways and inhibits energy-consuming processes: inhibits protein, carbohydrate and lipid biosynthesis, as well as cell growth and proliferation. AMPK acts via direct phosphorylation of metabolic enzymes, and by longer-term effects via phosphorylation of transcription regulators. Also acts as a regulator of cellular polarity by remodeling the actin cytoskeleton; probably by indirectly activating myosin. Regulates lipid synthesis by phosphorylating and inactivating lipid metabolic enzymes such as ACACA, ACACB, GYS1, HMGCR and LIPE; regulates fatty acid and cholesterol synthesis by phosphorylating acetyl-CoA carboxylase (ACACA and ACACB) and hormone-sensitive lipase (LIPE) enzymes, respectively. Regulates insulin-signaling and glycolysis by phosphorylating IRS1, PFKFB2 and PFKFB3. AMPK stimulates glucose uptake in muscle by increasing the translocation of the glucose transporter SLC2A4/GLUT4 to the plasma membrane, possibly by mediating phosphorylation of TBC1D4/AS160. Regulates transcription and chromatin structure by phosphorylating transcription regulators involved in energy metabolism such as CRTC2/TORC2, FOXO3, histone H2B, HDAC5, MEF2C, MLXIPL/ChREBP, EP300, HNF4A, p53/TP53, SREBF1, SREBF2 and PPARGC1A. Acts as a key regulator of glucose homeostasis in liver by phosphorylating CRTC2/TORC2, leading to CRTC2/TORC2 sequestration in the cytoplasm. In response to stress, phosphorylates \'Ser-36\' of histone H2B (H2BS36ph), leading to promote transcription. Acts as a key regulator of cell growth and proliferation by phosphorylating TSC2, RPTOR and ATG1/ULK1: in response to nutrient limitation, negatively regulates the mTORC1 complex by phosphorylating RPTOR component of the mTORC1 complex and by phosphorylating and activating TSC2. In response to nutrient limitation, promotes autophagy by phosphorylating and activating ATG1/ULK1. AMPK also acts as a regulator of circadian rhythm by mediating phosphorylation of CRY1, leading to destabilize it. May regulate the Wnt signaling pathway by phosphorylating CTNNB1, leading to stabilize it. Also has tau-protein kinase activity: in response to amyloid beta A4 protein (APP) exposure, activated by CAMKK2, leading to phosphorylation of MAPT/TAU; however the relevance of such data remains unclear in vivo. Also phosphorylates CFTR, EEF2K, KLC1, NOS3 and SLC12A1.','PRKAA1','64008.64','DB00945','>lcl|BSEQ0010471|5\'-AMP-activated protein kinase catalytic subunit alpha-1 (PRKAA1)\nATGCGCAGACTCAGTTCCTGGAGAAAGATGGCGACAGCCGAGAAGCAGAAACACGACGGG\nCGGGTGAAGATCGGCCACTACATTCTGGGTGACACGCTGGGGGTCGGCACCTTCGGCAAA\nGTGAAGGTTGGCAAACATGAATTGACTGGGCATAAAGTAGCTGTGAAGATACTCAATCGA\nCAGAAGATTCGGAGCCTTGATGTGGTAGGAAAAATCCGCAGAGAAATTCAGAACCTCAAG\nCTTTTCAGGCATCCTCATATAATTAAACTGTACCAGGTCATCAGTACACCATCTGATATT\nTTCATGGTGATGGAATATGTCTCAGGAGGAGAGCTATTTGATTATATCTGTAAGAATGGA\nAGGCTGGATGAAAAAGAAAGTCGGCGTCTGTTCCAACAGATCCTTTCTGGTGTGGATTAT\nTGTCACAGGCATATGGTGGTCCATAGAGATTTGAAACCTGAAAATGTCCTGCTTGATGCA\nCACATGAATGCAAAGATAGCTGATTTTGGTCTTTCAAACATGATGTCAGATGGTGAATTT\nTTAAGAACAAGTTGTGGCTCACCCAACTATGCTGCACCAGAAGTAATTTCAGGAAGATTG\nTATGCAGGCCCAGAGGTAGATATATGGAGCAGTGGGGTTATTCTCTATGCTTTATTATGT\nGGAACCCTTCCATTTGATGATGACCATGTGCCAACTCTTTTTAAGAAGATATGTGATGGG\nATCTTCTATACCCCTCAATATTTAAATCCTTCTGTGATTAGCCTTTTGAAACATATGCTG\nCAGGTGGATCCCATGAAGAGGGCCACAATCAAAGATATCAGGGAACATGAATGGTTTAAA\nCAGGACCTTCCAAAATATCTCTTTCCTGAGGATCCATCATATAGTTCAACCATGATTGAT\nGATGAAGCCTTAAAAGAAGTATGTGAAAAGTTTGAGTGCTCAGAAGAGGAAGTTCTCAGC\nTGTCTTTACAACAGAAATCACCAGGATCCTTTGGCAGTTGCCTACCATCTCATAATAGAT\nAACAGGAGAATAATGAATGAAGCCAAAGATTTCTATTTGGCGACAAGCCCACCTGATTCT\nTTTCTTGATGATCATCACCTGACTCGGCCCCATCCTGAAAGAGTACCATTCTTGGTTGCT\nGAAACACCAAGGGCACGCCATACCCTTGATGAATTAAATCCACAGAAATCCAAACACCAA\nGGTGTAAGGAAAGCAAAATGGCATTTAGGAATTAGAAGTCAAAGTCGACCAAATGATATT\nATGGCAGAAGTATGTAGAGCAATCAAACAATTGGATTATGAATGGAAGGTTGTAAACCCA\nTATTATTTGCGTGTACGAAGGAAGAATCCTGTGACAAGCACTTACTCCAAAATGAGTCTA\nCAGTTATACCAAGTGGATAGTAGAACTTATCTACTGGATTTCCGTAGTATTGATGATGAA\nATTACAGAAGCCAAATCAGGGACTGCTACTCCACAGAGATCGGGATCAGTTAGCAACTAT\nCGATCTTGCCAAAGGAGTGATTCAGATGCTGAGGCTCAAGGAAAATCCTCAGAAGTTTCT\nCTTACCTCATCTGTGACCTCACTTGACTCTTCTCCTGTTGACCTAACTCCAAGACCTGGA\nAGTCACACAATAGAATTTTTTGAGATGTGTGCAAATCTAATTAAAATTCTTGCACAATAA'),('5-hydroxytryptamine receptor 1','protein group','Human','None','None','None','None','DB01221','None'),('5-hydroxytryptamine receptor 1A','None','Human','Serotonin receptor activity','G-protein coupled receptor for 5-hydroxytryptamine (serotonin). Also functions as a receptor for various drugs and psychoactive substances. Ligand binding causes a conformation change that triggers signaling via guanine nucleotide-binding proteins (G proteins) and modulates the activity of down-stream effectors, such as adenylate cyclase. Beta-arrestin family members inhibit signaling via G proteins and mediate activation of alternative signaling pathways. Signaling inhibits adenylate cyclase activity and activates a phosphatidylinositol-calcium second messenger system that regulates the release of Ca(2+) ions from intracellular stores. Plays a role in the regulation of 5-hydroxytryptamine release and in the regulation of dopamine and 5-hydroxytryptamine metabolism. Plays a role in the regulation of dopamine and 5-hydroxytryptamine levels in the brain, and thereby affects neural activity, mood and behavior. Plays a role in the response to anxiogenic stimuli.','HTR1A','46106.335','DB01149','>lcl|BSEQ0018935|5-hydroxytryptamine receptor 1A (HTR1A)\nATGGATGTGCTCAGCCCTGGTCAGGGCAACAACACCACATCACCACCGGCTCCCTTTGAG\nACCGGCGGCAACACTACTGGTATCTCCGACGTGACCGTCAGCTACCAAGTGATCACCTCT\nCTGCTGCTGGGCACGCTCATCTTCTGCGCGGTGCTGGGCAATGCGTGCGTGGTGGCTGCC\nATCGCCTTGGAGCGCTCCCTGCAGAACGTGGCCAATTATCTTATTGGCTCTTTGGCGGTC\nACCGACCTCATGGTGTCGGTGTTGGTGCTGCCCATGGCCGCG