 in immune response, growth control, or protection against apoptosis. Negatively regulates the pathway by phosphorylating the scaffold protein TAXBP1 and thus promoting the assembly of the A20/TNFAIP3 ubiquitin-editing complex (composed of A20/TNFAIP3, TAX1BP1, and the E3 ligases ITCH and RNF11). Therefore, CHUK plays a key role in the negative feedback of NF-kappa-B canonical signaling to limit inflammatory gene activation. As part of the non-canonical pathway of NF-kappa-B activation, the MAP3K14-activated CHUK/IKKA homodimer phosphorylates NFKB2/p100 associated with RelB, inducing its proteolytic processing to NFKB2/p52 and the formation of NF-kappa-B RelB-p52 complexes. In turn, these complexes regulate genes encoding molecules involved in B-cell survival and lymphoid organogenesis. Participates also in the negative feedback of the non-canonical NF-kappa-B signaling pathway by phosphorylating and destabilizing MAP3K14/NIK. Within the nucleus, phosphorylates CREBBP and consequently increases both its transcriptional and histone acetyltransferase activities. Modulates chromatin accessibility at NF-kappa-B-responsive promoters by phosphorylating histones H3 at \'Ser-10\' that are subsequently acetylated at \'Lys-14\' by CREBBP. Additionally, phosphorylates the CREBBP-interacting protein NCOA3. Also phosphorylates FOXO3 and may regulate this pro-apoptotic transcription factor (PubMed:15084260).','CHUK','84638.88','DB00795','>lcl|BSEQ0013243|Inhibitor of nuclear factor kappa-B kinase subunit alpha (CHUK)\nATGGAGCGGCCCCCGGGGCTGCGGCCGGGCGCGGGCGGGCCCTGGGAGATGCGGGAGCGG\nCTGGGCACCGGCGGCTTCGGGAACGTCTGTCTGTACCAGCATCGGGAACTTGATCTCAAA\nATAGCAATTAAGTCTTGTCGCCTAGAGCTAAGTACCAAAAACAGAGAACGATGGTGCCAT\nGAAATCCAGATTATGAAGAAGTTGAACCATGCCAATGTTGTAAAGGCCTGTGATGTTCCT\nGAAGAATTGAATATTTTGATTCATGATGTGCCTCTTCTAGCAATGGAATACTGTTCTGGA\nGGAGATCTCCGAAAGCTGCTCAACAAACCAGAAAATTGTTGTGGACTTAAAGAAAGCCAG\nATACTTTCTTTACTAAGTGATATAGGGTCTGGGATTCGATATTTGCATGAAAACAAAATT\nATACATCGAGATCTAAAACCTGAAAACATAGTTCTT