kappa-B signaling pathway which is activated by multiple stimuli such as inflammatory cytokines, bacterial or viral products, DNA damages or other cellular stresses. Acts as part of the canonical IKK complex in the conventional pathway of NF-kappa-B activation and phosphorylates inhibitors of NF-kappa-B on 2 critical serine residues. These modifications allow polyubiquitination of the inhibitors and subsequent degradation by the proteasome. In turn, free NF-kappa-B is translocated into the nucleus and activates the transcription of hundreds of genes involved in immune response, growth control, or protection against apoptosis. In addition to the NF-kappa-B inhibitors, phosphorylates several other components of the signaling pathway including NEMO/IKBKG, NF-kappa-B subunits RELA and NFKB1, as well as IKK-related kinases TBK1 and IKBKE. IKK-related kinase phosphorylations may prevent the overproduction of inflammatory mediators since they exert a negative regulation on canonical IKKs. Phosphorylates FOXO3, mediating the TNF-dependent inactivation of this pro-apoptotic transcription factor. Also phosphorylates other substrates including NCOA3, BCL10 and IRS1. Within the nucleus, acts as an adapter protein for NFKBIA degradation in UV-induced NF-kappa-B activation.','IKBKB','86563.245','DB00795','>lcl|BSEQ0010805|Inhibitor of nuclear factor kappa-B kinase subunit beta (IKBKB)\nATGTTTTCAGGGGGGTGTCATAGCCCCGGGTTTGGCCGCCCCAGCCCCGCCTTCCCCGCC\nCCGGGGAGCCCGCCCCCTGCCCCGCGTCCCTGCCGACAGGAAACAGGTGAGCAGATTGCC\nATCAAGCAGTGCCGGCAGGAGCTCAGCCCCCGGAACCGAGAGCGGTGGTGCCTGGAGATC\nCAGATCATGAGAAGGCTGACCCACCCCAATGTGGTGGCTGCCCGAGATGTCCCTGAGGGG\nATGCAGAACTTGGCGCCCAATGACCTGCCCCTGCTGGCCATGGAGTACTGCCAAGGAGGA\nGATCTCCGGAAGTACCTGAACCAGTTTGAGAACTGCTGTGGTCTGCGGGAAGGTGCCATC\nCTCACCTTGCTGAGTGACATTGCCTCTGCGCTTAGATACCTTCATGAAAACAGAATCATC\nCATCGGGATCTAAAGCCAGAAAACATCGTCCTGCAGCAAGGAGAACAGAGGTTAATACAC\nAAAATTATTGACCTAGGATATGCCAAGGAGCTGGATCAGGGCAGTCTTTGCACATCATTC\nGTGGGGACCCTGCAGTACCTGGCCCCAGAGCTACTGGAGCAGCAGAA