lipid A portion of bacterial lipopolysaccharide (LPS), lysozyme and DNA.Lactoferricin binds to the bacterial surface and is crucial for the bactericidal functions. Has some antiviral activity against papillomavirus infection. N-terminal region shows strong antifungal activity against C.albicans. Contains two BBXB heparin-binding consensus sequences that appear to form the predominate functional GAG-binding site.Kaliocin-1 has antimicrobial activity and is able to permeabilize different ions through liposomal membranes.Lactoferroxins A, B and C have opioid antagonist activity. Lactoferroxin A shows preference for mu-receptors, while lactoferroxin B and C have somewhat higher degrees of preference for kappa-receptors than for mu-receptors.The lactotransferrin transferrin-like domain 1 functions as a serine protease of the peptidase S60 family that cuts arginine rich regions. This function contributes to the antimicrobial activity.Isoform DeltaLf: transcription factor with antiproliferative properties and ability to induce cell cycle arrest. Binds to the DeltaLf response element found in the SKP1, BAX, DCPS, and SELH promoters.','LTF','78181.225','DB08439','>lcl|BSEQ0020499|Lactotransferrin (LTF)\nATGAGAAAAGTGCGTGGCCCTCCTGTCAGCTGCATAAAGAGAGACTCCCCCATCCAGTGT\nATCCAGGCCATTGCGGAAAACAGGGCCGATGCTGTGACCCTTGATGGTGGTTTCATATAC\nGAGGCAGGCCTGGCCCCCTACAAACTGCGACCTGTAGCGGCGGAAGTCTACGGGACCGAA\nAGACAGCCACGAACTCACTATTATGCCGTGGCTGTGGTGAAGAAGGGCGGCAGCTTTCAG\nCTGAACGAACTGCAAGGTCTGAAGTCCTGCCACACAGGCCTTCGCAGGACCGCTGGATGG\nAATGTCCCTATAGGGACACTTCGTCCATTCTTGAATTGGACGGGTCCACCTGAGCCCATT\nGAGGCAGCTGTGGCCAGGTTCTTCTCAGCCAGCTGTGTTCCCGGTGCAGATAAAGGACAG\nTTCCCCAACCTGTGTCGCCTGTGTGCGGGGACAGGGGAAAACAAATGTGCCTTCTCCTCC\nCAGGAACCGTACTTCAGCTACTCTGGTGCCTTCAAGTGTCTGAGAGACGGGGCTGGAGAC\nGTGGCTTTTATCAGAGAGAGCACAGTGTTTGAGGACCTGTCAGACGAGGCTGAAAGGGAC\nGAGTATGAGTTACTCTGCCCAGACAACACTCGGAAGCCAGTGGACAAGTTCAAAGACTGC\nCATCTGGCCCGGGTCCCTTCTCATGCCGTTGTGGCACGAAGTGTGAATGGCAAGGAGGAT\nGCCATCTGGAATCTTCTCCGCCAGGCACAGGAAAAGTTTGGA