annel activity. The influx of protons into virion interior is believed to disrupt interactions between the viral ribonucleoprotein (RNP), matrix protein 1 (M1), and lipid bilayers, thereby freeing the viral genome from interaction with viral proteins and enabling RNA segments to migrate to the host cell nucleus, where influenza virus RNA transcription and replication occur. Also plays a role in viral proteins secretory pathway. Elevates the intravesicular pH of normally acidic compartments, such as trans-Golgi network, preventing newly formed hemagglutinin from premature switching to the fusion-active conformation (By similarity).','M','11165.62','DB00915','>lcl|BSEQ0001255|294 bp\nATGAGTCTTCTAACCGAGGTCGAAACGCCTATCAGAAACGAATGGGGGTGCAGATGCAAC\nGATTCAAGTGACCCTCTTGTTGTTGCCGCGAGTATCATTGGGATCTTGCACTTGATATTG\nTGGATTCTTGATCATCTTTTTTTCAAATGCATTTATCGCTTCTTTAAACACGGTCTGAAA\nAGAGGGCCTTCTACGGAAGGAGTACCAGAGTCTATGAGGGAAGAATATCGAAAGGAACAG\nCAGAGTGCTGTGGATGCTGACGATAGTCATTTTGTCAGCATAGAGCTGGAGTAA'),('Melatonin receptor type 1A','None','Human','Organic cyclic compound binding','High affinity receptor for melatonin. Likely to mediates the reproductive and circadian actions of melatonin. The activity of this receptor is mediated by pertussis toxin sensitive G proteins that inhibit adenylate cyclase activity.','MTNR1A','39374.315','DB02709','>lcl|BSEQ0010363|Melatonin receptor type 1A (MTNR1A)\nATGCAGGGCAACGGCAGCGCGCTGCCCAACGCCTCCCAGCCCGTGCTCCGCGGGGACGGC\nGCGCGGCCCTCGTGGCTGGCGTCCGCCCTGGCCTGCGTCCTCATCTTCACCATCGTGGTG\nGACATCCTGGGCAACCTCCTGGTCATCCTGTCGGTGTATCGGAACAAGAAGCTCAGGAAC\nGCAGGAAACATCTTTGTGGTGAGCTTAGCGGTGGCAGACCTGGTGGTGGCCATTTATCCG\nTACCCGTTGGTGCTGATGTCGATATTTAACAACGGGTGGAACCTGGGCTATCTGCACTGC\nCAAGTCAGTGGGTTCCTGATGGGCCTGAGCGTCATCGGCTCCATATTCAACATCACCGGC\nATCGCCATCAACCGCTACTGCTACATCTGCCACAGTCTCAAGTACGACAAACTGTACAGC\nAGCAAGAACTCCCTCTGCTACGTGCTCCTCATATGGCTCCTGACGCTGGCGGCCGTCCTG\nCCCAACCTCCGTGCAGGGACTCTCCAGTACGACCCGAGGATCTACTCGTGCACCTTCGCC\nCAGTCCGTCAGCTCCGCCTACACCATCGCCGTGGTGGTTTTCCACT