TCTCTAG'),('Mitogen-activated protein kinase 3','None','Human','Phosphatase binding','Serine/threonine kinase which acts as an essential component of the MAP kinase signal transduction pathway. MAPK1/ERK2 and MAPK3/ERK1 are the 2 MAPKs which play an important role in the MAPK/ERK cascade. They participate also in a signaling cascade initiated by activated KIT and KITLG/SCF. Depending on the cellular context, the MAPK/ERK cascade mediates diverse biological functions such as cell growth, adhesion, survival and differentiation through the regulation of transcription, translation, cytoskeletal rearrangements. The MAPK/ERK cascade plays also a role in initiation and regulation of meiosis, mitosis, and postmitotic functions in differentiated cells by phosphorylating a number of transcription factors. About 160 substrates have already been discovered for ERKs. Many of these substrates are localized in the nucleus, and seem to participate in the regulation of transcription upon stimulation. However, other substrates are found in the cytosol as well as in other cellular organelles, and those are responsible for processes such as translation, mitosis and apoptosis. Moreover, the MAPK/ERK cascade is also involved in the regulation of the endosomal dynamics, including lysosome processing and endosome cycling through the perinuclear recycling compartment (PNRC); as well as in the fragmentation of the Golgi apparatus during mitosis. The substrates include transcription factors (such as ATF2, BCL6, ELK1, ERF, FOS, HSF4 or SPZ1), cytoskeletal elements (such as CANX, CTTN, GJA1, MAP2, MAPT, PXN, SORBS3 or STMN1), regulators of apoptosis (such as BAD, BTG2, CASP9, DAPK1, IER3, MCL1 or PPARG), regulators of translation (such as EIF4EBP1) and a variety of other signaling-related molecules (like ARHGEF2, FRS2 or GRB10). Protein kinases (such as RAF1, RPS6KA1/RSK1, RPS6KA3/RSK2, RPS6KA2/RSK3, RPS6KA6/RSK4, SYK, MKNK1/MNK1, MKNK2/MNK2, RPS6KA5/MSK1, RPS6KA4/MSK2, MAPKAPK3 or MAPKAPK5) and phosphatases (such as DUSP1, DUSP4, DUSP6 or DUSP16) are other substrates which enable the propagation the MAPK/ERK signal to additional cytosolic and nuclear targets, thereby extending the specificity of the cascade.','MAPK3','43135.16','DB00605','>lcl|BSEQ0021655|Mitogen-activated protein kinase 3 (MAPK3)\nATGGCGGCGGCGGCGGCTCAGGGGGGCGGGGGCGGGGAGCCCCGTAGAACCGAGGGGGTC\nGGCCCGGGGGTCCCGGGGGAGGTGGAGATGGTGAAGGGGCAGCCGTTCGACGTGGGCCCG\nCGCTACACGCAGTTGCAGTACATCGGCGAGGGCGCGTACGGCATGGTCAGCTCGGCCTAT\nGACCACGTGCGCAAGACTCGCGTGGCCATCAAGAAGATCAGCCCCTTCGAACATCAGACC\nTACTGCCAGCGCACGCTCCGGGAGATCCAGATCCTGCTGCGCTTCCGCCATGAGAATGTC\nATCGGCATCCGAGACATTCTGCGGGCGTCCACCCTGGAAGCCATGAGAGATGTCTACATT\nGTGCAGGACCTGATGGAGACTGACCTGTACAAGTTGCTGAAAAGCCAGCAGCTGAGCAAT\nGACCATATCTGCTACTTCCTCTACCAGATCCTGCGGGGCCTCAAGTACATCCACTCCGCC\nAACGTGCTCCACCGAGATCTAAAGCCCTCCAACCTGCTCATCAACACCACCTGCGACCTT\nAAGATTTGTGATTTCGGCCTGGCCCGGATTGCCGATCCTGAGCATGACCACACCGGCTTC\nCTGACGGAGTATGTGGCTACGCGCTGGTACCGGGCCCCAGAGATCATGCTGAACTCCAAG\nGGCTATACCAAGTCCATCGACATCTGGTCTGTGGGCTGCATTCTGGCTGAGATGCTCTCT\nAACCGGCCCATCTTCCCTGGCAAGCACTACCTGGATCAGCTCAACCACATTCTGGGCATC\nCTGGGCTCCCCATCCCAGGAGGACCTGAATTGTATCATCAACATGAAGGCCCGAAACTAC\nCTACAGTCTCTGCCCTCCAAGACCAAGGTGGCTTGGGCCAAGCTTTTCCCCAAGTCAGAC\nTCCAAAGCCCTTGACCTGCTGGACCGGATGTTAACCTTTAACCCCAATAAACGGATCACA\nGTGGAGGAAGCGCTGGCTCACCCCTACCTGGAGCAGTACTATGACCCGACGGATGAGGTG\nGGCCAGTCCCCAGCAGCAGTGGGGCTGGGGGCAGGGGAGCAGGGGGGCACGTAG'),('Mu-type opioid receptor','None','Human','Voltage-gated calcium channel activity','Receptor for endogenous opioids such as beta-endorphin and endomorphin. Receptor for natural and synthetic opioids including morphine, heroin, DAMGO, fentanyl, etorphine, buprenorphin and methadone. Agonist binding to the receptor induces coupling to an inactive GDP-bound heterotrimeric G-protein complex and subsequent exchange of GDP for GTP in the G-protein alpha subunit leading to dissociation of the G-protein complex with the free GTP-bound G-protein alpha and the G-protein beta-gamma dimer activating downstream cellular effectors. The agonist- and cell type-specific activity is predominantly coupled to pertussis toxin-sensitive G(i) and G(o) G alpha proteins, GNAI1, GNAI2, GNAI3 and GNAO1 isoforms Alpha-1 and Alpha-2, and to a lesser extend to pertussis toxin-insensitive G alpha proteins GNAZ and GNA15. They mediate an array of downstream cellular responses, including inhibition of adenylate cyclase activity and both N-type and L-type calcium channels, activation of inward rectifying potassium channels, mitogen-activated protein kinase (MAPK), phospholipase C (PLC), phosphoinositide/protein kinase (PKC), phosphoinositide 3-kinase (PI3K) and regulation of NF-kappa-B. Also couples to adenylate cyclase stimulatory G alpha proteins. The selective temporal coupling to G-proteins and subsequent signaling can be regulated by RGSZ proteins, such as RGS9, RGS17 and RGS4. Phosphorylation by members of the GPRK subfamily of Ser/Thr protein kinases and association with beta-arrestins is involved in short-term receptor desensitization. Beta-arrestins associate with the GPRK-phosphorylated receptor and uncouple it from the G-protein thus terminating signal transduction. The phosphorylated receptor is internalized through endocytosis via clathrin-coated pits which involves beta-arrestins. The activation of the ERK pathway occurs either in a G-protein-dependent or a beta-arrestin-dependent manner and is regulated by agonist-specific receptor phosphorylation. Acts as a class A G-protein coupled receptor (GPCR) which dissociates from beta-arrestin at or near the plasma membrane and undergoes rapid recycling. Receptor down-regulation pathways are varying with the agonist and occur dependent or independent of G-protein coupling. Endogenous ligands induce rapid desensitization, endocytosis and recycling whereas morphine induces only low desensitization and endocytosis. Heterooligomerization with other GPCRs can modulate agonist binding, signaling and trafficking properties. Involved in neurogenesis. Isoform 12 couples to GNAS and is proposed to be involved in excitatory effects. Isoform 16 and isoform 17 do not bind agonists but may act through oligomerization with binding-competent OPRM1 isoforms and reduce their ligand binding activity.','OPRM1','44778.855','DB01452','>lcl|BSEQ0021649|Mu-type opioid receptor (OPRM1)\nATGGACAGCAGCGCTGCCCCCACGAACGCCAGCAATTGCACTGATGCCTTGGCGTACTCA\nAGTTGCTCCCCAGCACCCAGCCCCGGTTCCTGGGTCAACTTGTCCCACTTAGATGGCAAC\nCTGTCCGACCCATGCGGTCCGAACCGCACCGACCTGGGCGGGAGAGACAGCCTGTGCCCT\nCCGACCGGCAGTCCCTCCATGATCACGGCCATCACGATCATGGCCCTCTACTCCATCGTG\nTGCGTGGTGGGGCTCTTCGGAAACTTCCTGGTCATGTATGTGATTGTCAGATACACCAAG\nATGAAGACTGCCACCAACATCTACATTTTCAACCTTGCTCTGGCAGATGCCTTAGCCACC\nAGTACCCTGCCCTTCCAGAGTGTGAATTACCTAATGGGAACATGGCCATTTGGAACCATC\nCTTTGCAAGATAGTGATCTCCATAGATTACTATAACATGTTCACCAGCATATTCACCCTC\nTGCACCATGAGTGTTGATCGATACATTGCAGTCTGCCACCCTGTCAAGGCCTTAGATTTC\nCGTACTCCCCGAAATGCCAAAATTATCAATGTCTGCAACTGGATCCTCTCTTCAGCCATT\nGGTCTTCCTGTAATGTTCATGGCTACAACAAAATACAGGCAAGGTTCCATAGATTGTACA\nCTAACATTCTCTCATCCAACCTGGTACTGGGAAAACCTGCTGAAGATCTGTGTTTTCATC\nTTCGCCTTCATTATGCCAGTGCTCATCATTACCGTGTGCTATGGACTGATGATCTTGCGC\nCTCAAGAGTGTCCGCATGCTCTCTGGCTCCAAAGAAAAGGACAGGAATCTTCGAAGGATC\nACCAGGATGGTGCTGGTGGTGGTGGCTGTGTTCATCGTCTGCTGGACTCCCATTCACATT\nTACGTCATCATTAAAGCCTTGGTTACAATCCCAGAAACTACGTTCCAGACTGTTTCTTGG\nCACTTCTGCATTGCTCTAGGTTACACAAACAGCTGCCTCAACCCAGTCCTTTATGCATTT\nCTGGATGAAAACTTCAAACGATGCTTCAGAGAGTTCTGTATCCCAACCTCTTCCAACATT\nGAGCAACAAAACTCCACTCGAATTCGTCAGAACACTAGAGACCACCCCTCCACGGCCAAT\nACAGTGGATAGAACTAATCATCAGCTAGAAAATCTGGAAGCAGAAACTGCTCCGTTGCCC\nTAA'),('Multidrug resistance protein 1','None','Human','Xenobiotic-transporting atpase activity','Energy-dependent efflux pump responsible for decreased drug accumulation in multidrug-resistant cells.','ABCB1','141477.255','DB00482','>lcl|BSEQ0016291|Multidrug resistance protein 1 (ABCB1)\nATGGATCTTGAAGGGGACCGCAATGGAGGAGCAAAGAAGAAGAACTTTTTTAAACTGAAC\nAATAAAAGTGAAAAAGATAAGAAGGAAAAGAAACCAACTGTCAGT