ltage difference across the membrane (PubMed:11507158). Can form functional homotetrameric channels and heterotetrameric channels that contain variable proportions of KCND2 and KCND3; channel properties depend on the type of pore-forming alpha subunits that are part of the channel. In vivo, membranes probably contain a mixture of heteromeric potassium channel complexes. Interaction with specific isoforms of the regulatory subunits KCNIP1, KCNIP2, KCNIP3 or KCNIP4 strongly increases expression at the cell surface and thereby increases channel activity; it modulates the kinetics of channel activation and inactivation, shifts the threshold for channel activation to more negative voltage values, shifts the threshold for inactivation to less negative voltages and accelerates recovery after inactivation (PubMed:15454437, PubMed:14623880, PubMed:14980201, PubMed:19171772, PubMed:24501278, PubMed:24811166). Likewise, interaction with DPP6 or DPP10 promotes expression at the cell membrane and regulates both channel characteristics and activity (By similarity).','KCND2','70535.825','DB00321','>lcl|BSEQ0019444|Potassium voltage-gated channel subfamily D member 2 (KCND2)\nATGGCGGCGGGGGTGGCAGCGTGGCTGCCTTTTGCAAGGGCAGCGGCTATCGGGTGGATG\nCCTGTGGCCTCGGGGCCTATGCCGGCTCCCCCGAGGCAGGAGAGGAAAAGGACCCAAGAT\nGCTCTCATTGTGCTGAATGTGAGTGGCACCCGCTTCCAGACGTGGCAGGACACCCTGGAA\nCGTTACCCAGACACTCTACTGGGCAGTTCTGAGAGGGACTTTTTCTACCACCCAGAAACT\nCAGCAGTATTTCTTTGACCGTGACCCAGACATCTTCCGCCACATCCTGAATTTCTACCGC\nACTGGGAAGCTCCACTATCCTCGCCACGAGTGCATCTCTGCTTACGATGAAGAACTGGCC\nTTCTTTGGCCTCATCCCGGAAATCATCGGCGACTGCTGTTATGAGGAGTACAAGGATCGC\nAGGCGAGAGAACGCCGAGCGCCTGCAGGACGACGCGGATACCGACACCGCTGGGGAGAGC\nGCCTTGCCCACCATGACTGCAAGGCAGAGGGTCTGGAGGGCCTTCGAGAACCCCCACACC\nAGCACGATGGCCCTGGTGTTCTACTATGTCACGGGGTTTTTCATTGCCGTCTCTGTCATC\nGCGAATGTGGTGGAAACAGTGCCGTGCGGATCAAGCCCAGGTCACATTAAAGAACTGCCC\nTGTGGAGAGCGGTATGCTGTGGCCTTCTTCTGCTTGGACACGGCCTGCGTCATGATCTTC\nACAGTTGAGTATTTGCTTCGCCTGGCTGCAGCGCCTAGTCGTTACCGTTTTGTGCGTAGT\nGTCATGAGTATCATC