ayed regulation, through transcriptional enhancement of the pentose phosphate pathway which produces 5-phosphoribosyl-1-pyrophosphate (PRPP), an allosteric activator of CAD at a later step in synthesis, this function is dependent on the mTORC1 complex. Regulates ribosome synthesis by activating RNA polymerase III-dependent transcription through phosphorylation and inhibition of MAF1 an RNA polymerase III-repressor. In parallel to protein synthesis, also regulates lipid synthesis through SREBF1/SREBP1 and LPIN1. To maintain energy homeostasis mTORC1 may also regulate mitochondrial biogenesis through regulation of PPARGC1A. mTORC1 also negatively regulates autophagy through phosphorylation of ULK1. Under nutrient sufficiency, phosphorylates ULK1 at \'Ser-758\', disrupting the interaction with AMPK and preventing activation of ULK1. Also prevents autophagy through phosphorylation of the autophagy inhibitor DAP. mTORC1 exerts a feedback control on upstream growth factor signaling that includes phosphorylation and activation of GRB10 a INSR-dependent signaling suppressor. Among other potential targets mTORC1 may phosphorylate CLIP1 and regulate microtubules. As part of the mTORC2 complex MTOR may regulate other cellular processes including survival and organization of the cytoskeleton. Plays a critical role in the phosphorylation at \'Ser-473\' of AKT1, a pro-survival effector of phosphoinositide 3-kinase, facilitating its activation by PDK1. mTORC2 may regulate the actin cytoskeleton, through phosphorylation of PRKCA, PXN and activation of the Rho-type guanine nucleotide exchange factors RHOA and RAC1A or RAC1B. mTORC2 also regulates the phosphorylation of SGK1 at \'Ser-422\'. Regulates osteoclastogensis by adjusting the expression of CEBPB isoforms (By similarity).','MTOR','288889.05','DB00337','>lcl|BSEQ0011711|Serine/threonine-protein kinase mTOR (MTOR)\nATGCTTGGAACCGGACCTGCCGCCGCCACCACCGCTGCCACCACATCTAGCAATGTGAGC\nGTCCTGCAGCAGTTTGCCAGTGGCCTAAAGAGCCGGAATGAGGAAACCAGGG