insert  into `kegg_disease`(`kegg_disease_link`,`kegg_disease_id`,`kegg_disease_name`,`Description`,`Category`,`kegg_disease_pathway_id`,`kegg_disease_pathway_link`,`img_pathway`,`kegg_disease_pathway_name`) values ('https://www.genome.jp/dbget-bin/www_bget?ds:H00017','H00017','Esophageal cancer','Esophageal cancer represents the 9th leading cancer in the world and is associated with a 5-year survival rate under 25%. The two main forms are squamous-cell carcinoma (ECSC) and adenocarcinoma (EAC). ECSC is the most frequent histological subtype in esophageal cancer, although the incidence of EAC is increasing faster than any other malignancy in the western world. Whereas ESCC can be attributed to alcohol and tobacco consumption, the most important risk factor for the development of EAC is duodenal-gastric-esophageal reflux. In the process of tumorigenesis at the cellular level, multiple genetic alterations are involved, including mutation of the p53 gene, amplification of cyclin D1 gene, among others.','Cancer','hsa05206','https://www.genome.jp/kegg-bin/show_pathway?hsa05206','H00017.png','MicroRNAs in cancer'),('https://www.genome.jp/dbget-bin/www_bget?ds:H00025','H00025','Penile cancer','Penile cancer is a disease with a high morbidity and mortality. Its prevalence is relatively rare in developed countries but more common in South America and East Africa. Squamous cell carcinoma (SCC) is the predominant tumor type in penile cancer, accounting for 95% of cases. Penile cancers are thought to arise from the progression of precursor lesions and can be subdivided into human papilloma virus (HPV) positive and HPV negative cases. Most common disrupted pathways, both in HPV-mediated and HPV-independent penile carcinogenesis, involve the p14ARF/MDM2/p53 and/or p16INK4a/cyclin D/Rb pathways. HPVs exert their oncogenic effect by expressing the oncoproteins E6 and E7, which bind to and inactivate the p53 and Rb tumor suppressor gene products, respectively. HPV independent mechanisms of pathway inactivation include silencing of the p16INK4a gene by promoter hypermethylation, somatic mutations of the p53 gene, over-expression of MDM2 and mutation of p14ARF. Several other molecular events include alterations in the activity and/or expression of ras and myc genes, cyclo-oxygenase-2 (COX) pathway and prostaglandin E2 synthase. These alterations have been described in both HPV-positive and -negative penile cancers.','Cancer','hsa05203','https://www.genome.jp/kegg-bin/show_pathway?hsa05203','H00025.png','Viral carcinogenesis'),('https://www.genome.jp/dbget-bin/www_bget?ds:H00046','H00046','Cholangiocarcinoma','Cholangiocarcinoma is a highly malignant neoplasm that carries a poor prognosis and lacks effective therapy. It is the second most common primary hepatic tumor, and it is increasing in incidence and carries a high mortality. The tumor arises from the ductular epithelium of the biliary tree, either within the liver (intrahepatic cholangiocarcinoma: ICC) or more commonly from the extrahepatic bile ducts (extrahepatic cholangiocarcinoma). Several studies have demonstrated mutations resulting in overexpression of K-ras and p53 genes. These genetic alterations are associated with a more aggressive phenotype in this cancer. Many reports have implicated overexpression of the tyrosine kinase proto-oncogenes c-erbB-2 (HER-2/neu) and c-Met, as well as cyclo-oxygenase-2 (COX-2) activity in intrahepatic cholangiocarcinoma.','Cancer','None','None','None','None'),('https://www.genome.jp/dbget-bin/www_bget?ds:H00775','H00775','Familial or sporadic hemiplegic migraine','Sporadic and familial hemiplegic migraines (SHM and FHM) are rare paroxysmal disorders characterized by motor aura and headache. The distinction is based on whether at least one first or second degree relative is also affected, otherwise the diagnostic criteria are similar. The majority of FHM families have a mutation in one of the ion channels CACNA1A, ATP1A2 and SCN1A. SHM is sometimes caused by a de novo mutation in one of the genes. However, at least a quarter of the large families affected and most sporadic cases do not have a mutation in the three genes known to be implicated in this disorder, suggesting that other genes are still to be identified.','Nervous system disease','hsa04010','https://www.genome.jp/kegg-bin/show_pathway?hsa04010+773','H00775.png','MAPK signaling pathway'),('https://www.genome.jp/dbget-bin/www_bget?ds:H00783','H00783','Febrile seizures','Febrile seizures (FS), or febrile convulsions (FEB), are acute symptomatic seizures that occur in response to fever and represent the most common form of childhood seizures. Generalized epilepsy with febrile seizures plus (GEFS+) is a familial epilepsy syndrome with a spectrum of phenotypes including FS. Severe epilepsy phenotypes such as Dravet syndrome (SMEI) have also been described within GEFS+ families. A significant genetic component exists for susceptibility to FS and GEFS+. Extensive genetic studies have shown that at least ten loci are responsible for FS. Furthermore, mutations in the voltage-gated sodium channel subunit genes (SCN1A, SCN2A and SCN1B) and the GABA(A) receptor subunit genes (GABRG2 and GABRD) have been identified in GEFS+.','Nervous system disease','hsa04728','https://www.genome.jp/kegg-bin/show_pathway?hsa04728+6323','H00783.png','Dopaminergic synapse'),('https://www.genome.jp/dbget-bin/www_bget?ds:H01611','H01611','Alcohol dependence','Alcohol dependence (AD) is a chronic but often disease that includes problems in controlling one\'s drinking, being preoccupied with alcohol, continuing to use alcohol even when it causes problems, having to drink more to get the same effect (physical dependence), or having withdrawal symptoms when one rapidly decreases or stops drinking. The contribution of genetic factors to the development of AD is high. The best classical candidate genes for AD are alcohol dehydrogenase (ADH) and aldehyde dehydrogenase (ALDH). Both genes are involved in enzymatic degradation of alcohol. Recent genome-wide association studies (GWAS) have reported that the most robust associations for AD have been with such enzyme genes, especially ALDH2 in East Asian populations and ADH1B in European American and African American populations.','Mental and behavioural disorder','hsa05034','https://www.genome.jp/kegg-bin/show_pathway?hsa05034+1813','H01611.png',''),('https://www.genome.jp/dbget-bin/www_bget?ds:H01815','H01815','Malignant migrating partial seizures in infancy','Malignant migrating partial seizures in infancy (MMPSI) are rare, severe early infantile onset epileptic encephalopathy. The common clinical features are seizure onset within the first 6 months of life, occurrence of migrating polymorphic focal seizures, and progressive deterioration of psychomotor development. Seizures in MMPSI are refractory to conventional treatment with anti-epileptic drugs (AEDs). Early and multiple video/EEG recordings are critical to detect the characteristic multifocal and asynchronous long lasting ictal discharges and are essential for MMPSI diagnosis. MMPSI is a genetically heterogeneous disorder with few known etiologies. Recently, mutations of several genes have been reported in sporadic cases of MMPSI.','Nervous system disease','None','None','None','None'),('https://www.genome.jp/dbget-bin/www_bget?ds:H01818','H01818','Dravet syndrome','The Dravet syndrome is a rare form of epileptic encephalopathy, and is accompanied by impaired psychomotor and neurologic development, occurring in the first year of life in apparently normal infants. Patients typically present with febrile hemiclonic or generalised tonic-clonic status epilepticus, followed by the development of other seizure types including myoclonic, focal, absence and atonic seizures between 1-4 years. All seizure types are pharmacoresistent, but a trend toward less severe epilepsy and cognitive impairment is usually observed after the age of 5 years. Development is normal in the first year of life with subsequent developmental slowing and sometimes regression. Approximately 80% of patients have point mutations or small insertions or deletions in the SCN1A gene.','Nervous system disease','hsa04728','https://www.genome.jp/kegg-bin/show_pathway?hsa04728+6323','H01818.png','Dopaminergic synapse');

