/*Table structure for table `sider_effect` */

DROP TABLE IF EXISTS `sider_effect`;

CREATE TABLE `sider_effect` (
  `sideeffect_link` varchar(200) NOT NULL,
  `sideeffect_name` varchar(200) DEFAULT NULL,
  `Definition` text,
  `Synonyms` text,
  PRIMARY KEY (`sideeffect_link`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `sider_effect` */

insert  into `sider_effect`(`sideeffect_link`,`sideeffect_name`,`Definition`,`Synonyms`) values ('http://sideeffects.embl.de/se/C0000729/','Abdominal cramps',': An involuntary muscular contraction involving a muscle of the abdomen or of a hollow organ within the abdomen.','(terms occurring on more labels are shown first): abdominal cramps, abdominal cramping, abdominal cramp, crampy abdominal pain'),('http://sideeffects.embl.de/se/C0000731/','Abdominal distension',': Swelling of the abdomen resulting from excessive food intake, malnutrition, liver disease, primary abdominal tumors, and tumors metastatic to the abdominal cavity.','(terms occurring on more labels are shown first): abdominal distention, abdominal distension, abdomen distention, distended abdomen, swollen abdomen'),('http://sideeffects.embl.de/se/C0000737/','Abdominal pain',': Sensation of discomfort, distress, or agony in the abdominal region; generally associated with functional disorders, tissue injuries, or diseases.','(terms occurring on more labels are shown first): abdominal pain, pain abdominal, abdominal pains, abdomen pain, Pain-abdominal, Abdominalpain, Abdominal - pain, Abdomina l pain, ab- dominal pain, Pain -abdominal, abdomi- nal pain'),('http://sideeffects.embl.de/se/C0000768/','Congenital anomaly',': Any abnormality, anatomical or biochemical, evident at birth or during the neonatal period.','(terms occurring on more labels are shown first): congenital anomalies, ABNORMALITIES, birth defects, congenital anomaly, congenital abnormalities, congenital malformations, birth defect, malformation, dysgenesis, fetal malformation, deformities, abnor-malities, abnor- malities'),('http://sideeffects.embl.de/se/C0000833/','Abscess',': Accumulation of purulent material in tissues, organs, or circumscribed spaces, usually associated with signs of infection.','(terms occurring on more labels are shown first): abscess, abscesses'),('http://sideeffects.embl.de/se/C0001122/','Acidosis',': pathologic condition resulting from accumulation of acid or depletion of the alkaline reserve (bicarbonate) content of the blood and body tissues, and characterized by an increase in hydrogen ion concentration (decrease in pH).','(terms occurring on more labels are shown first): acidosis'),('http://sideeffects.embl.de/se/C0001339/','Pancreatitis acute',': An acute inflammatory process that leads to necrosis of the pancreatic parenchyma. Signs and symptoms include severe abdominal pain, nausea, vomiting, diarrhea, fever, and shock. Causes include alcohol consumption, presence of gallstones, trauma, and drugs.','(terms occurring on more labels are shown first): acute pancreatitis, pancreatitis acute'),('http://sideeffects.embl.de/se/C0001416/','Adenitis','(terms occurring on more labels are shown first): adenitis',':'),('http://sideeffects.embl.de/se/C0001430/','Adenoma benign',': A neoplasm arising from the epithelium. It may be encapsulated or non-encapsulated but non-invasive. The neoplastic epithelial cells may or may not display cellular atypia or dysplasia. In the gastrointestinal tract, when dysplasia becomes severe it is sometimes called carcinoma in situ. Representative examples are pituitary gland adenoma, follicular adenoma of the thyroid gland, and adenomas (or adenomatous polyps) of the gastrointestinal tract.','(terms occurring on more labels are shown first): adenomas, adenoma benign, adenoma'),('http://sideeffects.embl.de/se/C0001623/','Adrenal insufficiency',': An endocrine or hormonal disorder that occurs when the adrenal cortex does not produce enough of the hormone cortisol and in some cases, the hormone aldosterone. It may be due to a disorder of the adrenal cortex (Addison\'s disease or primary adrenal insufficiency) or to inadequate secretion of ACTH by the pituitary gland (secondary adrenal insufficiency).','(terms occurring on more labels are shown first): adrenal insufficiency, hypoadrenalism, Adrenalin sufficiency'),('http://sideeffects.embl.de/se/C0001807/','Aggression',': form of behavior which leads to self-assertion; it may arise from innate drives and/or a response to frustration; may be manifested by destructive and attacking behavior, by covert attitudes of hostility and obstructionism, or by healthy self-expressive drive to mastery.','(terms occurring on more labels are shown first): aggression, aggressive behavior, aggressiveness, aggressive behaviour, aggressive behaviours, aggressive behaviors'),('http://sideeffects.embl.de/se/C0001824/','Agranulocytosis',': A decrease in the number of mature granulocytes (neutrophils, eosinophils, and basophils) in the peripheral blood. -- 2004','(terms occurring on more labels are shown first): agranulocytosis, granulocytopenia, granulopenia, agranulocytoses, agran- ulocytosis, gran- ulocytopenia'),('http://sideeffects.embl.de/se/C0001883/','Airway obstruction NOS',': Any hindrance to the passage of air into and out of the lungs.','(terms occurring on more labels are shown first): airway obstruction, airways obstruction'),('http://sideeffects.embl.de/se/C0001925/','Albuminuria',': The presence of albumin in the urine, an indicator of KIDNEY DISEASES.','(terms occurring on more labels are shown first): albuminuria'),('http://sideeffects.embl.de/se/C0002063/','Alkalosis',': A disorder characterized by abnormally high alkalinity (low hydrogen-ion concentration) of the blood and other body tissues.','(terms occurring on more labels are shown first): alkalosis'),('http://sideeffects.embl.de/se/C0002064/','Respiratory alkalosis',': A pathologic condition resulting from accumulation of base, or from loss of acid without comparable loss of base in the body fluids, and characterized by decrease in hydrogen ion concentration.','(terms occurring on more labels are shown first): respiratory alkalosis'),('http://sideeffects.embl.de/se/C0002170/','Alopecia',': Hair loss usually from the scalp. It may result in bald spots or spread to the entire scalp or the entire epidermis. It may be androgenetic or caused by chemotherapeutic agents, compulsive hair pulling, autoimmune disorders or congenital conditions.','(terms occurring on more labels are shown first): alopecia, hair loss, loss of hair, hair thinning, thinning of hair, baldness, alopecias, falling hair, Thinning Hair, alo- pecia'),('http://sideeffects.embl.de/se/C0002418/','Amblyopia',': A nonspecific term referring to impaired vision. Major subcategories include stimulus deprivation-induced amblyopia and toxic amblyopia. Stimulus deprivation-induced amblyopia is a developmental disorder of the visual cortex. A discrepancy between visual information received by the visual cortex from each eye results in abnormal cortical development. STRABISMUS and REFRACTIVE ERRORS may cause this condition. Toxic amblyopia is a disorder of the OPTIC NERVE which is associated with ALCOHOLISM, tobacco SMOKING, and other toxins and as an adverse effect of the use of some medications.','(terms occurring on more labels are shown first): amblyopia'),('http://sideeffects.embl.de/se/C0002453/','Amenorrhoea',': absence of menses for three months or more.','(terms occurring on more labels are shown first): amenorrhea, amenorrhoea'),('http://sideeffects.embl.de/se/C0002622/','Amnesia',': Pathologic partial or complete loss of the ability to recall past experiences (AMNESIA, RETROGRADE) or to form new memories (AMNESIA, ANTEROGRADE). This condition may be of organic or psychologic origin. Organic forms of amnesia are usually associated with dysfunction of the DIENCEPHALON or HIPPOCAMPUS. (From Adams et al., Principles of Neurology, 6th ed, pp426-7)','(terms occurring on more labels are shown first): amnesia'),('http://sideeffects.embl.de/se/C0002792/','Anaphylactic shock',': A disorder characterized by an acute inflammatory reaction resulting from the release of histamine and histamine-like substances from mast cells, causing a hypersensitivity immune response. Clinically, it presents with breathing difficulty, dizziness, hypotension, cyanosis and loss of consciousness and may lead to death.','(terms occurring on more labels are shown first): anaphylaxis, anaphylactic reactions, anaphylactic reaction, anaphylactic shock, systemic anaphylaxis, anaphy- laxis'),('http://sideeffects.embl.de/se/C0002871/','Anaemia',': A reduction in the number of red blood cells per cu mm, the amount of hemoglobin in 100 ml of blood, and the volume of packed red blood cells per 100 ml of blood. Clinically, anemia represents a reduction in the oxygen-transporting capacity of a designated volume of blood, resulting from an imbalance between blood loss (through hemorrhage or hemolysis) and blood production. Signs and symptoms of anemia may include pallor of the skin and mucous membranes, shortness of breath, palpitations of the heart, soft systolic murmurs, lethargy, and fatigability.','(terms occurring on more labels are shown first): anemia, anaemia, anemias, anaemias'),('http://sideeffects.embl.de/se/C0002874/','Aplastic anaemia',': Anemia resulting from bone marrow failure (aplastic or hypoplastic bone marrow). The production of erythroblasts and red cells is markedly decreased, and it may be associated with decreased production of granulocytes (granulocytopenia) and platelets (thrombocytopenia) as well. Aplastic anemia may be idiopathic or secondary due to bone marrow damage by toxins, radiation, or immunologic factors.','(terms occurring on more labels are shown first): aplastic anemia, aplastic anaemia, bone marrow aplasia, Anemia aplastic, aplasticanemia, Anaemia Aplastic'),('http://sideeffects.embl.de/se/C0002878/','Haemolytic anaemia',': due to premature destruction of erythrocytes in the spleen or peripheral vessels; commonly associated with glucose-6-phosphate dehydrogenase deficiencies, splenomegaly, and malarial or other infections.','(terms occurring on more labels are shown first): hemolytic anemia, haemolytic anaemia, anemiahemolytic, haemolytic anaemias, hemolytic anemias, Anemia-Hemolytic, anemia hemolytic'),('http://sideeffects.embl.de/se/C0002880/','Autoimmune haemolytic anaemia',': A condition in which the body\'s immune system stops red blood cells from forming or causes them to clump together. Autoimmune hemolytic anemia can occur in patients who have chronic lymphocytic leukemia (CLL).','(terms occurring on more labels are shown first): autoimmune hemolytic anemia, autoimmune haemolytic anaemia, auto-immune haemolytic anaemia, auto-immune hemolytic anemia, autoimmune hemolytic anemias'),('http://sideeffects.embl.de/se/C0002940/','Aneurysm',': Pathological outpouching or sac-like dilatation in the wall of any blood vessel (ARTERIES or VEINS) or the heart (HEART ANEURYSM). It indicates a thin and weakened area in the wall which may later rupture. Aneurysms are classified by location, etiology, or other characteristics.','(terms occurring on more labels are shown first): aneurysm, aneurysms'),('http://sideeffects.embl.de/se/C0002962/','Angina pectoris',': The symptom of paroxysmal pain consequent to MYOCARDIAL ISCHEMIA usually of distinctive character, location and radiation. It is thought to be provoked by a transient stressful situation during which the oxygen requirements of the MYOCARDIUM exceed that supplied by the CORONARY CIRCULATION.','(terms occurring on more labels are shown first): angina pectoris, angina, anginal pain, angina syndrome, angina pec toris'),('http://sideeffects.embl.de/se/C0002965/','Angina unstable',': Angina pectoris (or equivalent type of ischemic discomfort) with any 1 of the 3 following features: a) Angina occurring at rest and prolonged, usually greater than 20 minutes; b) New onset angina of at least Canadian Cardiovascular Society Grading Scale (or CCS classification system) classification severity III or greater; c) Recent acceleration in angina accentuated by an increase in severity of at least 1 CCS class to at least CCS class III. The biomarkers of necrosis are below the threshold of myocardial infarction. (NIH Roadmap Cardiovascular Data Standards Working Group)','(terms occurring on more labels are shown first): unstable angina, angina unstable, crescendo angina, angina at rest, unstable angina pectoris, unstable an gina, angina- Unstable, UAP, pre-infarction angina, angina-Unstable, angina -- Unstable, angina - Unstable'),('http://sideeffects.embl.de/se/C0002994/','Angioedema',': Swelling involving the deep DERMIS, subcutaneous, or submucosal tissues, representing localized EDEMA. Angioedema often occurs in the face, lips, tongue, and larynx.','(terms occurring on more labels are shown first): angioedema, angioneurotic edema, angioneurotic oedema, Quincke\'s edema, angio-oedema, giant urticaria, angiooedema, Quincke\'s oedema, Quincke edema, Angio-neurotic oedema, urticaria angioedema, angio-edema, angio- oedema, edema - angioneurotic, angioedema urticaria, Angio- neurotic oedema'),('http://sideeffects.embl.de/se/C0003123/','Anorexia',': The lack or loss of APPETITE accompanied by an aversion to food and the inability to eat. It is the defining characteristic of the disorder ANOREXIA NERVOSA.','(terms occurring on more labels are shown first): anorexia, anorectic, appetite loss, anorexic, ano- rexia'),('http://sideeffects.embl.de/se/C0003460/','Anuria',': Absence of urine formation. It is usually associated with complete bilateral ureteral (URETER) obstruction, complete lower urinary tract obstruction, or unilateral ureteral obstruction when a solitary kidney is present.','(terms occurring on more labels are shown first): anuria'),('http://sideeffects.embl.de/se/C0003467/','Anxiety',': Feelings of fear, dread, and uneasiness that may occur as a reaction to stress. A person with anxiety may sweat, feel restless and tense, and have a rapid heart beat. Extreme anxiety that happens often over time may be a sign of an anxiety disorder.','(terms occurring on more labels are shown first): anxiety, anxious, anxiousness, anxiety reaction, anxi- ety'),('http://sideeffects.embl.de/se/C0003507/','Aortic valve stenosis',': A pathological constriction that can occur above (supravalvular stenosis), below (subvalvular stenosis), or at the AORTIC VALVE. It is characterized by restricted outflow from the LEFT VENTRICLE into the AORTA.','(terms occurring on more labels are shown first): aortic stenosis'),('http://sideeffects.embl.de/se/C0003537/','Aphasia',': A cognitive disorder marked by an impaired ability to comprehend or express language in its written or spoken form. This condition is caused by diseases which affect the language areas of the dominant hemisphere. Clinical features are used to classify the various subtypes of this condition. General categories include receptive, expressive, and mixed forms of aphasia.','(terms occurring on more labels are shown first): aphasia'),('http://sideeffects.embl.de/se/C0003578/','Apnoea',': A disorder characterized by cessation of breathing.','(terms occurring on more labels are shown first): apnea, apnoea, not breathing, apneic'),('http://sideeffects.embl.de/se/C0003615/','Appendicitis',': Acute inflammation of the APPENDIX. Acute appendicitis is classified as simple, gangrenous, or perforated.','(terms occurring on more labels are shown first): appendicitis'),('http://sideeffects.embl.de/se/C0003811/','Arrhythmia',': Any disturbances of the normal rhythmic beating of the heart or MYOCARDIAL CONTRACTION. Cardiac arrhythmias can be classified by the abnormalities in HEART RATE, disorders of electrical impulse generation, or impulse conduction.','(terms occurring on more labels are shown first): arrhythmia, arrhythmias, cardiac arrhythmias, cardiac arrhythmia, dysrhythmias, cardiac dysrhythmias, cardiac rhythm disturbances, cardiac dysrhythmia, dysrhythmia, arrythmia, cardiac rhythm disturbance, cardiacarrhythmias, arrhyth- mias'),('http://sideeffects.embl.de/se/C0003862/','Arthralgia',': A disorder characterized by a sensation of marked discomfort in a joint.','(terms occurring on more labels are shown first): arthralgia, joint pain, arthralgias, joint pains, aching joints, painful joints, painful joint, pain Joint, pain in joint, arthral- gia, art hralgia'),('http://sideeffects.embl.de/se/C0003864/','Arthritis',': An inflammatory process affecting a joint. Causes include infection, autoimmune processes, degenerative processes, and trauma. Signs and symptoms may include swelling around the affected joint and pain.','(terms occurring on more labels are shown first): arthritis, arthritides'),('http://sideeffects.embl.de/se/C0003868/','Gouty arthritis',': Arthritis, especially of the great toe, as a result of gout. Acute gouty arthritis often is precipitated by trauma, infection, surgery, etc. The initial attacks are usually monoarticular but later attacks are often polyarticular.','(terms occurring on more labels are shown first): gouty arthritis'),('http://sideeffects.embl.de/se/C0003873/','Rheumatoid arthritis',': A chronic systemic disease, primarily of the joints, marked by inflammatory changes in the synovial membranes and articular structures, widespread fibrinoid degeneration of the collagen fibers in mesenchymal tissues, and by atrophy and rarefaction of bony structures. Etiology is unknown, but autoimmune mechanisms have been implicated.','(terms occurring on more labels are shown first): rheumatoid arthritis, arthritisRheumatoid'),('http://sideeffects.embl.de/se/C0004093/','Asthenia',': The property of lacking physical or mental strength; liability to failure under pressure or stress or strain. (WordNet)','(terms occurring on more labels are shown first): asthenia, weakness, generalized weakness, debility, feelings of weakness, general weakness, asthenic, weakness generalized, weak- ness, Weakness generalised, loss of strength, Asthenias'),('http://sideeffects.embl.de/se/C0004096/','Asthma',': A chronic disease in which the bronchial airways in the lungs become narrowed and swollen, making it difficult to breathe. Symptoms include wheezing, coughing, tightness in the chest, shortness of breath, and rapid breathing. An attack may be brought on by pet hair, dust, smoke, pollen, mold, exercise, cold air, or stress.','(terms occurring on more labels are shown first): asthma, bronchial asthma, asthmatic, asthmatics, Asthma bronchial'),('http://sideeffects.embl.de/se/C0004134/','Ataxia',': Impairment of the ability to perform smoothly coordinated voluntary movements. This condition may affect the limbs, trunk, eyes, pharynx, larynx, and other structures. Ataxia may result from impaired sensory or motor function. Sensory ataxia may result from posterior column injury or PERIPHERAL NERVE DISEASES. Motor ataxia may be associated with CEREBELLAR DISEASES; CEREBRAL CORTEX diseases; THALAMIC DISEASES; BASAL GANGLIA DISEASES; injury to the RED NUCLEUS; and other conditions.','(terms occurring on more labels are shown first): ataxia, ataxias'),('http://sideeffects.embl.de/se/C0004144/','Atelectasis',': Failure of the lung to expand (inflate) completely. This may be caused by a blocked airway, a tumor, general anesthesia, pneumonia or other lung infections, lung disease, or long-term bedrest with shallow breathing. Sometimes called a collapsed lung.','(terms occurring on more labels are shown first): atelectasis, pulmonary collapse'),('http://sideeffects.embl.de/se/C0004238/','Atrial fibrillation',': A supraventricular arrhythmia characterized by uncoordinated atrial myocardium activation due to multiple reentry circuits with consequent deterioration of atrial mechanical function. Instead of intermittently contracting, the atria quiver continuously in a chaotic pattern, causing a totally irregular, often tachycardia ventricular rate. On the ECG it is described by the replacement of consistent P waves by rapid oscillations or fibrillatory waves that vary in size, shape, and timing, associated with an irregular, frequently rapid ventricular response when atrioventricular conduction is intact. (NCI)','(terms occurring on more labels are shown first): atrial fibrillation, AFIB, fibrillation atrial, atrial fibrillations, atrial fibrilla tion, atrialfibrillation'),('http://sideeffects.embl.de/se/C0004239/','Atrial flutter',': Rapid, irregular atrial contractions caused by a block of electrical impulse conduction in the right atrium and a reentrant wave front traveling up the inter-atrial septum and down the right atrial free wall or vice versa. Unlike ATRIAL FIBRILLATION which is caused by abnormal impulse generation, typical atrial flutter is caused by abnormal impulse conduction. As in atrial fibrillation, patients with atrial flutter cannot effectively pump blood into the lower chambers of the heart (HEART VENTRICLES).','(terms occurring on more labels are shown first): atrial flutter'),('http://sideeffects.embl.de/se/C0004245/','Atrioventricular block',': An electrocardiographic finding of delayed or blocked cardiac electrical impulse conduction from the atria to the ventricles at the level of the atrioventricular node.','(terms occurring on more labels are shown first): AV block, atrioventricular block, A-V block, A-V blocks, AV-block, atrioventricular heart block, A-V heart block, AV heart block, atrio-ventricular block, atrio- ventricular block, AV blocks, atrio-ventricular blocks, atrio ventricular block, AV- block, Atrioventricular Blocks'),('http://sideeffects.embl.de/se/C0004604/','Back pain',': acute or chronic pain located in the posterior regions of the thorax, lumbosacral region, or the adjacent regions.','(terms occurring on more labels are shown first): back pain, backache, pain Back, backpain, Back ache, pain in back, back-pain, Back aches, Pain-back, ache Back, Backaches'),('http://sideeffects.embl.de/se/C0004610/','Bacteraemia',': The presence of viable bacteria circulating in the blood. Fever, chills, tachycardia, and tachypnea are common acute manifestations of bacteremia. The majority of cases are seen in already hospitalized patients, most of whom have underlying diseases or procedures which render their bloodstreams susceptible to invasion.','(terms occurring on more labels are shown first): bacteremia, bacteraemia, bacteremias'),('http://sideeffects.embl.de/se/C0004623/','Bacterial infection',': An acute infectious disorder caused by gram positive or gram negative bacteria. Representative examples include pneumococcal , streptococcal, salmonella and meningeal infections.','(terms occurring on more labels are shown first): bacterial infections, bacterial infection, infection bacterial, Infection--Bacterial, bacterial disease'),('http://sideeffects.embl.de/se/C0004626/','Pneumonia bacterial',': pneumonia caused by various species of bacteria; commonly results from bronchogenic spread of infection following microaspiration of secretions.','(terms occurring on more labels are shown first): bacterial pneumonia, pneumonia bacterial'),('http://sideeffects.embl.de/se/C0004936/','Mental disorder',': A disorder characterized by behavioral and/or psychological abnormalities, often accompanied by physical symptoms. The symptoms may cause clinically significant distress or impairment in social and occupational areas of functioning. Representative examples include anxiety disorders, cognitive disorders, mood disorders and schizophrenia.','(terms occurring on more labels are shown first): psychiatric disorders, psychiatric disorder, mental disorders, mental disorder, psychiatric illness, mental illness, Psychiatricdisorders, psychiatric disease, Psy c hiatric Disorders'),('http://sideeffects.embl.de/se/C0005586/','Bipolar disorder',': A major affective disorder marked by severe mood swings (manic or major depressive episodes) and a tendency to remission and recurrence. (MeSH)','(terms occurring on more labels are shown first): bipolar disorder, manic depression, manic-depressive reaction, manic-depressive, manic depressive illness, manic depressive reaction, manic-depressive illness, manic-depressive disorders, manic- depressive illness, manic- depressive, bipolar disorders, manic depressive, bipolar affective disorder, manic depressive psychosis, manic depressive disorder'),('http://sideeffects.embl.de/se/C0005681/','Blackwater fever',': A complication of MALARIA, FALCIPARUM characterized by the passage of dark red to black urine.','(terms occurring on more labels are shown first): blackwater fever'),('http://sideeffects.embl.de/se/C0005694/','Bladder neck obstruction',': Blocked urine flow through the bladder neck, the narrow internal urethral opening at the base of the URINARY BLADDER. Narrowing or strictures of the URETHRA can be congenital or acquired. It is often observed in males with enlarged PROSTATE glands.','(terms occurring on more labels are shown first): bladder outlet obstruction'),('http://sideeffects.embl.de/se/C0005741/','Blepharitis',': Inflammation of the eyelids.','(terms occurring on more labels are shown first): blepharitis, eyelid inflammation, eye lid inflammation'),('http://sideeffects.embl.de/se/C0005758/','Blister',': A fluid-filled sac in the outer layer of skin. It can be caused by rubbing, heat, or diseases of the skin.','(terms occurring on more labels are shown first): blisters, blistering, blister, bullae, bullous lesions, blebs, vesication'),('http://sideeffects.embl.de/se/C0005778/','Clotting',': The sequential process in which the multiple coagulation factors of the blood interact, ultimately resulting in the formation of an insoluble fibrin clot; it may be divided into three stages: stage 1, the formation of intrinsic and extrinsic prothrombin converting principle; stage 2, the formation of thrombin; stage 3, the formation of stable fibrin polymers. [http://www.graylab.ac.uk/omd/, ISBN:0198506732]','(terms occurring on more labels are shown first): clotting, blood clotting, blood coagulation, blood-clotting'),('http://sideeffects.embl.de/se/C0005779/','Coagulopathy',': Hemorrhagic and thrombotic disorders that occur as a consequence of abnormalities in blood coagulation due to a variety of factors such as COAGULATION PROTEIN DISORDERS; BLOOD PLATELET DISORDERS; BLOOD PROTEIN DISORDERS or nutritional conditions.','(terms occurring on more labels are shown first): clotting disorders, coagulation disorder, coagulation defect, coagulopathy, coagulopathies, coagulation disorders, clotting disorder, coagulation defects'),('http://sideeffects.embl.de/se/C0005940/','Bone disorder',': condition in which there is a deviation from or interruption of the normal structure or function of the bones.','(terms occurring on more labels are shown first): bone disorders, bone disorder, bone disease, disease of bone'),('http://sideeffects.embl.de/se/C0006142/','Breast cancer',': A primary or metastatic malignant neoplasm involving the breast. The vast majority of cases are carcinomas arising from the breast parenchyma or the nipple. Malignant breast neoplasms occur more frequently in females than in males.','(terms occurring on more labels are shown first): breast cancer, malignant breast neoplasm, breast cancers, mammary cancer, cancer of the breast, breastcancer, breast malignant neoplasm, Breast-cancer'),('http://sideeffects.embl.de/se/C0006145/','Breast disorder',': A non-neoplastic or neoplastic disorder that affects the breast. Representative examples of non-neoplastic disorders include fibrocystic disease, gynecomastia, and mastitis. Representative examples of neoplastic disorders include fibroadenoma, lobular neoplasia, carcinoma, lymphoma, and sarcoma.','(terms occurring on more labels are shown first): breast disorders, breast disorder, breast disease, B reast D isorders'),('http://sideeffects.embl.de/se/C0006147/','Breast feeding',': The nursing of an infant at the mother\'s breast.','(terms occurring on more labels are shown first): breast-feeding, breast feeding, breast-feed, breastfeeding, breastfeed, breast-fed infants, breast- feeding, breast feed, breast-fed infant, breast- feed'),('http://sideeffects.embl.de/se/C0006266/','Bronchospasm',': A disorder characterized by a sudden contraction of the smooth muscles of the bronchial wall.','(terms occurring on more labels are shown first): bronchospasm, bronchospasms, bronchial spasm, bron-chospasm, broncho spasm, broncho- spasms'),('http://sideeffects.embl.de/se/C0006277/','Bronchitis',': Inflammation of the large airways in the lung including any part of the BRONCHI, from the PRIMARY BRONCHI to the TERTIARY BRONCHI.','(terms occurring on more labels are shown first): bronchitis, B ron ch itis'),('http://sideeffects.embl.de/se/C0006287/','Bronchopulmonary dysplasia',': A chronic lung disease developed after OXYGEN INHALATION THERAPY or mechanical ventilation (VENTILATION, MECHANICAL) usually occurring in certain premature infants (INFANT, PREMATURE) or newborn infants with respiratory distress syndrome (RESPIRATORY DISTRESS SYNDROME, NEWBORN). Histologically, it is characterized by the unusual abnormalities of the bronchioles, such as METAPLASIA, decrease in alveolar number, and formation of CYSTS.','(terms occurring on more labels are shown first): bronchopulmonary dysplasia'),('http://sideeffects.embl.de/se/C0006384/','Bundle branch block',': A form of heart block in which the electrical stimulation of HEART VENTRICLES is interrupted at either one of the branches of BUNDLE OF HIS thus preventing the simultaneous depolarization of the two ventricles.','(terms occurring on more labels are shown first): bundle branch block, bundle-branch block, bundle branch heart block, bundle- branch block'),('http://sideeffects.embl.de/se/C0006444/','Bursitis',': Inflammation (swelling, pain, and warmth) of a bursa. A bursa is a flat, fluid-filled sac found between a bone and a tendon or muscle. It forms a cushion to help the tendon or muscle slide smoothly over the bone. Bursitis may be caused by long-term overuse, trauma, rheumatoid arthritis, gout, or infection. It usually affects the shoulder, knee, elbow, hip, or foot.','(terms occurring on more labels are shown first): bursitis'),('http://sideeffects.embl.de/se/C0006826/','Neoplasm malignant',': A term for diseases in which abnormal cells divide without control and can invade nearby tissues. Malignant cells can also spread to other parts of the body through the blood and lymph systems. There are several main types of malignancy. Carcinoma is a malignancy that begins in the skin or in tissues that line or cover internal organs. Sarcoma is a malignancy that begins in bone, cartilage, fat, muscle, blood vessels, or other connective or supportive tissue. Leukemia is a malignancy that starts in blood-forming tissue such as the bone marrow, and causes large numbers of abnormal blood cells to be produced and enter the blood. Lymphoma and multiple myeloma are malignancies that begin in the cells of the immune system. Central nervous system cancers are malignancies that begin in the tissues of the brain and spinal cord.','(terms occurring on more labels are shown first): cancer, malignancies, malignancy, cancers, malignant neoplasms, malignant neoplasm, neoplasm malignant, malignant tumors, malignant tumours, malignant tumour, malignanc y'),('http://sideeffects.embl.de/se/C0006840/','Candida infection',': A condition in which Candida albicans, a type of yeast, grows out of control in moist skin areas of the body. It is usually a result of a weakened immune system, but can be a side effect of chemotherapy or treatment with antibiotics. Thrush usually affects the mouth (oral thrush); however, rarely, it spreads throughout the entire body.','(terms occurring on more labels are shown first): moniliasis, candidiasis, candida infections, candida infection, candidal infections, candidal infection, Candidosis, monilial infection'),('http://sideeffects.embl.de/se/C0007117/','Basal cell carcinoma',': The most frequently seen skin cancer. It arises from basal cells of the epidermis and pilosebaceous units. Clinically it is divided into the following types: nodular, ulcerative, superficial, multicentric, erythematous, and sclerosing or morphea-like.. More than 95% of these carcinomas occur in patients over 40. They develop on hair-bearing skin, most commonly on sun-exposed areas. Approximately 85% are found on the head and neck and the remaining 15% on the trunk and extremities. Basal cell carcinoma usually grows in a slow and indolent fashion. However, if untreated, the tumor may invade the subcutaneous fat, skeletal muscle and bone. Distant metastases are rare. Excision, curettage and irradiation cure most basal cell carcinomas.','(terms occurring on more labels are shown first): basal cell carcinoma, basal cell carcinomas, BCC'),('http://sideeffects.embl.de/se/C0007642/','Cellulitis',': An acute, diffuse, and suppurative inflammation of loose connective tissue, particularly the deep subcutaneous tissues, and sometimes muscle, which is most commonly seen as a result of infection of a wound, ulcer, or other skin lesions.','(terms occurring on more labels are shown first): cellulitis'),('http://sideeffects.embl.de/se/C0007787/','Transient ischaemic attack',': Brief reversible episodes of focal, nonconvulsive ischemic dysfunction of the brain having a duration of less than 24 hours, and usually less than one hour, caused by transient thrombotic or embolic blood vessel occlusion or stenosis. Events may be classified by arterial distribution, temporal pattern, or etiology (e.g., embolic vs. thrombotic). (From Adams et al., Principles of Neurology, 6th ed, pp814-6)','(terms occurring on more labels are shown first): transient ischemic attack, transient ischemic attacks, transient ischaemic attack, transient ischaemic attacks'),('http://sideeffects.embl.de/se/C0007820/','Cerebrovascular disorder',': A disorder resulting from inadequate blood flow in the arteries that supply the brain. The diagnostic criteria may include current or previous history of the following: Ischemic stroke, TIA, Noninvasive or invasive arterial imaging test demonstrating greater than or equal to 50% stenosis of any of the major extracranial or intracranial vessels to the brain; Previous cervical or cerebral artery revascularization surgery or percutaneous intervention.','(terms occurring on more labels are shown first): cerebrovascular disorder, cerebrovascular disorders, cerebrovascular disease'),('http://sideeffects.embl.de/se/C0007859/','Neck pain',': Discomfort or more intense forms of pain that are localized to the cervical region. This term generally refers to pain in the posterior or lateral regions of the neck.','(terms occurring on more labels are shown first): neck pain, pain neck, pain-neck, Cervical pain'),('http://sideeffects.embl.de/se/C0008031/','Chest pain',': Pressure, burning, or numbness in the chest.','(terms occurring on more labels are shown first): chest pain, pain chest, chest pains, nonspecific chest pain, Chest - pain, pain in chest, non-specific chest pain, Chest-pain, chestpain, Pain -chest'),('http://sideeffects.embl.de/se/C0008049/','Varicella',': A contagious childhood disorder caused by the varicella zoster virus. It is transmitted via respiratory secretions and contact with chickenpox blister contents. It presents with a vesicular skin rush, usually associated with fever, headache, and myalgias. The pruritic fluid-filled vesicles occur 10-21 days after exposure and last for 3-4 days. An additional 3-4 days of malaise follows before the affected individual feels better. An individual is contagious 1-2 days prior to the appearance of the blisters until all blisters are crusted over. Generally, healthy individuals recover without complications.','(terms occurring on more labels are shown first): chickenpox, varicella, chicken pox'),('http://sideeffects.embl.de/se/C0008325/','Cholecystitis',': inflammation of the gallbladder; generally caused by impairment of bile flow, gallstones in the biliary tract, infections, or other diseases.','(terms occurring on more labels are shown first): cholecystitis'),('http://sideeffects.embl.de/se/C0008370/','Cholestasis',': Any condition in which the release of bile from the liver is blocked. The blockage can occur in the liver (intrahepatic cholestasis) or in the bile ducts (extrahepatic cholestasis).','(terms occurring on more labels are shown first): cholestasis, biliary stasis, bile duct obstruction, bile stasis'),('http://sideeffects.embl.de/se/C0009241/','Cognitive disorder',': A category of psychiatric disorders which are characterized by a deficit in cognition or memory.','(terms occurring on more labels are shown first): cognitive disorder, cognitive disorders, cognitive function disorders'),('http://sideeffects.embl.de/se/C0009319/','Colitis',': Inflammation of the COLON section of the large intestine (INTESTINE, LARGE), usually with symptoms such as DIARRHEA (often with blood and mucus), ABDOMINAL PAIN, and FEVER.','(terms occurring on more labels are shown first): colitis'),('http://sideeffects.embl.de/se/C0009324/','Colitis ulcerative',': An inflammatory bowel disease involving the mucosal surface of the large intestine and rectum. It may present with an acute or slow onset and follows an intermittent or continuous course. Signs and symptoms include abdominal pain, diarrhea, fever, weight loss, and intestinal hemorrhage.','(terms occurring on more labels are shown first): ulcerative colitis, colitis ulcerative'),('http://sideeffects.embl.de/se/C0009421/','Coma',': A profound state of unconsciousness associated with depressed cerebral activity from which the individual cannot be aroused. Coma generally occurs when there is dysfunction or injury involving both cerebral hemispheres or the brain stem RETICULAR FORMATION.','(terms occurring on more labels are shown first): coma, comatose'),('http://sideeffects.embl.de/se/C0009450/','Infection',': invasion and growth of microorganisms in body tissues, which may be clinically inapparent or result in local cellular injury; a local infection may persist and spread by extension to become an acute, subacute, or chronic clinical infection or disease state or it may become systemic when the microorganisms gain access to the lymphatic or vascular system; does not always lead to injury of the host even if the pathogen is potentially virulent.','(terms occurring on more labels are shown first): infections, infection, infectious diseases, I NFECTIONS, infectious disease, infec- tions, infection unspecified, infec- tion, infect Dis, Infe cti ons, communicable diseases'),('http://sideeffects.embl.de/se/C0009676/','Confusional state',': A mental state characterized by bewilderment, emotional disturbance, lack of clear thinking, and perceptual disorientation.','(terms occurring on more labels are shown first): confusion, confusional state, mental confusion, confusional states, dazed, confusion state, Disorientation Confusion'),('http://sideeffects.embl.de/se/C0009763/','Conjunctivitis',': inflammation of the mucous membrane that lines the inner surface of the eyelids and the anterior part of the sclera; also called pinkeye and redeye.','(terms occurring on more labels are shown first): conjunctivitis'),('http://sideeffects.embl.de/se/C0009766/','Conjunctivitis allergic',': Conjunctivitis due to hypersensitivity to various allergens.','(terms occurring on more labels are shown first): allergic conjunctivitis, conjunctivitis allergic'),('http://sideeffects.embl.de/se/C0009782/','Connective tissue disorder',': A heterogeneous group of disorders, some hereditary, others acquired, characterized by abnormal structure or function of one or more of the elements of connective tissue, i.e., collagen, elastin, or the mucopolysaccharides.','(terms occurring on more labels are shown first): connective tissue disorders, connective tissue disease, connective tissue disorder, CTD, connective tissue diseases, connectivetissue disorders, connective ti ssue di sorders'),('http://sideeffects.embl.de/se/C0009806/','Constipation',': Infrequent or difficult evacuation of FECES. These symptoms are associated with a variety of causes, including low DIETARY FIBER intake, emotional or nervous disturbances, systemic and structural disorders, drug-induced aggravation, and infections.','(terms occurring on more labels are shown first): constipation, constipated, constipating, consti- pation, Con- stipation, constipa- tion, const ipat ion'),('http://sideeffects.embl.de/se/C0009938/','Contusion',': A finding of injury of the soft tissues or bone characterized by leakage of blood into surrounding tissues.','(terms occurring on more labels are shown first): bruising, contusion, bruises, bruise, contusions'),('http://sideeffects.embl.de/se/C0010034/','Corneal disorder',': pathological process affecting the transparent anterior portion of the fibrous coat of the eye.','(terms occurring on more labels are shown first): corneal disorders, corneal disorder'),('http://sideeffects.embl.de/se/C0010037/','Corneal oedema',': excessive amount of fluid in the transparent anterior portion of the fibrous coat of the eye due to damage of the epithelium or endothelium, causing decreased visual acuity.','(terms occurring on more labels are shown first): corneal edema, corneal oedema'),('http://sideeffects.embl.de/se/C0010038/','Corneal opacity',': clouding that can occur in the transparent part of the coat of the eyeball or cornea, secondary to inflammation, infection or irritant exposure by a foreign body or chemical.','(terms occurring on more labels are shown first): corneal opacity, corneal opacities, corneal clouding'),('http://sideeffects.embl.de/se/C0010043/','Ulcerative keratitis',': A disorder characterized by an area of epithelial tissue loss on the surface of the cornea. It is associated with inflammatory cells in the cornea and anterior chamber.','(terms occurring on more labels are shown first): corneal ulcer, corneal ulceration, corneal ulcers, Corneal ulcerations, ulcerative keratitis'),('http://sideeffects.embl.de/se/C0010200/','Cough',': A sudden, audible expulsion of air from the lungs through a partially closed glottis, preceded by inhalation. It is a protective response that serves to clear the trachea, bronchi, and/or lungs of irritants and secretions, or to prevent aspiration of foreign materials into the lungs.','(terms occurring on more labels are shown first): cough, coughing, coughs, c ough, C ou g h'),('http://sideeffects.embl.de/se/C0010346/','Crohn\'s disease',': A chronic transmural inflammation that may involve any part of the DIGESTIVE TRACT from MOUTH to ANUS, mostly found in the ILEUM, the CECUM, and the COLON. In Crohn disease, the inflammation, extending through the intestinal wall from the MUCOSA to the serosa, is characteristically asymmetric and segmental. Epithelioid GRANULOMAS may be seen in some patients.','(terms occurring on more labels are shown first): Crohn\'s disease, Crohndisease, Crohn\'s dis- ease, Crohn\' s disease'),('http://sideeffects.embl.de/se/C0010495/','Cutis laxa',': A group of connective tissue diseases in which skin hangs in loose pendulous folds. It is believed to be associated with decreased elastic tissue formation as well as an abnormality in elastin formation. Cutis laxa is usually a genetic disease, but acquired cases have been reported. (From Dorland, 27th ed)','(terms occurring on more labels are shown first): skin laxity, cutis laxa'),('http://sideeffects.embl.de/se/C0010692/','Cystitis',': Inflammation of the URINARY BLADDER, either from bacterial or non-bacterial causes. Cystitis is usually associated with painful urination (dysuria), increased frequency, urgency, and suprapubic pain.','(terms occurring on more labels are shown first): cystitis, bladder inflammation, cystalgia'),('http://sideeffects.embl.de/se/C0011053/','Deafness',': An inherited or acquired condition characterized by a partial or complete loss of hearing in one or both ears. The level of impairment varies from a mild but important loss of sensitivity to a total loss of hearing.','(terms occurring on more labels are shown first): deafness'),('http://sideeffects.embl.de/se/C0011124/','Libido decreased',': A disorder characterized by a decrease in sexual desire.','(terms occurring on more labels are shown first): libido decreased, decreased libido, reduced libido, decreased sexual desire'),('http://sideeffects.embl.de/se/C0011168/','Dysphagia',': Difficulty in SWALLOWING which may result from neuromuscular disorder or mechanical obstruction. Dysphagia is classified into two distinct types: oropharyngeal dysphagia due to malfunction of the PHARYNX and UPPER ESOPHAGEAL SPHINCTER; and esophageal dysphagia due to malfunction of the ESOPHAGUS.','(terms occurring on more labels are shown first): dysphagia, swallowing difficulty, difficulty in swallowing, difficulty swallowing, swallowing disorders, deglutition disorder, swallowing difficult'),('http://sideeffects.embl.de/se/C0011175/','Dehydration',': A condition resulting from the excessive loss of water from the body. It is usually caused by severe diarrhea, vomiting or diaphoresis.','(terms occurring on more labels are shown first): dehydration'),('http://sideeffects.embl.de/se/C0011206/','Delirium',': A disorder characterized by CONFUSION; inattentiveness; disorientation; ILLUSIONS; HALLUCINATIONS; agitation; and in some instances autonomic nervous system overactivity. It may result from toxic/metabolic conditions or structural brain lesions. (From Adams et al., Principles of Neurology, 6th ed, pp411-2)','(terms occurring on more labels are shown first): delirium, acute brain syndrome, acute delirium'),('http://sideeffects.embl.de/se/C0011253/','Delusion',': A false belief regarding the self or persons or objects outside the self that persists despite the facts, and is not considered tenable by one\'s associates.','(terms occurring on more labels are shown first): delusions, delusion'),('http://sideeffects.embl.de/se/C0011551/','Depersonalisation',': State in which an individual perceives or experiences a sensation of unreality concerning the self or the environment; it is seen in disorders such as schizophrenia, affection disorders, organic mental disorders, and personality disorders. (APA, Thesaurus of Psychological Index Terms, 8th ed.)','(terms occurring on more labels are shown first): depersonalization, depersonalisation, de-personalisation'),('http://sideeffects.embl.de/se/C0011570/','Depression',': A mental condition marked by ongoing feelings of sadness, despair, loss of energy, and difficulty dealing with normal daily life. Other symptoms of depression include feelings of worthlessness and hopelessness, loss of pleasure in activities, changes in eating or sleeping habits, and thoughts of death or suicide. Depression can affect anyone, and can be successfully treated. Depression affects 15-25% of cancer patients.','(terms occurring on more labels are shown first): Depression, mental depression, depressions, Depressio n, D EPRESSION'),('http://sideeffects.embl.de/se/C0011581/','Depressive disorder',': An affective disorder manifested by either a dysphoric mood or loss of interest or pleasure in usual activities. The mood disturbance is prominent and relatively persistent.','(terms occurring on more labels are shown first): depressive disorder, depressive illness, depressive disorders, D EPRESSIVE D ISORDER, depressive neurosis'),('http://sideeffects.embl.de/se/C0011603/','Dermatitis',': An inflammatory process affecting the skin. Signs include red rash, itching, and blister formation. Representative examples are contact dermatitis, atopic dermatitis, and seborrheic dermatitis.','(terms occurring on more labels are shown first): dermatitis, skin inflammation, inflammation of the skin, dermatitides'),('http://sideeffects.embl.de/se/C0011606/','Dermatitis exfoliative',': The widespread involvement of the skin by a scaly, erythematous dermatitis occurring either as a secondary or reactive process to an underlying cutaneous disorder (e.g., atopic dermatitis, psoriasis, etc.), or as a primary or idiopathic disease. It is often associated with the loss of hair and nails, hyperkeratosis of the palms and soles, and pruritus. (From Dorland, 27th ed)','(terms occurring on more labels are shown first): exfoliative dermatitis, erythroderma, exfoliative erythroderma, dermatitis exfoliative, generalized exfoliative dermatitis, exfoliativedermatitis, Ex foliative dermatitis, e xfoliative dermatitis'),('http://sideeffects.embl.de/se/C0011609/','Drug eruption',': Adverse cutaneous reactions caused by ingestion, parenteral use, or local application of a drug. These may assume various morphologic patterns and produce various types of lesions.','(terms occurring on more labels are shown first): drug rash, drug eruption, dermatitis medicamentosa, drug eruptions'),('http://sideeffects.embl.de/se/C0011615/','Dermatitis atopic',': A chronic inflammatory genetically determined disease of the skin marked by increased ability to form reagin (IgE), with increased susceptibility to allergic rhinitis and asthma, and hereditary disposition to a lowered threshold for pruritus. It is manifested by lichenification, excoriation, and crusting, mainly on the flexural surfaces of the elbow and knee. In infants it is known as infantile eczema.','(terms occurring on more labels are shown first): atopic dermatitis, allergic dermatitis, dermatitis allergic, dermatitisAtopic, dermatitis atopic, atopic eczema, dermatitisAllergic, allergic eczema'),('http://sideeffects.embl.de/se/C0011616/','Dermatitis contact',': A type of acute or chronic skin reaction in which sensitivity is manifested by reactivity to materials or substances coming in contact with the skin. It may involve allergic or non-allergic mechanisms.','(terms occurring on more labels are shown first): contact dermatitis, dermatitis contact, dermatitisContact, contact sensitivity, Contact eczema'),('http://sideeffects.embl.de/se/C0011849/','Diabetes mellitus',': A disease in which the body does not control the amount of glucose (a type of sugar) in the blood and the kidneys make a large amount of urine. This disease occurs when the body does not make enough insulin or does not use it the way it should.','(terms occurring on more labels are shown first): diabetes mellitus, diabetes'),('http://sideeffects.embl.de/se/C0011991/','Diarrhoea',': An increased liquidity or decreased consistency of FECES, such as running stool. Fecal consistency is related to the ratio of water-holding capacity of insoluble solids to total water, rather than the amount of water present. Diarrhea is not hyperdefecation or increased fecal weight.','(terms occurring on more labels are shown first): diarrhea, diarrhoea, Stools loose, loose stool, watery stools, loose bowel movement, Diarrh ea, diar- rhea'),('http://sideeffects.embl.de/se/C0012569/','Diplopia',': A visual symptom in which a single object is perceived by the visual cortex as two objects rather than one. Disorders associated with this condition include REFRACTIVE ERRORS; STRABISMUS; OCULOMOTOR NERVE DISEASES; TROCHLEAR NERVE DISEASES; ABDUCENS NERVE DISEASES; and diseases of the BRAIN STEM and OCCIPITAL LOBE.','(terms occurring on more labels are shown first): diplopia, double vision, dou- ble vision'),('http://sideeffects.embl.de/se/C0012739/','Disseminated intravascular coagulation',': disorder characterized by reduction in the elements involved in blood coagulation due to their utilization in widespread blood clotting within the vessels; the activation of the clotting mechanism may arise from any of a number of disorders; in the late stages, it is marked by profuse hemorrhaging.','(terms occurring on more labels are shown first): disseminated intravascular coagulation, consumption coagulopathies'),('http://sideeffects.embl.de/se/C0012797/','Diuresis',': An increase in the excretion of URINE. (McGraw-Hill Dictionary of Scientific and Technical Terms, 6th ed)','(terms occurring on more labels are shown first): diuresis, urinary flow'),('http://sideeffects.embl.de/se/C0012833/','Dizziness',': A medically indistinct term used to describe a variety of conditions such as lightheadedness, unsteadiness, giddiness, a sense of turning, spinning or rocking.','(terms occurring on more labels are shown first): dizziness, dizzy, dizzi- ness, dizzi-ness, Diz z in e ss'),('http://sideeffects.embl.de/se/C0013144/','Drowsiness',': The sensation of struggling to remain awake.','(terms occurring on more labels are shown first): drowsiness, sleepiness, sleepy, drowsy'),('http://sideeffects.embl.de/se/C0013182/','Drug hypersensitivity',': immunologically mediated adverse reactions to medicinal substances used legally or illegally.','(terms occurring on more labels are shown first): drug hypersensitivity, drug allergy'),('http://sideeffects.embl.de/se/C0013220/','Drug tolerance',': Progressive diminution of the susceptibility of a human or animal to the effects of a drug, resulting from its continued administration. It should be differentiated from DRUG RESISTANCE wherein an organism, disease, or tissue fails to respond to the intended effectiveness of a chemical or drug. It should also be differentiated from MAXIMUM TOLERATED DOSE and NO-OBSERVED-ADVERSE-EFFECT LEVEL.','(terms occurring on more labels are shown first): drug tolerance'),('http://sideeffects.embl.de/se/C0013238/','Dry eye syndrome',': Corneal and conjunctival dryness due to deficient tear production, predominantly in menopausal and post-menopausal women. Filamentary keratitis or erosion of the conjunctival and corneal epithelium may be caused by these disorders. Sensation of the presence of a foreign body in the eye and burning of the eyes may occur.','(terms occurring on more labels are shown first): dry eye syndrome, dry eye syndromes'),('http://sideeffects.embl.de/se/C0013240/','Alveolar osteitis',': A condition sometimes occurring after tooth extraction, particularly after traumatic extraction, resulting in a dry appearance of the exposed bone in the socket, due to disintegration or loss of the blood clot. It is basically a focal osteomyelitis without suppuration and is accompanied by severe pain (alveolalgia) and foul odor. (Dorland, 28th ed)','(terms occurring on more labels are shown first): dry socket, alveolar osteitis'),('http://sideeffects.embl.de/se/C0013295/','Duodenal ulcer',': peptic ulcer located in the duodenum, the shortest and widest portion of the small intestine adjacent to the pylorus of the stomach.','(terms occurring on more labels are shown first): duodenal ulcer, duodenal ulcer disease, duodenal ulcers, duodenal ulceration'),('http://sideeffects.embl.de/se/C0013362/','Dysarthria',': Disorders of speech articulation caused by imperfect coordination of pharynx, larynx, tongue, or face muscles. This may result from CRANIAL NERVE DISEASES; NEUROMUSCULAR DISEASES; CEREBELLAR DISEASES; BASAL GANGLIA DISEASES; BRAIN STEM diseases; or diseases of the corticobulbar tracts (see PYRAMIDAL TRACTS). The cortical language centers are intact in this condition. (From Adams et al., Principles of Neurology, 6th ed, p489)','(terms occurring on more labels are shown first): dysarthria'),('http://sideeffects.embl.de/se/C0013378/','Dysgeusia',': A condition characterized by alterations of the sense of taste which may range from mild to severe, including gross distortions of taste quality.','(terms occurring on more labels are shown first): taste perversion, dysgeusia, taste disturbance, taste alteration, alteration of taste, taste impairment, alteration in taste, alterations in taste, disturbances of taste, taste abnormalities, perversion of taste, taste abnormality, disturbances taste, taste per-version'),('http://sideeffects.embl.de/se/C0013384/','Dyskinesia',': Abnormal involuntary movements which primarily affect the extremities, trunk, or jaw that occur as a manifestation of an underlying disease process. Conditions which feature recurrent or persistent episodes of dyskinesia as a primary manifestation of disease may be referred to as dyskinesia syndromes (see MOVEMENT DISORDERS). Dyskinesias are also a relatively common manifestation of BASAL GANGLIA DISEASES.','(terms occurring on more labels are shown first): dyskinesia, dyskinesias, d yskinesia'),('http://sideeffects.embl.de/se/C0013390/','Dysmenorrhoea',': A disorder characterized by abnormally painful abdominal cramps during menses.','(terms occurring on more labels are shown first): dysmenorrhea, dysmenorrhoea, menstrual cramps, menstrual pain, Menstrual Cramp, painful menstruation'),('http://sideeffects.embl.de/se/C0013395/','Dyspepsia',': An uncomfortable, often painful feeling in the stomach, resulting from impaired digestion. Symptoms include burning stomach pain, bloating, heartburn, nausea, and vomiting. Causes include gastritis, gastric ulcer, gastroesophageal reflux disease, pancreatic disease, and gallbladder disease.','(terms occurring on more labels are shown first): dyspepsia, indigestion, d yspepsia, D y spepsia'),('http://sideeffects.embl.de/se/C0013404/','Dyspnoea',': labored or difficult breathing associated with a variety of disorders, indicating inadequate ventilation or low blood oxygen or a subjective experience of breathing discomfort.','(terms occurring on more labels are shown first): dyspnea, shortness of breath, dyspnoea, difficulty breathing, respiratory difficulty, breathing difficulties, difficult breathing, breathing difficulty, breathlessness, respiratory difficulties, breath shortness, Respiratory - difficulty, D y spnea'),('http://sideeffects.embl.de/se/C0013418/','Abnormal labour',': Slow or difficult OBSTETRIC LABOR or CHILDBIRTH.','(terms occurring on more labels are shown first): dystocia, Abnormal labor'),('http://sideeffects.embl.de/se/C0013428/','Dysuria',': Painful URINATION. It is often associated with infections of the lower URINARY TRACT.','(terms occurring on more labels are shown first): dysuria, painful urination, painful micturition'),('http://sideeffects.embl.de/se/C0013447/','Ear disorder',': impairment of health or a condition of abnormal functioning in the sense organ for hearing and equilibrium.','(terms occurring on more labels are shown first): ear disorder, ear disorders, ear disease, DisordersEar'),('http://sideeffects.embl.de/se/C0013456/','Ear pain',': A disorder characterized by a sensation of marked discomfort in the ear.','(terms occurring on more labels are shown first): ear pain, earache, ear ache, otalgia, pain- ear, pain Ear'),('http://sideeffects.embl.de/se/C0013491/','Ecchymosis',': Extravasation of blood into the skin, resulting in a nonelevated, rounded or irregular, blue or purplish patch, larger than a petechia.','(terms occurring on more labels are shown first): ecchymosis, ecchymoses'),('http://sideeffects.embl.de/se/C0013595/','Eczema',': A group of conditions in which the skin becomes inflamed, forms blisters, and becomes crusty, thick, and scaly. Eczema causes burning and itching, and may occur over a long period of time. Atopic dermatitis is the most common type of eczema.','(terms occurring on more labels are shown first): eczema, eczematoid dermatitis, eczematous dermatitis, eczematous rash, eczemas, ecze ma, eczematous skin lesions'),('http://sideeffects.embl.de/se/C0013604/','Oedema',': Abnormal fluid accumulation in TISSUES or body cavities. Most cases of edema are present under the SKIN in SUBCUTANEOUS TISSUE.','(terms occurring on more labels are shown first): edema, oedema, edematous, edemas, oedemas, oedematous, Oedema s'),('http://sideeffects.embl.de/se/C0014356/','Enterocolitis',': Inflammation of the MUCOSA of both the SMALL INTESTINE and the LARGE INTESTINE. Etiology includes ISCHEMIA, infections, allergic, and immune responses.','(terms occurring on more labels are shown first): enterocolitis'),('http://sideeffects.embl.de/se/C0014394/','Enuresis',': Involuntary discharge of URINE after expected age of completed development of urinary control. This can happen during the daytime (DIURNAL ENURESIS) while one is awake or during sleep (NOCTURNAL ENURESIS). Enuresis can be in children or in adults (as persistent primary enuresis and secondary adult-onset enuresis).','(terms occurring on more labels are shown first): enuresis'),('http://sideeffects.embl.de/se/C0014431/','Enzyme induction',': An increase in the rate of synthesis of an enzyme due to the presence of an inducer which acts to derepress the gene responsible for enzyme synthesis.','(terms occurring on more labels are shown first): enzyme induction'),('http://sideeffects.embl.de/se/C0014457/','Eosinophilia',': disordered formation of eosinophils or an abnormal accumulation or deficiency of these cells.','(terms occurring on more labels are shown first): eosinophilia, eosinophils increased, increased eosinophils, increased eosinophil count'),('http://sideeffects.embl.de/se/C0014518/','Toxic epidermal necrolysis',': A systemic, serious, and life-threatening disorder characterized by erythematous and necrotic lesions in the skin and mucous membranes that are associated with bullous detachment of the epidermis. The epidermal and mucous membranes detachment leads to sepsis and may be fatal. The lesions appear throughout the body and occupy more than 30% of the body surfaces. It is a hypersensitivity reaction usually caused by drugs (e.g., sulfonamides, nonsteroidal anti-inflammatory drugs, anticonvulsants, and antiretroviral drugs).','(terms occurring on more labels are shown first): toxic epidermal necrolysis, Lyell\'s syndrome, Lyell syndrome, Lyell\'s disease, Lyell\'s syndromes, toxic-epidermal necrolysis, Lyellsyndrome, Lyell-Syndrome, Lyell s syndrome, toxic epi- dermal necrolysis, Lyell\'ssyndrome'),('http://sideeffects.embl.de/se/C0014544/','Epilepsy',': A disorder characterized by recurrent episodes of paroxysmal brain dysfunction due to a sudden, disorderly, and excessive neuronal discharge. Epilepsy classification systems are generally based upon: (1) clinical features of the seizure episodes (e.g., motor seizure), (2) etiology (e.g., post-traumatic), (3) anatomic site of seizure origin (e.g., frontal lobe seizure), (4) tendency to spread to other structures in the brain, and (5) temporal patterns (e.g., nocturnal epilepsy). (From Adams et al., Principles of Neurology, 6th ed, p313)','(terms occurring on more labels are shown first): epilepsy, epileptic, seizure disorders, epileptic seizures, epileptic seizure, epileptics, seizure disorder, epilepsies, epilepsy types'),('http://sideeffects.embl.de/se/C0014549/','Grand mal convulsion',': A generalized seizure disorder characterized by recurrent major motor seizures. The initial brief tonic phase is marked by trunk flexion followed by diffuse extension of the trunk and extremities. The clonic phase features rhythmic flexor contractions of the trunk and limbs, pupillary dilation, elevations of blood pressure and pulse, urinary incontinence, and tongue biting. This is followed by a profound state of depressed consciousness (post-ictal state) which gradually improves over minutes to hours. The disorder may be cryptogenic, familial, or symptomatic (caused by an identified disease process). (From Adams et al., Principles of Neurology, 6th ed, p329)','(terms occurring on more labels are shown first): primary generalized tonic-clonic seizures, grand mal convulsion, grand mal convulsions, convulsions grand mal, primary generalized tonic- clonic seizures, PrimaryGeneralized Tonic-Clonic Seizures, primary generalized tonicclonic seizures, clonic-tonic convulsions'),('http://sideeffects.embl.de/se/C0014591/','Epistaxis',': A disorder characterized by bleeding from the nose.','(terms occurring on more labels are shown first): epistaxis, nosebleed, nose bleed, nose bleeds, nosebleeds, nose bleeding, nasal bleeding'),('http://sideeffects.embl.de/se/C0014724/','Eructation',': The ejection of gas or air through the mouth from the stomach.','(terms occurring on more labels are shown first): eructation, belching, Eructations, eructa- tion, Burping'),('http://sideeffects.embl.de/se/C0014742/','Erythema multiforme',': A hypersensitivity reaction characterized by the sudden appearance of symmetrical cutaneous and mucocutaneous macular or popular lesions which evolve into lesions with bright red borders (target lesions). The lesions usually appear in the hands, feet, extremities, and face. Symptoms include fever, malaise, sore throat, cough, vomiting, diarrhea, arthalgia, and myalgia. Causes include infections (most commonly herpes simplex virus), drugs (e.g., sulfonamides, anticonvulsants, and antibiotics), malignancies, and collagen vascular disorders.','(terms occurring on more labels are shown first): erythema multiforme, multiforme erythema, multiformeErythema, e rythema multiforme'),('http://sideeffects.embl.de/se/C0014848/','Oesophageal achalasia',': A motility disorder of the ESOPHAGUS in which the LOWER ESOPHAGEAL SPHINCTER (near the CARDIA) fails to relax resulting in functional obstruction of the esophagus, and DYSPHAGIA. Achalasia is characterized by a grossly contorted and dilated esophagus (megaesophagus).','(terms occurring on more labels are shown first): cardiospasm'),('http://sideeffects.embl.de/se/C0014863/','Oesophageal spasm',': A hypermotility disorder of the ESOPHAGUS that is characterized by spastic non-peristaltic responses to SWALLOWING; CHEST PAIN; and DYSPHAGIA.','(terms occurring on more labels are shown first): esophageal spasm, esophagospasm, esophageal spasms, oesophageal spasm'),('http://sideeffects.embl.de/se/C0014868/','Oesophagitis',': INFLAMMATION, acute or chronic, of the ESOPHAGUS caused by BACTERIA, chemicals, or TRAUMA.','(terms occurring on more labels are shown first): esophagitis, oesophagitis'),('http://sideeffects.embl.de/se/C0015230/','Rash',': Diseases in which skin eruptions or rashes are a prominent manifestation. Classically, six such diseases were described with similar rashes; they were numbered in the order in which they were reported. Only the fourth (Duke\'s disease), fifth (ERYTHEMA INFECTIOSUM), and sixth (EXANTHEMA SUBITUM) numeric designations survive as occasional synonyms in current terminology.','(terms occurring on more labels are shown first): rash, skin rash, rashes, skin rashes, exanthema, skin eruption, exanthem, skin-rash, cutaneous eruptions, Exanthemas, Skin - rash, Skinrash, Skin- rash, exanthems, skinrashes, Skin -rash'),('http://sideeffects.embl.de/se/C0015371/','Extrapyramidal disorder',': A movement disorder caused by defects in the basal ganglia. The clinical manifestations include changes in the muscle tone, dyskinesia, and akinesia. Causes include vascular disorders, degenerative disorders, and antipsychotic drugs.','(terms occurring on more labels are shown first): extrapyramidal disorder, extrapyramidal syndrome, extrapyramidal disorders, extrapyramidal syndromes, extra pyramidal disorder, Extrapyramida l disorder, extra pyramidal disorders'),('http://sideeffects.embl.de/se/C0015397/','Eye disorder',': Any deviation from the normal structure or function of the eye that is manifested by a characteristic set of symptoms and signs.','(terms occurring on more labels are shown first): eye disorders, eye disorder, ophthalmic disorders, eye disease, Eyedisorders, eye diseases, E ye Disorders'),('http://sideeffects.embl.de/se/C0015423/','Eyelid disorder',': pathologic condition of either of the two movable folds (upper and lower) that protect the anterior surface of the eyeball or eyelid.','(terms occurring on more labels are shown first): eyelid disorder, eyelid diseases, eyelid disorders'),('http://sideeffects.embl.de/se/C0015672/','Fatigue',': That state, following a period of mental or bodily activity, characterized by a lessened capacity for work and reduced efficiency or accomplishment, usually accompanied by a feeling of weariness, sleepiness, or irritability. (On-line Medical Dictionary)','(terms occurring on more labels are shown first): fatigue,