ther structures). Injuries may be classified by whether or not the skull is penetrated (i.e., penetrating vs. nonpenetrating) or whether there is an associated hemorrhage.','(terms occurring on more labels are shown first): head injury, head trauma, Head Injuries'),('http://sideeffects.embl.de/se/C0018681/','Headache',': A disorder characterized by a sensation of marked discomfort in various parts of the head, not confined to the area of distribution of any nerve.','(terms occurring on more labels are shown first): headache, headaches, head ache, head- aches, cephalalgia, head pain, h eadache, H ea da ch e'),('http://sideeffects.embl.de/se/C0018772/','Partial hearing loss','(terms occurring on more labels are shown first): decreased hearing, impaired hearing, reduced hearing',':'),('http://sideeffects.embl.de/se/C0018790/','Cardiac arrest',': Cardiac arrest is the non-fatal, sudden cessation of cardiac activity so that the victim subject/patient becomes unresponsive, with no normal breathing and no signs of circulation. Cardiac arrest should be used to signify an event as described above that is reversed, usually by CPR, and/or defibrillation or cardioversion, or cardiac pacing.','(terms occurring on more labels are shown first): cardiac arrest, heart arrest, asystole, ventricular asystole, asystolic'),('http://sideeffects.embl.de/se/C0018794/','Block heart',': Impaired conduction of cardiac impulse that can occur anywhere along the conduction pathway, such as between the SINOATRIAL NODE and the right atrium (SA block) or between atria and ventricles (AV block). Heart blocks can be classified by the duration, frequency, or completeness of conduction block. Reversibility depends on the degree of structural or functional defects.','(terms occurring on more labels are shown first): heart block, conduction block, heartblock'),('http://sideeffects.embl.de/se/C0018799/','Cardiac disorder',': Any deviation from the normal structure or function of the cardiac system that is