lood'),('http://sideeffects.embl.de/se/C0018932/','Haematochezia',': The passage of bright red blood from the rectum. The blood may or may not be mixed with formed stool in the form of blood, blood clots, bloody stool or diarrhea.','(terms occurring on more labels are shown first): bloody stools, hematochezia, haematochezia'),('http://sideeffects.embl.de/se/C0018939/','Blood disorder',': A neoplastic or non-neoplastic disorder that affects the production and proliferation of the hematopoietic cells including lymphoid cells, the synthesis of hemoglobin, and/or the mechanisms of coagulation.','(terms occurring on more labels are shown first): blood dyscrasias, hematologic disorders, blood dyscrasia, Blood and lymphatic disorders, hematological disorders, blood disorders, haematological disorders, Blood and lymphatic systems disorders, Blood and lymphatic system disorder, blood disorder, Disorders of Blood and Lymphatic, Hematologic Disorder, Hematologic Diseases'),('http://sideeffects.embl.de/se/C0018965/','Haematuria',': A disorder characterized by laboratory test results that indicate blood in the urine.','(terms occurring on more labels are shown first): hematuria, haematuria, Urine blood'),('http://sideeffects.embl.de/se/C0019061/','Haemolytic uraemic syndrome',': A syndrome that is associated with microvascular diseases of the KIDNEY, such as RENAL CORTICAL NECROSIS. It is characterized by hemolytic anemia (ANEMIA, HEMOLYTIC); THROMBOCYTOPENIA; and ACUTE RENAL FAILURE.','(terms occurring on more labels are shown first): hemolytic uremic syndrome, hemolytic-uremic syndrome, haemolytic uraemic syndrome, hemolytic- uremic syndrome, hae- molytic uraemic syndrome'),('http://sideeffects.embl.de/se/C0019080/','Haemorrhage',': In medicine, loss of blood from damaged blood vessels. A hemorrhage may be internal or external, and usually involves a lot of bleeding in a short time.','(terms occurring on more labels are shown first): bleeding, hemorrhage, haemorrhage, bleed, hemorrhages, haemorrhages, bleeding problems, haemorrha ge, Bleeds'),('http://sideeffects.embl.de/se/C0019087/','Haemorrhagic disorder',': spontaneous or near spontaneous bleeding caused by a defect in clotting mechanisms (blood coagulation disorders) or another abnormality causing a structural flaw in the blood vessels (vascular hemostatic disorders).','(terms occurring on more labels are shown first): hemorrhagic diathesis, hemorrhagic disorder, Haemorrhagic diathesis, Haemorrhagic disorder'),('http://sideeffects.embl.de/se/C0019112/','Haemorrhoids',': Swollen veins in the lower part of the RECTUM or ANUS. Hemorrhoids can be inside the anus (internal), under the skin around the anus (external), or protruding from inside to outside of the anus. People with hemorrhoids may or may not exhibit symptoms which include bleeding, itching, and pain.','(terms occurring on more labels are shown first): hemorrhoids, haemorrhoids, hemorrhoid, hemo rrhoids'),('http://sideeffects.embl.de/se/C0019158/','Hepatitis',': Disease of the liver causing inflammation. Symptoms include an enlarged liver, fever, nausea, vomiting, abdominal pain, and dark urine.','(terms occurring on more labels are shown first): hepatitis, nonspecific hepatitis'),('http://sideeffects.embl.de/se/C0019189/','Chronic hepatitis',': INFLAMMATION of the LIVER with ongoing hepatocellular injury for 6 months or more, characterized by NECROSIS of HEPATOCYTES and inflammatory cell (LEUKOCYTES) infiltration. Chronic hepatitis can be caused by viruses, medications, autoimmune diseases, and other unknown factors.','(terms occurring on more labels are shown first): chronic hepatitis, recurrent hepatitis'),('http://sideeffects.embl.de/se/C0019209/','Hepatomegaly',': Abnormal enlargement of the liver.','(terms occurring on more labels are shown first): hepatomegaly, enlarged liver, liver enlargement, hepato-megaly'),('http://sideeffects.embl.de/se/C0019270/','Hernia',': Protrusion of tissue, structure, or part of an organ through the bone, muscular tissue, or the membrane by which it is normally contained. Hernia may involve tissues such as the ABDOMINAL WALL or the respiratory DIAPHRAGM. Hernias may be internal, external, congenital, or acquired.','(terms occurring on more labels are shown first): hernia'),('http://sideeffects.embl.de/se/C0019345/','Herpes labialis',': Herpes simplex, caused by type 1 virus, primarily spread by oral secretions and usually occurring as a concomitant of fever. It may also develop in the absence of fever or prior illness. It commonly involves the facial region, especially the lips and the nares. (Dorland, 27th ed.)','(terms occurring on more labels are shown first): cold sores, herpes labialis, cold sore, fever sore, fever blisters'),('http://sideeffects.embl.de/se/C0019348/','Herpes simplex',': A group of acute infections caused by herpes simplex virus type 1 or type 2 that is characterized by the development of one or more small fluid-filled vesicles with a raised erythematous base on the skin or mucous membrane. It occurs as a primary infection or recurs due to a reactivation of a latent infection. (Dorland, 27th ed.)','(terms occurring on more labels are shown first): herpes simplex, herpes simplex infection, herpes simplex infections'),('http://sideeffects.embl.de/se/C0019521/','Hiccups',': A disorder characterized by repeated gulp sounds that result from an involuntary opening and closing of the glottis. This is attributed to a spasm of the diaphragm.','(terms occurring on more labels are shown first): hiccup, hiccups, hiccough, hiccoughs'),('http://sideeffects.embl.de/se/C0019557/','Hip fracture',': Traumatic or pathological injury to the hip in which the continuity of either the femoral head, femoral neck, intertrochanteric or subtrochanteric regions is broken. Symptoms include pain in the hip or groin, bruising and swelling in and around the hip area. The injured hip is turned outward and the leg appears shorter on that side.','(terms occurring on more labels are shown first): hip fracture, hip fractures'),('http://sideeffects.embl.de/se/C0020039/','Hostility',': Tendency to feel anger toward and to seek to inflict harm upon a person or group.','(terms occurring on more labels are shown first): hostility'),('http://sideeffects.embl.de/se/C0020433/','Hyperbilirubinaemia',': A condition characterized by an abnormal increase of BILIRUBIN in the blood, which may result in JAUNDICE. Bilirubin, a breakdown product of HEME, is normally excreted in the BILE or further catabolized before excretion in the urine.','(terms occurring on more labels are shown first): bilirubinemia, hyperbilirubinemia, hyperbilirubinaemia, bilirubinaemia, hyper-bilirubinemia'),('http://sideeffects.embl.de/se/C0020440/','Hypercapnia',': A clinical manifestation of abnormal increase in the amount of carbon dioxide in arterial blood.','(terms occurring on more labels are shown first): hypercapnia, hypercarbia'),('http://sideeffects.embl.de/se/C0020453/','Hyperaesthesia',': Increased sensitivity to cutaneous stimulation due to a diminished threshold or an increased response to stimuli.','(terms occurring on more labels are shown first): hyperesthesia, hyperaesthesia, hyper- aesthesia'),('http://sideeffects.embl.de/se/C0020456/','Hyperglycaemia',': A disorder characterized by laboratory test results that indicate an elevation in the concentration of blood sugar. It is usually an indication of diabetes mellitus or glucose intolerance.','(terms occurring on more labels are shown first): hyperglycemia, hyperglycaemia, increased blood sugar levels, Elevated blood glucose levels, Blood glucose increases, increased blood glucose level, high blood sugar, high blood glucose, increase in blood glucose, hyperglycem ia, Hyperglycaem ia, hyper- glycemia, h yperglycaemia, elevated blood sugar'),('http://sideeffects.embl.de/se/C0020458/','Hyperhidrosis',': Excessive sweating. In the localized type, the most frequent sites are the palms, soles, axillae, inguinal folds, and the perineal area. Its chief cause is thought to be emotional. Generalized hyperhidrosis may be induced by a hot, humid environment, by fever, or by vigorous exercise.','(terms occurring on more labels are shown first): hyperhidrosis, hyperhydrosis, H y perhidrosis, Hyperhidro sis, hyper-hidrosis'),('http://sideeffects.embl.de/se/C0020461/','Hyperkalaemia',': Abnormally high potassium concentration in the blood, most often due to defective renal excretion. It is characterized clinically by electrocardiographic abnormalities (elevated T waves and depressed P waves, and eventually by atrial asystole). In severe cases, weakness and flaccid paralysis may occur. (Dorland, 27th ed)','(terms occurring on more labels are shown first): hyperkalemia, hyperkalaemia, hyper- kalemia'),('http://sideeffects.embl.de/se/C0020488/','Hypernatraemia',': Excessive amount of sodium in the blood. (Dorland, 27th ed)','(terms occurring on more labels are shown first): sodium retention, hypernatremia, hypernatraemia, Sodium overload'),('http://sideeffects.embl.de/se/C0020517/','Hypersensitivity',': Hypersensitivity; a local or general reaction of an organism following contact with a specific allergen to which it has been previously exposed and to which it has become sensitized.','(terms occurring on more labels are shown first): hypersensitivity reactions, hypersensitivity, allergic reaction, allergic reactions, allergy, hypersensitivity reaction, allergies, hypersensitivity symptoms, allergic disorders, allergic response, HypersensitivityReactions, Hyper-sensitivity, hyper- sensitivity, Hy persensitivity reactions, hypersensitivity reac- tions, Hypersensitivit y, Hypersensitivi- ty reactions, Hypersensiti vity, hypersensit ivit y react ions, Hyper- sensitivity reaction, Hype rs e ns itivity, h ypersensitivity, allergic react ion'),('http://sideeffects.embl.de/se/C0020538/','Hypertension',': Pathological increase in blood pressure defined as one of the following: History of hypertension diagnosed and treated with medication, diet, and/or exercise; On at least 2 separate occasions, documented blood pressure greater than 140 mm Hg systolic and/or 90 mm Hg diastolic in patients without diabetes or chronic kidney disease, or blood pressure greater than 130 mm Hg systolic or 80 mm Hg diastolic in patients with diabetes or chronic kidney disease; Currently on pharmacological therapy for the treatment of hypertension.','(terms occurring on more labels are shown first): hypertension, high blood pressure, arterial hypertension, hyperten- sion, Vascular - Hypertension, hyper- tension, Hypertensio n'),('http://sideeffects.embl.de/se/C0020578/','Hyperventilation',': A pulmonary ventilation rate faster than is metabolically necessary for the exchange of gases. It is the result of an increased frequency of breathing, an increased tidal volume, or a combination of both. It causes an excess intake of oxygen and the blowing off of carbon dioxide.','(terms occurring on more labels are shown first): hyperventilation'),('http://sideeffects.embl.de/se/C0020580/','Hypoaesthesia',': Impairment of tactile sensitivity manifesting as partial loss of sensitivity to sensory stimuli.','(terms occurring on more labels are shown first): hypesthesia, hypoesthesia, hypoaesthesia, hypaesthesia, hypo-aesthesia, hypoesthesias, Hypoaesthes ia'),('http://sideeffects.embl.de/se/C0020598/','Hypocalcaemia',': Reduction of the blood calcium below normal. Manifestations include hyperactive deep tendon reflexes, Chvostek\'s sign, muscle and abdominal cramps, and carpopedal spasm. (Dorland, 27th ed)','(terms occurring on more labels are shown first): hypocalcemia, hypocalcaemia, Hypo- calcaemia, hypocalcae- mia'),('http://sideeffects.embl.de/se/C0020615/','Hypoglycaemia',': A syndrome of abnormally low BLOOD GLUCOSE level. Clinical hypoglycemia has diverse etiologies. Severe hypoglycemia eventually lead to glucose deprivation of the CENTRAL NERVOUS SYSTEM resulting in HUNGER; SWEATING; PARESTHESIA; impaired mental function; SEIZURES; COMA; and even DEATH.','(terms occurring on more labels are shown first): hypoglycemia, hypoglycaemia, low blood sugar, hypo-glycaemia, low blood sugar level'),('http://sideeffects.embl.de/se/C0020619/','Hypogonadism',': Condition resulting from deficient gonadal functions, such as GAMETOGENESIS and the production of GONADAL STEROID HORMONES. It is characterized by delay in GROWTH, germ cell maturation, and development of secondary sex characteristics. Hypogonadism can be due to a deficiency of GONADOTROPINS (hypogonadotropic hypogonadism) or due to primary gonadal failure (hypergonadotropic hypogonadism).','(terms occurring on more labels are shown first): hypogonadism'),('http://sideeffects.embl.de/se/C0020621/','Hypokalaemia',': Abnormally low potassium concentration in the blood. It may result from potassium loss by renal secretion or by the gastrointestinal route, as by vomiting or diarrhea. It may be manifested clinically by neuromuscular disorders ranging from weakness to paralysis, by electrocardiographic abnormalities (depression of the T wave and elevation of the U wave), by renal disease, and by gastrointestinal disorders. (Dorland, 27th ed)','(terms occurring on more labels are shown first): hypokalemia, hypokalaemia, hypokalaem- ia'),('http://sideeffects.embl.de/se/C0020625/','Hyponatraemia',': Hyponatremia is an electrolyte disturbance in which the sodium concentration in the serum is lower than normal. Sodium homeostasis is vital to the normal physiologic function of cells. Hyponatremia is defined as a serum level of less than 135 mEq/L and is considered severe when the serum level is below 125 mEq/L.','(terms occurring on more labels are shown first): hyponatremia, hyponatraemia, decreased serum sodium, decrease in serum sodium, Serum sodium decreased, blood sodium decreased, sodium depletion, decreased blood sodium, Hyponatraem ia'),('http://sideeffects.embl.de/se/C0020639/','Hypoproteinaemia',': A condition in which total serum protein level is below the normal range. Hypoproteinemia can be caused by protein malabsorption in the gastrointestinal tract, EDEMA, or PROTEINURIA.','(terms occurring on more labels are shown first): hypoproteinemia, hypoproteinaemia'),('http://sideeffects.embl.de/se/C0020649/','Hypotension',': Abnormally low BLOOD PRESSURE that can result in inadequate blood flow to the brain and other vital organs. Common symptom is DIZZINESS but greater negative impacts on the body occur when there is prolonged depravation of oxygen and nutrients.','(terms occurring on more labels are shown first): hypotension, lower blood pressure, decreased blood pressure, blood pressure decreased, fall in blood pressure, low blood pressure, drop in blood pressure, lowers blood pressure, lowered blood pressure, hypote nsion, arterial hypotension, h ypotension'),('http://sideeffects.embl.de/se/C0020651/','Orthostatic hypotension',': A significant drop in BLOOD PRESSURE after assuming a standing position. Orthostatic hypotension is a finding, and defined as a 20-mm Hg decrease in systolic pressure or a 10-mm Hg decrease in diastolic pressure 3 minutes after the person has risen from supine to standing. Symptoms generally include DIZZINESS, blurred vision, and SYNCOPE.','(terms occurring on more labels are shown first): postural hypotension, orthostatic hypotension, hypotension postural, hypotension orthostatic, posturalhypotension, Orthostatichypotension, hypotension-postural, o rthostatic hypotension, Hypotension - postural'),('http://sideeffects.embl.de/se/C0020672/','Body temperature decreased',': Abnormally low body temperature. Treatment is required when the body temperature is 35C (95F) or below. Symptoms include decreased mental function, lethargy, and disorientation.','(terms occurring on more labels are shown first): hypothermia, body temperature decreased, decreased body temperature, low body temperature, hypothermic'),('http://sideeffects.embl.de/se/C0021053/','Immune system disorder',': Disorders caused by abnormal or absent immunologic mechanisms, whether humoral, cell-mediated, or both.','(terms occurring on more labels are shown first): immune system disorders, immune system disorder, Immune disorders, Immunesystemdisorders, Immune system di sorders, immune disorder, Im mune System Disorders'),('http://sideeffects.embl.de/se/C0021099/','Impetigo',': A common superficial bacterial infection caused by STAPHYLOCOCCUS AUREUS or group A beta-hemolytic streptococci. Characteristics include pustular lesions that rupture and discharge a thin, amber-colored fluid that dries and forms a crust. This condition is commonly located on the face, especially about the mouth and nose.','(terms occurring on more labels are shown first): impetigo'),('http://sideeffects.embl.de/se/C0021177/','Libido increased',': A disorder characterized by an increase in sexual desire.','(terms occurring on more labels are shown first): increased libido, libido increased, increased sexual desire, increase in libido, increasedlibido'),('http://sideeffects.embl.de/se/C0021368/','Inflammation',': A localized protective response resulting from injury or destruction of tissues. Inflammation serves to destroy, dilute, or wall off both the injurious agent and the injured tissue. In the acute phase, inflammation is characterized by the signs of pain, heat, redness, swelling, and loss of function. Histologically, inflammation involves a complex series of events, including dilatation of arterioles, capillaries, and venules, with increased permeability and blood flow; exudation of fluids, including plasma proteins; and leukocyte migration into the site of inflammation.','(terms occurring on more labels are shown first): inflammation, inflammatory reaction, inflammations'),('http://sideeffects.embl.de/se/C0021400/','Influenza',': An acute viral infection of the respiratory tract, occurring in isolated cases, in epidemics, or in pandemics; it is caused by serologically different strains of viruses (influenzaviruses) designated A, B, and C, has a 3-day incubation period, and usually lasts for 3 to 10 days. It is marked by inflammation of the nasal mucosa, pharynx, and conjunctiva; headache; myalgia; often fever, chills, and prostration; and occasionally involvement of the myocardium or central nervous system. (from Dorland)','(terms occurring on more labels are shown first): flu syndrome, influenza, flu-syndrome, grippe, Influenzae'),('http://sideeffects.embl.de/se/C0021843/','Intestinal obstruction',': Any impairment, arrest, or reversal of the normal flow of INTESTINAL CONTENTS toward the ANAL CANAL.','(terms occurring on more labels are shown first): intestinal obstruction, bowel obstruction, i ntestinal obstruction'),('http://sideeffects.embl.de/se/C0022081/','Iritis',': inflammation of the iris characterized by circumcorneal injection, aqueous flare, keratotic precipitates, and constricted and sluggish pupil along with discoloration of the iris.','(terms occurring on more labels are shown first): iritis'),('http://sideeffects.embl.de/se/C0022107/','Irritability',': An abnormal responsiveness or morbid excitability of an organ, its part, or entire organism or its part to stimuli.','(terms occurring on more labels are shown first): irritability, irritable mood, irritable, fussiness, irritabilit y, irritabi lity'),('http://sideeffects.embl.de/se/C0022281/','Eye pruritus','(terms occurring on more labels are shown first): eye itching, eye pruritus, ocular itching, itchy eyes, itching eyes, eye itch, itching eye',':'),('http://sideeffects.embl.de/se/C0022346/','Jaundice',': A condition in which the skin and the whites of the eyes become yellow, urine darkens, and the color of stool becomes lighter than normal. Jaundice occurs when the liver is not working properly or when a bile duct is blocked.','(terms occurring on more labels are shown first): jaundice, icterus, jaun- dice'),('http://sideeffects.embl.de/se/C0022354/','Jaundice cholestatic',': Jaundice, the condition with yellowish staining of the skin and mucous membranes, that is due to impaired BILE flow in the BILIARY TRACT, such as INTRAHEPATIC CHOLESTASIS, or EXTRAHEPATIC CHOLESTASIS.','(terms occurring on more labels are shown first): cholestatic jaundice, obstructive jaundice, jaundice cholestatic, cholestatic icterus'),('http://sideeffects.embl.de/se/C0022408/','Arthropathy',': condition in which there is a deviation from or interruption of the normal structure or function of the joints.','(terms occurring on more labels are shown first): arthrosis, joint disorder, arthropathy, arthropathies, joint disorders, joint disease'),('http://sideeffects.embl.de/se/C0022568/','Keratitis',': A disorder characterized by inflammation to the cornea of the eye.','(terms occurring on more labels are shown first): keratitis'),('http://sideeffects.embl.de/se/C0022573/','Keratoconjunctivitis',': simultaneous inflammation of the cornea and conjunctiva.','(terms occurring on more labels are shown first): keratoconjunctivitis, kerato conjunctivitis'),('http://sideeffects.embl.de/se/C0022650/','Calculus of kidney',': Stones in the KIDNEY, usually formed in the urine-collecting area of the kidney (KIDNEY PELVIS). Their sizes vary and most contains CALCIUM OXALATE.','(terms occurring on more labels are shown first): renal calculus, kidney calculus, renal calculi, renal stone, kidney stones, renal stones, calculus renal, kidney stone, Calculus Kidney, kidneycalculus'),('http://sideeffects.embl.de/se/C0022660/','Renal failure acute',': clinical syndrome characterized by a sudden decrease in glomerular filtration rate, usually associated with oliguria and always associated with biochemical consequences of the reduction in glomerular filtration rate such as a rise in blood urea nitrogen (BUN) and serum creatinine concentrations.','(terms occurring on more labels are shown first): acute renal failure, acute kidney failure, renal failure acute, acut e renal failure'),('http://sideeffects.embl.de/se/C0023066/','Laryngospasm',': Paroxysmal spasmodic muscular contraction of the vocal cords. It is brief, usually lasting for less than one minute, interrupting the speech and breathing and may produce a high-pitched breathing sound. It may occur under anesthesia or may be associated with gastroesophageal reflex disease.','(terms occurring on more labels are shown first): laryngospasm, laryngismus, laryngeal spasm, laryngeal stridor, laryngospasms, laryn-gospasm'),('http://sideeffects.embl.de/se/C0023067/','Laryngitis',': Inflammation of the LARYNGEAL MUCOSA, including the VOCAL CORDS. Laryngitis is characterized by irritation, edema, and reduced pliability of the mucosa leading to VOICE DISORDERS such as APHONIA and HOARSENESS.','(terms occurring on more labels are shown first): laryngitis'),('http://sideeffects.embl.de/se/C0023218/','Cramps of lower extremities','(terms occurring on more labels are shown first): leg cramps, cramps legs, cramps leg, leg cramp, cramps in legs',':'),('http://sideeffects.embl.de/se/C0023380/','Lethargy',': A general state of sluggishness, listless, or uninterested, with being tired, and having difficulty concentrating and doing simple tasks. It may be related to DEPRESSION or DRUG ADDICTION.','(terms occurring on more labels are shown first): lethargy'),('http://sideeffects.embl.de/se/C0023418/','Leukaemia',': A malignant (clonal) hematologic disorder, involving hematopoietic stem cells and characterized by the presence of primitive or atypical myeloid or lymphoid cells in the bone marrow and the blood. Leukemias are classified as acute or chronic based on the degree of cellular differentiation and the predominant cell type present. Leukemia is usually associated with anemia, fever, hemorrhagic episodes, and splenomegaly. Common leukemias include acute myeloid leukemia, chronic myelogenous leukemia, acute lymphoblastic or precursor lymphoblastic leukemia, and chronic lymphocytic leukemia. Treatment is vital to patient survival; untreated, the natural course of acute leukemias is normally measured in weeks or months, while that of chronic leukemias is more often measured in months or years.','(terms occurring on more labels are shown first): leukemia, leukemias, leukaemia, leukaemias'),('http://sideeffects.embl.de/se/C0023530/','Leukopenia',': reduction in the number of leukocytes in the blood, the count being 5000 per cubic millimeter or less.','(terms occurring on more labels are shown first): leukopenia, leucopenia, leukocytopenia, leu- kopenia, Leucocytopenia'),('http://sideeffects.embl.de/se/C0023533/','Leukorrhea',': A clear or white discharge from the VAGINA, consisting mainly of MUCUS.','(terms occurring on more labels are shown first): leukorrhea, leukorrhoea, leucorrhoea'),('http://sideeffects.embl.de/se/C0023646/','Lichen planus',': An inflammatory, pruritic disease of the skin and mucous membranes, which can be either generalized or localized. It is characterized by distinctive purplish, flat-topped papules having a predilection for the trunk and flexor surfaces. The lesions may be discrete or coalesce to form plaques. Histologically, there is a \"saw-tooth\" pattern of epidermal hyperplasia and vacuolar alteration of the basal layer of the epidermis along with an intense upper dermal inflammatory infiltrate composed predominantly of T-cells. Etiology is unknown.','(terms occurring on more labels are shown first): lichen planus'),('http://sideeffects.embl.de/se/C0023895/','Liver disorder',': A non-neoplastic or neoplastic disorder that affects the liver parenchyma and intrahepatic bile ducts. Representative examples of non-neoplastic disorders include hepatitis, cirrhosis, cholangitis, and polycystic liver disease. Representative examples of neoplastic disorders include hepatocellular adenoma, hepatocellular carcinoma, intrahepatic cholangiocarcinoma, lymphoma, and angiosarcoma.','(terms occurring on more labels are shown first): liver disease, hepatic disease, liver disorders, liver disorder, hepatocellular disease, hepatic disorders, liver diseases, hepatic disorder, liverdisease, liverdisorders, liverdisorder'),('http://sideeffects.embl.de/se/C0024115/','Lung disorder',': A non-neoplastic or neoplastic condition affecting the lung. Representative examples of non-neoplastic conditions include chronic obstructive pulmonary disease and pneumonia. Representative examples of neoplastic conditions include benign processes (e.g., respiratory papilloma) and malignant processes (e.g., lung carcinoma and metastatic cancer to the lung).','(terms occurring on more labels are shown first): lung disorder, pulmonary disease, lung disorders, lung diseases, lung disease, pulmonary disorders, pneumopathy, pulmonary disorder, pulmonary diseases, Disorder Lung'),('http://sideeffects.embl.de/se/C0024437/','Macular degeneration',': deterioration of the macula lutea in the retina; may be inherited, drug induced, or due to aging; leads to a severe loss of central vision while peripheral vision is retained.','(terms occurring on more labels are shown first): macular degeneration, macula lutea degeneration'),('http://sideeffects.embl.de/se/C0024902/','Breast pain',': Pain in the breast generally classified as cyclical (associated with menstrual periods), or noncyclical, i.e. originating from the breast or nearby muscles or joints, ranging from minor discomfort to severely incapacitating.','(terms occurring on more labels are shown first): breast pain, mastalgia, mastodynia, Pain Breast'),('http://sideeffects.embl.de/se/C0025061/','Mediastinal disorder',': Disorders of the mediastinum, general or unspecified.','(terms occurring on more labels are shown first): mediastinal disorders, mediastinal disorder, mediastinal disease, med iastinal disorders, me diastinal di sorders, M ediastinal disorders, m ediastinal d isorders'),('http://sideeffects.embl.de/se/C0025222/','Melaena',': Abnormally dark tarry feces containing blood (usually from gastrointestinal bleeding).','(terms occurring on more labels are shown first): melena, melaena, black tarry stools, tarry stool'),('http://sideeffects.embl.de/se/C0025289/','Meningitis',': Inflammation of the coverings of the brain and/or spinal cord, which consist of the PIA MATER; ARACHNOID; and DURA MATER. Infections (viral, bacterial, and fungal) are the most common causes of this condition, but subarachnoid hemorrhage (HEMORRHAGES, SUBARACHNOID), chemical irritation (chemical MENINGITIS), granulomatous conditions, neoplastic conditions (CARCINOMATOUS MENINGITIS), and other inflammatory conditions may produce this syndrome. (From Joynt, Clinical Neurology, 1994, Ch24, p6)','(terms occurring on more labels are shown first): meningitis, meningitides'),('http://sideeffects.embl.de/se/C0025290/','Meningitis aseptic',': A syndrome characterized by headache, neck stiffness, low grade fever, and CSF lymphocytic pleocytosis in the absence of an acute bacterial pathogen. Viral meningitis is the most frequent cause although MYCOPLASMA INFECTIONS; RICKETTSIA INFECTIONS; diagnostic or therapeutic procedures; NEOPLASTIC PROCESSES; septic perimeningeal foci; and other conditions may result in this syndrome. (From Adams et al., Principles of Neurology, 6th ed, p745)','(terms occurring on more labels are shown first): aseptic meningitis, asepticmeningitis, meningitis aseptic'),('http://sideeffects.embl.de/se/C0025345/','Menstrual disorder',': variations of menstruation or the menstrual cycle which may be indicative of disease.','(terms occurring on more labels are shown first): menstrual disorder, menstrual disorders, abnormal menses, menstruation disorder, menstrual disturbance'),('http://sideeffects.embl.de/se/C0026205/','Miosis',': Pupillary constriction. This may result from congenital absence of the dilatator pupillary muscle, defective sympathetic innervation, or irritation of the CONJUNCTIVA or CORNEA.','(terms occurring on more labels are shown first): miosis, small pupil, constricted pupil'),('http://sideeffects.embl.de/se/C0026650/','Movement disorder',': Syndromes which feature DYSKINESIAS as a cardinal manifestation of the disease process. Included in this category are degenerative, hereditary, post-infectious, medication-induced, post-inflammatory, and post-traumatic conditions.','(terms occurring on more labels are shown first): movement disorder, movement disorders'),('http://sideeffects.embl.de/se/C0026821/','Cramp muscle',': A sustained and usually painful contraction of muscle fibers. This may occur as an isolated phenomenon or as a manifestation of an underlying disease process (e.g., UREMIA; HYPOTHYROIDISM; MOTOR NEURON DISEASE; etc.). (From Adams et al., Principles of Neurology, 6th ed, p1398)','(terms occurring on more labels are shown first): muscle cramps, cramps, muscle cramp, cramping, cramp, muscular cramps, muscle cramping, muscular cramp, musclecramps'),('http://sideeffects.embl.de/se/C0026826/','Hypertonia',': abnormal increase in skeletal or smooth muscle tone; skeletal muscle hypertonicity may be associated with pyramidal tract lesions or basal ganglia diseases.','(terms occurring on more labels are shown first): hypertonia, increased muscle tone, increased muscle tonus, hypertonus, muscular tone increased, muscle hypertonia, muscular hypertonus, muscle hypertonicity'),('http://sideeffects.embl.de/se/C0026827/','Hypotonia',': A condition of decreased tone of the skeletal muscles and diminished resistance to passive stretching.','(terms occurring on more labels are shown first): hypotonia, muscular hypotonia'),('http://sideeffects.embl.de/se/C0026837/','Muscle rigidity',': Continuous involuntary sustained muscle contraction which is often a manifestation of BASAL GANGLIA DISEASES. When an affected muscle is passively stretched, the degree of resistance remains constant regardless of the rate at which the muscle is stretched. This feature helps to distinguish rigidity from MUSCLE SPASTICITY. (From Adams et al., Principles of Neurology, 6th ed, p73)','(terms occurring on more labels are shown first): muscle rigidity, rigidity, muscular rigidity'),('http://sideeffects.embl.de/se/C0026848/','Myopathy',': A non-neoplastic disorder that affects the muscles. Representative examples include muscular dystrophy, metabolic myopathies, muscular atrophies, and dermatomyositis.','(terms occurring on more labels are shown first): myopathy, muscle disorders, muscle disorder, muscular disorder, muscular disorders, Myopathies'),('http://sideeffects.embl.de/se/C0026858/','Musculoskeletal pain',': Discomfort referable to either the muscles or the bones themselves.','(terms occurring on more labels are shown first): musculoskeletal pain, musculo-skeletal pain, musculoskeletal pains, Musculo- skeletal pain, musculosk eletal pain, Musculoskelet al pain, Musculo skeletal pain'),('http://sideeffects.embl.de/se/C0026946/','Fungal infection',': An infection caused by a fungus.','(terms occurring on more labels are shown first): fungal infection, fungal infections, infection fungal, infection mycotic, fungal disease, mycoses, mycosis, mycotic infection, fungal diseases'),('http://sideeffects.embl.de/se/C0026961/','Mydriasis',': Dilation of pupils to greater than 6 mm combined with failure of the pupils to constrict when stimulated with light. This condition may occur due to injury of the pupillary fibers in the oculomotor nerve, in acute angle-closure glaucoma, and in ADIE SYNDROME.','(terms occurring on more labels are shown first): mydriasis, dilated pupils, dilation of the pupil, dilatation of pupils, dilatation of the pupil, pupillary dilatation, pupillary dilation, pupil dilation, pupils dilated, dilated pupil'),('http://sideeffects.embl.de/se/C0027051/','Myocardial infarction',': Gross necrosis of the myocardium, as a result of interruption of the blood supply to the area, as in coronary thrombosis.','(terms occurring on more labels are shown first): myocardial infarction, myocardial infarct, heart attack, myocardial infarctions, cardiac infarction, heart attacks'),('http://sideeffects.embl.de/se/C0027059/','Myocarditis',': Inflammatory processes of the muscular walls of the heart (MYOCARDIUM) which result in injury to the cardiac muscle cells (MYOCYTES, CARDIAC). Manifestations range from subclinical to sudden death (DEATH, SUDDEN). Myocarditis in association with cardiac dysfunction is classified as inflammatory CARDIOMYOPATHY usually caused by INFECTION, autoimmune diseases, or responses to toxic substances. Myocarditis is also a common cause of DILATED CARDIOMYOPATHY and other cardiomyopathies.','(terms occurring on more labels are shown first): myocarditis'),('http://sideeffects.embl.de/se/C0027066/','Myoclonus',': Involuntary shock-like contractions, irregular in rhythm and amplitude, followed by relaxation, of a muscle or a group of muscles. This condition may be a feature of some CENTRAL NERVOUS SYSTEM DISEASES; (e.g., EPILEPSY, MYOCLONIC). Nocturnal myoclonus is the principal feature of the NOCTURNAL MYOCLONUS SYNDROME. (From Adams et al., Principles of Neurology, 6th ed, pp102-3).','(terms occurring on more labels are shown first): myoclonus, myoclonic jerks'),('http://sideeffects.embl.de/se/C0027424/','Nasal congestion',': The blockage of the nasal passage due to mucosal edema. It is usually the result of a viral infection or an allergic reaction.','(terms occurring on more labels are shown first): nasal congestion, nasal stuffiness, stuffy nose, nasal con- gestion, n asal congestion, congestion -nasal, blocked nose'),('http://sideeffects.embl.de/se/C0027441/','Nasopharyngitis',': Inflammation of the NASOPHARYNX, usually including its mucosa, related lymphoid structure, and glands.','(terms occurring on more labels are shown first): nasopharyngitis, Nasopharyngiti s, Naso-pharyngitis'),('http://sideeffects.embl.de/se/C0027497/','Nausea',': An unpleasant sensation in the stomach usually accompanied by the urge to vomit. Common causes are early pregnancy, sea and motion sickness, emotional stress, intense pain, food poisoning, and various enteroviruses.','(terms occurring on more labels are shown first): nausea, nauseated, nauseous, Naus ea, Nau sea, n ausea, N au sea'),('http://sideeffects.embl.de/se/C0027540/','Necrosis',': The pathological process occurring in cells that are dying from irreparable injuries. It is caused by the progressive, uncontrolled action of degradative ENZYMES, leading to MITOCHONDRIAL SWELLING, nuclear flocculation, and cell lysis. Distinguish it from APOPTOSIS which is a normal, regulated cellular process.','(terms occurring on more labels are shown first): necrosis, necrotic'),('http://sideeffects.embl.de/se/C0027697/','Nephritis',': Inflammation of the kidney. It is a focal or diffuse proliferative or destructive process which may involve the glomerulus, tubule, or interstitial renal tissue. (MeSH)','(terms occurring on more labels are shown first): nephritis'),('http://sideeffects.embl.de/se/C0027707/','Nephritis interstitial',': Inflammation of the interstitial tissue of the kidney. This term is generally used for primary inflammation of KIDNEY TUBULES and/or surrounding interstitium. For primary inflammation of glomerular interstitium, see GLOMERULONEPHRITIS. Infiltration of the inflammatory cells into the interstitial compartment results in EDEMA, increased spaces between the tubules, and tubular renal dysfunction.','(terms occurring on more labels are shown first): interstitial nephritis, nephritis interstitial, tubulo-interstitial nephropathy, i nterstitial nephritis'),('http://sideeffects.embl.de/se/C0027726/','Nephrotic syndrome',': A condition characterized by severe PROTEINURIA, greater than 3.5 g/day in an average adult. The substantial loss of protein in the urine results in complications such as HYPOPROTEINEMIA; generalized EDEMA; HYPERTENSION; and HYPERLIPIDEMIAS. Diseases associated with nephrotic syndrome generally cause chronic kidney dysfunction.','(terms occurring on more labels are shown first): nephrotic syndrome, nephroticsyndrome'),('http://sideeffects.embl.de/se/C0027765/','Nervous system disorder',': Diseases of the central and peripheral nervous system. This includes disorders of the brain, spinal cord, cranial nerves, peripheral nerves, nerve roots, autonomic nervous system, neuromuscular junction, and muscle.','(terms occurring on more labels are shown first): nervous system disorders, nervous system disorder, neurological disease, nervous disorders, neurologic disorders, neurological disorders, neurological disorder, neurologic disorder, Nervoussystemdisorders, neurologic diseases, Nervous s ystem d isorders, Nervoussystem disorders, Nervous System Dis'),('http://sideeffects.embl.de/se/C0027769/','Nervousness',': An uneasy psychological state; the anxious feeling you have when you have the jitters.','(terms occurring on more labels are shown first): nervousness, N ervous, nervous tension, N E RVOUS, nervous- ness, nervousne ss, Ner vous, Ne rvous'),('http://sideeffects.embl.de/se/C0027813/','Neuritis',': A general term indicating inflammation of a peripheral or cranial nerve. Clinical manifestation may include PAIN; PARESTHESIAS; PARESIS; or HYPESTHESIA.','(terms occurring on more labels are shown first): neuritis, peripheral neuritis'),('http://sideeffects.embl.de/se/C0027849/','Neuroleptic malignant syndrome',': A potentially fatal syndrome associated primarily with the use of neuroleptic agents (see ANTIPSYCHOTIC AGENTS) which are in turn associated with dopaminergic receptor blockade (see RECEPTORS, DOPAMINE) in the BASAL GANGLIA and HYPOTHALAMUS, and sympathetic dysregulation. Clinical features include diffuse MUSCLE RIGIDITY; TREMOR; high FEVER; diaphoresis; labile blood pressure; cognitive dysfunction; and autonomic disturbances. Serum CPK level elevation and a leukocytosis may also be present. (From Adams et al., Principles of Neurology, 6th ed, p1199; Psychiatr Serv 1998 Sep;49(9):1163-72)','(terms occurring on more labels are shown first): neuroleptic malignant syndrome, neuroleptic malignant, Neuroleptic Malignant Syndrom e, n euroleptic malignant syndrome'),('http://sideeffects.embl.de/se/C0027868/','Neuromyopathy',': A general term encompassing lower MOTOR NEURON DISEASE; PERIPHERAL NERVOUS SYSTEM DISEASES; and certain MUSCULAR DISEASES. Manifestations include MUSCLE WEAKNESS; FASCICULATION; muscle ATROPHY; SPASM; MYOKYMIA; MUSCLE HYPERTONIA, myalgias, and MUSCLE HYPOTONIA.','(terms occurring on more labels are shown first): neuromyopathy, neuromuscular disorders'),('http://sideeffects.embl.de/se/C0027947/','Neutropenia',': decrease in the number of neutrophilic leukocytes in the blood.','(terms occurring on more labels are shown first): neutropenia, neutrophils decreased, neutropenias, N eutr open ia'),('http://sideeffects.embl.de/se/C0028077/','Night blindness',': Failure or imperfection of vision at night or in dim light, with good vision only on bright days. (Dorland, 27th ed)','(terms occurring on more labels are shown first): night blindness, nyctalopia, night-blindness'),('http://sideeffects.embl.de/se/C0028084/','Nightmare',': A sleep disorder characterized by the repeated occurrence of frightening dreams which precipitate awakenings from sleep; on awakening, the individual becomes fully alert and oriented and has detailed recall of the nightmare, which usually involves imminent danger or extreme embarrassment to the individual.','(terms occurring on more labels are shown first): nightmares, paroniria, nightmare'),('http://sideeffects.embl.de/se/C0028259/','Nodule',': A growth or lump that may be malignant (cancer) or benign (not cancer).','(terms occurring on more labels are shown first): nodules, nodule'),('http://sideeffects.embl.de/se/C0028643/','Numbness',': The loss of the sensation of feeling in an area of the body.','(terms occurring on more labels are shown first): numbness'),('http://sideeffects.embl.de/se/C0028738/','Nystagmus',': Involuntary movements of the eye that are divided into two types, jerk and pendular. Jerk nystagmus has a slow phase in one direction followed by a corrective fast phase in the opposite direction, and is usually caused by central or peripheral vestibular dysfunction. Pendular nystagmus features oscillations that are of equal velocity in both directions and this condition is often associated with visual loss early in life. (Adams et al., Principles of Neurology, 6th ed, p272)','(terms occurring on more labels are shown first): nystagmus'),('http://sideeffects.embl.de/se/C0028961/','Oliguria',': Decreased URINE output that is below the normal range. Oliguria can be defined as urine output of less than or equal to 0.5 or 1 ml/kg/hr depending on the age.','(terms occurring on more labels are shown first): oliguria, urine output decreased, decreased urine output, low urine output, urine volume decreased'),('http://sideeffects.embl.de/se/C0029134/','Optic neuritis',': Inflammation of the optic nerve. Commonly associated conditions include autoimmune disorders such as MULTIPLE SCLEROSIS, infections, and granulomatous diseases. Clinical features include retro-orbital pain that is aggravated by eye movement, loss of color vision, and contrast sensitivity that may progress to severe visual loss, an afferent pupillary defect (Marcus-Gunn pupil), and in some instances optic disc hyperemia and swelling. Inflammation may occur in the portion of the nerve within the globe (neuropapillitis or anterior optic neuritis) or the portion behind the globe (retrobulbar neuritis or posterior optic neuritis).','(terms occurring on more labels are shown first): optic neuritis'),('http://sideeffects.embl.de/se/C0029456/','Osteoporosis',': A condition of reduced bone mass, with decreased cortical thickness and a decrease in the number and size of the trabeculae of cancellous bone (but normal chemical composition), resulting in increased fracture incidence. Osteoporosis is classified as primary (Type 1, postmenopausal osteoporosis; Type 2, age-associated osteoporosis; and idiopathic, which can affect juveniles, premenopausal women, and middle-aged men) and secondary osteoporosis (which results from an identifiable cause of bone mass loss).','(terms occurring on more labels are shown first): osteoporosis'),('http://sideeffects.embl.de/se/C0029560/','Other conjunctivitis','(terms occurring on more labels are shown first): Conjunctivitis NEC, Other - Conjunctivitis',':'),('http://sideeffects.embl.de/se/C0029882/','Otitis media',': A disorder characterized by inflammation (physiologic response to irritation), swelling and redness to the middle ear.','(terms occurring on more labels are shown first): otitis media, otitismedia'),('http://sideeffects.embl.de/se/C0030193/','Pain',': An unpleasant sensation induced by noxious stimuli which are detected by NERVE ENDINGS of NOCICEPTIVE NEURONS.','(terms occurring on more labels are shown first): pain, pains, Painful, unspecified pain'),('http://sideeffects.embl.de/se/C0030232/','Pallor',': A clinical manifestation consisting of an unnatural paleness of the skin.','(terms occurring on more labels are shown first): pallor, paleness'),('http://sideeffects.embl.de/se/C0030252/','Palpitations',': A disorder characterized by an unpleasant sensation of irregular and/or forceful beating of the heart.','(terms occurring on more labels are shown first): palpitations, palpitation, heart throbbing'),('http://sideeffects.embl.de/se/C0030305/','Pancreatitis',': INFLAMMATION of the PANCREAS. Pancreatitis is classified as acute unless there are computed tomographic or endoscopic retrograde cholangiopancreatographic findings of CHRONIC PANCREATITIS (International Symposium on Acute Pancreatitis, Atlanta, 1992). The two most common forms of acute pancreatitis are ALCOHOLIC PANCREATITIS and gallstone pancreatitis.','(terms occurring on more labels are shown first): pancreatitis, inflammation of the pancreas, pan- creatitis'),('http://sideeffects.embl.de/se/C0030312/','Pancytopenia',': Deficiency of all three cell elements of the blood, erythrocytes, leukocytes and platelets.','(terms occurring on more labels are shown first): pancytopenia, bone marrow failure, pancy topenia, pancytope- nia'),('http://sideeffects.embl.de/se/C0030353/','Papilloedema',': Swelling of the OPTIC DISK, usually in association with increased intracranial pressure, characterized by hyperemia, blurring of the disk margins, microhemorrhages, blind spot enlargement, and engorgement of retinal veins. Chronic papilledema may cause OPTIC ATROPHY and visual loss. (Miller et al., Clinical Neuro-Ophthalmology, 4th ed, p175)','(terms occurring on more labels are shown first): papilledema, papillitis, papilloedema, optic disc edema'),('http://sideeffects.embl.de/se/C0030469/','Sinus disorder',': Diseases affecting or involving the PARANASAL SINUSES and generally manifesting as inflammation, abscesses, cysts, or tumors.','(terms occurring on more labels are shown first): sinus disorder'),('http://sideeffects.embl.de/se/C0030554/','Paraesthesia',': Abnormal cutaneous sensations of tingling, numbness, pressure, cold, and warmth that an individual experiences without the presence of a stimulus. It results from functional disturbances of sensory neurons. Causes include peripheral vascular disease, peripheral neuropathy, and nerve damage.','(terms occurring on more labels are shown first): paresthesia, paresthesias, paraesthesia, parasthesia, paraesthesias, Paresthesia S, Parasthesias'),('http://sideeffects.embl.de/se/C0030920/','Peptic ulcer',': A break in the lining of the lower part of the esophagus, the stomach, or the upper part of the small intestine. Peptic ulcers form when cells on the surface of the lining become inflamed and die. They are usually caused by Helicobacter pylori bacteria and by certain medicines, such as aspirin and other nonsteroidal anti-inflammatory drugs (NSAIDs). Peptic ulcers may be linked to cancer and other diseases.','(terms occurring on more labels are shown first): peptic ulcer, peptic ulcers, peptic ulceration, peptic ulcer disease, gastro-duodenal ulcer, gastroduodenal ulcer, gastroduodenal ulcers, pepticulceration, pepticulcer, pep- tic ulcer, gastro- duodenal ulcer'),('http://sideeffects.embl.de/se/C0031046/','Pericarditis',': Inflammation of the PERICARDIUM from various origins, such as infection, neoplasm, autoimmune process, injuries, or drug-induced. Pericarditis usually leads to PERICARDIAL EFFUSION, or CONSTRICTIVE PERICARDITIS.','(terms occurring on more labels are shown first): pericarditis'),('http://sideeffects.embl.de/se/C0031212/','Personality disorder',': A diverse category of psychiatric disorders characterized by behavior that deviates markedly from the expectations of the individual\'s culture; this pattern of deviation is pervasive and inflexible and is stable over time. The behavioral pattern negatively interferes with relationships and work.','(terms occurring on more labels are shown first): personality disorder, personality disorders'),('http://sideeffects.embl.de/se/C0031350/','Pharyngitis',': Inflammation of the throat most often caused by viral and bacterial infections. Other causes include allergens, chemical substances, and trauma.','(terms occurring on more labels are shown first): pharyngitis, throat inflammation, throat soreness and irritation, pharyngeal inflammation, irritation of the throat, irritation in the throat'),('http://sideeffects.embl.de/se/C0031542/','Phlebitis',': Inflammation (redness, swelling, pain, and heat) of a vein, usually in the legs. Phlebitis may be caused by infection, injury, or irritation.','(terms occurring on more labels are shown first): phlebitis'),('http://sideeffects.embl.de/se/C0031924/','Piloerection',': The reflex process in which the arrectores pilorum (hair follicle) muscles contract and cause the hair to stand erect. [GOC:BHF, http://en.wikipedia.org/wiki/Pilomotor_reflex, PMID:21335239]','(terms occurring on more labels are shown first): piloerection, gooseflesh, goose-flesh, goosebumps, goose bumps, Pilo-erection'),('http://sideeffects.embl.de/se/C0032227/','Pleural effusion',': Increased amounts of fluid within the pleural cavity. Symptoms include shortness of breath, cough, and chest pain. It is usually caused by lung infections, congestive heart failure, pleural and lung tumors, connective tissue disorders, and trauma.','(terms occurring on more labels are shown first): pleural effusion, pleural effusions'),('http://sideeffects.embl.de/se/C0032285/','Pneumonia',': A severe inflammation of the lungs in which the alveoli (tiny air sacs) are filled with fluid. This may cause a decrease in the amount of oxygen that blood can absorb from air breathed into the lung. Pneumonia is usually caused by infection but may also be caused by radiation therapy, allergy, or irritation of lung tissue by inhaled substances. It may involve part or all of the lungs.','(terms occurring on more labels are shown first): pneumonia, pneumonitis, Pulmonary inflammation, Pneumoniae, pneumonias, lung inflammation, pulmonitis, p neumoniae, pneum, pn eumoniae'),('http://sideeffects.embl.de/se/C0032541/','Polyneuritis',': clinical syndrome characterized by widespread involvement of peripheral nerves, weakness, sensory loss, and impairment of reflexes.','(terms occurring on more labels are shown first): polyneuritis'),('http://sideeffects.embl.de/se/C0032617/','Polyuria',': Urination of a large volume of urine with an increase in urinary frequency, commonly seen in diabetes (DIABETES MELLITUS; DIABETES INSIPIDUS).','(terms occurring on more labels are shown first): polyuria, excessive diuresis, increase in urinary output, urine volume increased, high urine output'),('http://sideeffects.embl.de/se/C0032788/','Postoperative hemorrhage',': Bleeding occurring after completion of a surgical procedure. Postoperative bleeding may follow surgery immediately or may be delayed; it may be wound-related or not.','(terms occurring on more labels are shown first): postoperative bleeding, post-operative hemorrhage, post-operative blood loss, postoperative blood loss, post-operative haemorrhage, Post operative hemorrhage, post- operative hemorrhage'),('http://sideeffects.embl.de/se/C0032961/','Pregnancy',': The set of physiological processes that allow an embryo or foetus to develop within the body of a female animal. It covers the time from fertilization of a female ovum by a male spermatozoon until birth. [ISBN:0192800825]','(terms occurring on more labels are shown first): Pregnancy, gestation, Pregnancies'),('http://sideeffects.embl.de/se/C0033687/','Proteinuria',': A disorder characterized by laboratory test results that indicate the presence of excessive protein in the urine. It is predominantly albumin, but also globulin.','(terms occurring on more labels are shown first): proteinuria, urine protein present, proteinuria present, protein- uria'),('http://sideeffects.embl.de/se/C0033771/','Prurigo',': A name applied to several itchy skin eruptions of unknown cause. The characteristic course is the formation of a dome-shaped papule with a small transient vesicle on top, followed by crusting over or lichenification. (From Dorland, 27th ed)','(terms occurring on more labels are shown first): pruritic rash, rash pruritic, prurigo, itchy rash'),('http://sideeffects.embl.de/se/C0033774/','Pruritus',': Itching. Severe itching may be a side effect of some cancer treatments and a symptom of some types of cancers.','(terms occurring on more labels are shown first): pruritus, itching, pruritis, itchy, Skin pruritus, itching skin, itch Skin, Skin itching, pruritic disorder, itchy skin, Skin - pruritus, Prur itu s, p ruritus, itchskin'),('http://sideeffects.embl.de/se/C0033975/','Psychotic disorder',': WHAT: Psychosis.	Psychosis: a loss of contact with reality, a thought disorder, or a change of personality or behavior often associated with delusions, illusions, or hallucinations.	WHY:	Psychosis may occur in systemic lupus erythematosus, mixed connective tissue disease, or with the administration of steroids, cimetadine (Tagemet), or reserpine.	HOW:	A psychosis probably exists if a patient demonstrates one or more of the following major criteria: MAJOR CRITERIA LOSS OF CONTACT WITH REALITY -- evidenced by the misinterpretation of the environment as hostile when friendly or vice versa, generally causing bizarre responses to normal and usual environmental stimuli. THOUGHT DISTURBANCE -- evidenced by incoherence, marked illogical content, marked loose associations, or patient\'s admission of mental confusion and abnormal rate of mental activity. PERSONALITY/BEHAVIOR CHANGES -- characterized by rapid onset and reversals of previous behavior patterns, often observed by reliable family member or friend. The diagnosis is further strengthened by the presence of one or more of the following minor criteria: MINOR CRITERIA DELUSIONS -- firmly held beliefs that cannot be dissuaded by logical discussion; generally of a threatening, powerful, or grandiose nature. ILLUSIONS -- misperceptions of environmental stimuli, e.g. perceiving a person instead of an actual tree shadow. HALLUCINATIONS -- perceptions without environmental stimuli, e.g. hearing voices/noises or seeing a face/vision.	REFS:	1) \"Differential Diagnosis of Psychotic Features\". In Diagnostic and Statistical Manual of Mental Disorders, 3rd ed. (DSM III). Washington, D.C.: American Psychiatric Association, 1980. 2) Rothfield, N: \"Clinical Features of Systemic Lupus Erythematosus\". In Textbook of Rheumatology (Ch. 69). Philadelphia: W.B. Saunders Co., 1981. 3) Bennet, RM and Spargo, BH: Neuropsychiatric problems in mixed connective tissue disease. Am J Med 65(6), December 1978, pp. 955-62. DN19307-1. 4) Steinberg, AD: \"Management of Systemic Lupus Erythematosus\". In Textbook of Rheumatology (Ch. 70). Philadelphia: W.B. Saunders Co., 1981.','(terms occurring on more labels are shown first): psychosis, psychotic, psychotic disorders, psychoses, psychotic disorder, Psychotic disorder s, psy- chotic'),('http://sideeffects.embl.de/se/C0034063/','Pulmonary oedema',': Accumulation of fluid in the lung tissues causing disturbance of the gas exchange that may lead to respiratory failure. It is caused by direct injury to the lung parenchyma or congestive heart failure. The symptoms may appear suddenly or gradually. Suddenly appearing symptoms include difficulty breathing, feeling of suffocation, and coughing associated with frothy sputum. Gradually appearing symptoms include difficulty breathing while lying in bed, shortness of breath during activity, and weight gain (in patients with congestive heart failure).','(terms occurring on more labels are shown first): pulmonary edema, lung edema, pulmonary oedema, lung oedema'),('http://sideeffects.embl.de/se/C0034150/','Purpura',': A disorder characterized by hemorrhagic areas of the skin and mucous membrane. Newer lesions appear reddish in color. Older lesions are usually a darker purple color and eventually become a brownish-yellow color.','(terms occurring on more labels are shown first): purpura, peliosis, purpura Skin'),('http://sideeffects.embl.de/se/C0034882/','Rectal disorder',': Pathological developments in the RECTUM region of the large intestine (INTESTINE, LARGE).','(terms occurring on more labels are shown first): rectal disorder, rectal disorders, Disorder Rectal'),('http://sideeffects.embl.de/se/C0035078/','Renal failure',': A condition in which the kidneys stop working and are not able to remove waste and extra water from the blood or keep body chemicals in balance. Acute or severe renal failure happens suddenly (for example, after an injury) and may be treated and cured. Chronic renal failure develops over many years, may be caused by conditions like high blood pressure or diabetes, and cannot be cured. Chronic renal failure may lead to total and long-lasting renal failure, called end-stage renal disease (ESRD). A person in ESRD needs dialysis (the process of cleaning the blood by passing it through a membrane or filter) or a kidney transplant.','(terms occurring on more labels are shown first): renal failure, kidney failure, renalfailure'),('http://sideeffects.embl.de/se/C0035243/','Respiratory tract infection',': invasion and growth of microorganisms in the respiratory system; may be clinically inapparent or result in local cellular injury.','(terms occurring on more labels are shown first): respiratory tract infections, respiratory tract infection, respiratory infection, respiratory infections, infection Respiratory, Respiratory Inf ec tio n, respirat ory t ract infect'),('http://sideeffects.embl.de/se/C0035309/','Retinal disorder',': pathologic condition of the innermost of the three tunics of the eyeball or retina.','(terms occurring on more labels are shown first): retinopathy, retinal disorder, retinopathies, Disorders - retinal, retinal disorders'),('http://sideeffects.embl.de/se/C0035400/','Reye\'s syndrome',': rare, acute, sometimes fatal disease of childhood, most often occurring as a sequel of varicella or a viral upper respiratory infection of childhood; marked by recurrent vomiting and elevated serum transaminase levels with distinctive changes in the liver and other viscera; an encephalopathic phase with acute brain swelling disturbances of consciousness and seizures may follow.','(terms occurring on more labels are shown first): Reye\'s syndrome, Reye syndrome'),('http://sideeffects.embl.de/se/C0035435/','Rheumatism',': any of a variety of disorders marked by inflammation, degeneration, or metabolic derangement of the connective tissue structures of the body, especially the joints and related structures, including muscles, bursae, tendons, and fibrous tissue.','(terms occurring on more labels are shown first): rheumatism, rheumatic diseases, rheumatics'),('http://sideeffects.embl.de/se/C0035455/','Rhinitis',': An inflammation of the mucous membrane lining the nose, usually associated with nasal discharge.','(terms occurring on more labels are shown first): rhinitis'),('http://sideeffects.embl.de/se/C0036454/','Scotoma',': A localized defect in the visual field bordered by an area of normal vision. This occurs with a variety of EYE DISEASES (e.g., RETINAL DISEASES and GLAUCOMA); OPTIC NERVE DISEASES, and other conditions.','(terms occurring on more labels are shown first): visual field defect, scotoma, scotomata, visual field defects, scotomas, visual field loss, visual field disorders, visual fielddefect, visual field defe ct'),('http://sideeffects.embl.de/se/C0036508/','Seborrhoeic dermatitis',': A chronic inflammatory disease of the skin with unknown etiology. It is characterized by moderate ERYTHEMA, dry, moist, or greasy (SEBACEOUS GLAND) scaling and yellow crusted patches on various areas, especially the scalp, that exfoliate as dandruff. Seborrheic dermatitis is common in children and adolescents with HIV INFECTIONS.','(terms occurring on more labels are shown first): seborrhea, seborrheic dermatitis, seborrhoea, seborrhoeic dermatitis, dermatitis seborrheic, eczema seborrhoeic'),('http://sideeffects.embl.de/se/C0036572/','Convulsion',': WHAT: Seizure.	Seizure: a paroxysmal transient disturbance of brain function that may be manifested as episodic impairment or loss of consciousness, abnormal motor phenomena, psychic or sensory disturbance or perturbation of the autonomic brain electrical activity.	WHY:	Seizures may occur in systemic lupus erythematosus or in necrotizing vasculitides such as polyarteritis, eosinophilic granulomatous vasculitis, aortic arch arteritis, or rheumatoid arteritis.	HOW:	A seizure probably exists when there are generalized convulsions or focal motor/sensory phenomenon. GENERALIZED CONVULSIONS may be preceded by an aura but usually have a sudden loss of consciousness with generalized muscle rigidity then generalized muscle activity. They may have incontinence of urine or feces or laceration of the tongue or buccal mucosa. This usually is followed by flaccidity, drowsiness, or complaints of a headache or sore muscles. FOCAL MOTOR/SENSORY PHENOMENON may precede generalized convulsions but may be tonic or clonic muscle activity that is limited to one extremity, one side of the body, or one side of the face or lateralized/localized sensory sensations. These may only be brief sudden involuntary muscle contractions associated with transitory loss of muscle tone and a brief loss of contact with the environment, repetitive automatic behavior patterns, feelings of familiarity or unfamiliarity associated with compulsive thinking, unpleasant epi- gastric sensations that may radiate to the head, or hallucinations of an auditory, vertiginous, olfactory, gustatory, or visual type.	REFS:	1) Steinberg, AD: \"Management of Systemic Lupus Erythematosus\". In Textbook of Rheumatology (Ch. 70). Philadelphia: W.B. Saunders Co., 1981. 2) Hunder, GG and Conn, DL: \"Necrotizing Vasculitis\". In Textbook of Rheumatology (Ch. 72). Philadelphia: W.B. Saunders Co., 1981. 3) Harris, ED Jr: \"Pathogenesis of Rheumatoid Arthritis\". In Textbook of Rheumatology (Ch. 59). Philadelphia: W.B. Saunders Co., 1981. 4) Bennet, RM and Spargo, BH: Neuropsychiatric problems in mixed connective tissue disease. Am J Med 65(6), December 1978, pp. 955-62. DN19307-1. 5) Duman, S and Ginsburg, S: \"Epilepsy (Seizures)\". In Problem- Oriented Medical Diagnosis (Ch. 10). Boston: Little, Brown and Co., 1975.','(terms occurring on more labels are shown first): seizures, convulsions, seizure, convulsion, fits, Seizure s'),('http://sideeffects.embl.de/se/C0036690/','Septicemia',': The presence of pathogenic microorganisms in the blood stream causing a rapidly progressing systemic reaction that may lead to shock. Symptoms include fever, chills, tachycardia, and increased respiratory rate. It is a medical emergency that requires urgent medical attention.','(terms occurring on more labels are shown first): septicemia, septicaemia, septicemias'),('http://sideeffects.embl.de/se/C0036973/','Shivering',': Involuntary contraction or twitching of the muscles. It is a physiologic method of heat production in man and other mammals.','(terms occurring on more labels are shown first): shivering, Shiver, shivers'),('http://sideeffects.embl.de/se/C0036974/','Shock',': a profound hemodynamic and metabolic disturbance characterized by the failure of the circulatory system to maintain adequate perfusion of vital organs; causes inadequate delivery of nutrients and insufficient removal of cellular waste products to and from the tissues.','(terms occurring on more labels are shown first): shock, circulatory collapse, cardiovascular collapse, circulatory failure, vascular collapse, shock syndrome, circulatory shock, shocks, peripheral circulatory failure, shock Vascular, Shock Circulatory, collapse cardiovascular'),('http://sideeffects.embl.de/se/C0037036/','Salivary hypersecretion',': Increased salivary flow.','(terms occurring on more labels are shown first): increased salivation, salivary hypersecretion, saliva increased, increased saliva, hypersalivation, excessive salivation, sialorrhea, hyper-salivation, Ptyalism, salivation increase, Hypersecretion of saliva, sialorrhoea'),('http://sideeffects.embl.de/se/C0037199/','Sinusitis',': inflammatory process of the mucous membranes of the paranasal sinuses that occurs in three stages: acute, subacute, and chronic; results from any condition causing ostial obstruction or from pathophysiologic changes in the mucociliary transport mechanism.','(terms occurring on more labels are shown first): sinusitis, sinus infection'),('http://sideeffects.embl.de/se/C0037278/','Skin infection',': An inflammatory process affecting the skin, caused by bacteria, viruses, parasites, or fungi. Examples of bacterial infection include carbuncles, furuncles, impetigo, erysipelas, and abscesses. Examples of viral infection include shingles, warts, molluscum contagiosum, and pityriasis rosea. Examples of parasitic infection include scabies and lice. Examples of fungal infection include athlete\'s foot, yeast infection, and ringworm.','(terms occurring on more labels are shown first): skin infections, skin infection'),('http://sideeffects.embl.de/se/C0037284/','Skin lesion','(terms occurring on more labels are shown first): skin lesion',':'),('http://sideeffects.embl.de/se/C0037299/','Skin ulcer',': A circumscribed inflammatory and often suppurating and necrotic lesion on the skin. Causes include trauma, peripheral vascular disorder, diabetes, exposure to heat or cold, exposure to corrosive agents, infections, and prolonged staying in one position (pressure ulcer).','(terms occurring on more labels are shown first): skin ulcer, skin ulceration, cutaneous ulcers, ulcer skin, skin ulcers, skin ulcerations'),('http://sideeffects.embl.de/se/C0037763/','Muscle spasms',': a sudden, violent, involuntary contraction of a muscle or a group of muscles, attended by pain and interference with function, producing involuntary movement and distortion.','(terms occurring on more labels are shown first): spasm, muscle spasm, muscle spasms, spasms, muscular spasm, musclespasm'),('http://sideeffects.embl.de/se/C0037822/','Speech disorder',': A term referring to disorders characterized by the disruption of normal speech. It includes stuttering, lisps, dysarthria and voice disorders.','(terms occurring on more labels are shown first): speech disorder, speech disorders, Disorders Speech'),('http://sideeffects.embl.de/se/C0038325/','Stevens-Johnson syndrome',': A systemic, serious, and life-threatening disorder characterized by lesions in the skin and mucous membranes that may lead to necrosis. The lesions may appear anywhere in the body but they occur more commonly in the palms, soles, dorsum of the hands, and extensor surfaces. The lesions are vesicular or necrotic in the center, surrounded by an erythematous zone and occupy less than 10% of the body surfaces. The appearance of the mucocutaneous lesions is preceded by an upper respiratory tract infection. It is an immune complex hypersensitivity reaction usually caused by drugs (e.g., sulfa, phenytoin, penicillin), viruses (e.g., herpes simplex, influenza, hepatitis), and malignancies (e.g., carcinoma and lymphoma).','(terms occurring on more labels are shown first): Stevens-Johnson syndrome, Stevens Johnson syndrome, SJS, Stevens- Johnson syndrome, Steven-Johnson syndrome, erythema multiforme exudativum, Steven Johnson syndrome, Stevens - Johnson syndrome, Stevens-Johnsons syndrome, Stevens-Johnson-Syndrome, StevensJohnson syndrome, Stevens-Johnson- syndrome, Stevens -Johnson syndrome, Steven-Johnsons syndrome, Steven- Johnson syndrome, Stevens-Johnsonsyndrome, Stevens Johnson-syndrome, Ste-vens-Johnson syndrome, St evens-Johnson syndrome, erythema exudativum multiforme'),('http://sideeffects.embl.de/se/C0038358/','Gastric ulcer',': Ulceration of the GASTRIC MUCOSA due to contact with GASTRIC JUICE. It is often associated with HELICOBACTER PYLORI infection or consumption of nonsteroidal anti-inflammatory drugs (NSAIDS).','(terms occurring on more labels are shown first): gastric ulcer, stomach ulcer, gastric ulcers, gastric ulceration, stomach ulcers, ulcer stomach'),('http://sideeffects.embl.de/se/C0038362/','Stomatitis',': INFLAMMATION of the soft tissues of the MOUTH, such as MUCOSA; PALATE; GINGIVA; and LIP.','(terms occurring on more labels are shown first): stomatitis, stoma- titis, sto- matitis, mucositis oral'),('http://sideeffects.embl.de/se/C0038363/','Aphthous stomatitis',': A recurrent disease of the oral mucosa of unknown etiology. It is characterized by small white ulcerative lesions, single or multiple, round or oval. Two to eight crops of lesions occur per year, lasting for 7 to 14 days and then heal without scarring. (From Jablonski\'s Dictionary of Dentistry, 1992, p742)','(terms occurring on more labels are shown first): aphthous stomatitis, aphthous ulcers, aphthous ulcer, canker sore, aphtha, stomatitis aphthous, aphthous ulcerations, canker sores, canker sores oral'),('http://sideeffects.embl.de/se/C0038454/','Cerebrovascular accident',': A sudden loss of neurological function secondary to hemorrhage or ischemia in the brain parenchyma due to a vascular event. Infarction or hemorrhage may be demonstrated either directly by imaging, laboratory, or pathologic examination in patients with symptom duration less than 24 hours, or inferred by symptoms lasting greater than or equal to 24 hours (or fatal within 24 hours) that cannot be attributed to another cause. Diagnostic tests include CT scan, MRI, angiography, and EEG to locate and evaluate the extent of the hemorrhagic or ischemic damage in the brain parenchyma, coagulation studies, complete blood count, comprehensive metabolic panel, and urinalysis.','(terms occurring on more labels are shown first): cerebrovascular accident, stroke, strokes, cerebral vascular accident, cerebrovascular accidents, apoplexy'),('http://sideeffects.embl.de/se/C0038587/','Withdrawal syndrome',': A substance-specific organic brain syndrome that follows the discontinuation of administration or use, or reduction in intake of an addictive substance, e.g. opioids, barbiturates and alcohol; amphetamines or similarly acting sympathomimetics; cocaine; nicotine; sedatives, hypnotics, or anxiolytics. Syndrome manifests with diverse, often painful physical and psychological symptoms, which include but not limited to intense drug craving, anxiety, depression, insomnia, nausea, perspiration, body aches, tremors, hallucinations, and convulsions.','(terms occurring on more labels are shown first): withdrawal syndrome'),('http://sideeffects.embl.de/se/C0038814/','Sunburn',': An injury to the skin causing erythema, tenderness, and sometimes blistering and resulting from excessive exposure to the sun. The reaction is produced by the ultraviolet radiation in sunlight.','(terms occurring on more labels are shown first): sunburn, sunburns'),('http://sideeffects.embl.de/se/C0038990/','Sweating',': The process of exocrine secretion of the SWEAT GLANDS, including the aqueous sweat from the ECCRINE GLANDS and the complex viscous fluids of the APOCRINE GLANDS.','(terms occurring on more labels are shown first): sweating, sweats, perspiring'),('http://sideeffects.embl.de/se/C0038999/','Swelling',': Enlargement; expansion in size; sign of inflammation','(terms occurring on more labels are shown first): swelling, swollen'),('http://sideeffects.embl.de/se/C0039070/','Syncope',': A transient loss of consciousness and postural tone caused by diminished blood flow to the brain (i.e., BRAIN ISCHEMIA). Presyncope refers to the sensation of lightheadedness and loss of strength that precedes a syncopal event or accompanies an incomplete syncope. (From Adams et al., Principles of Neurology, 6th ed, pp367-9)','(terms occurring on more labels are shown first): syncope, faintness, fainting, Disorders Syncope, syncopes, s yncope, Fainting Syncope, Fainting episodes'),('http://sideeffects.embl.de/se/C0039231/','Tachycardia',': Abnormally rapid heartbeat, usually with a HEART RATE above 100 beats per minute for adults. Tachycardia accompanied by disturbance in the cardiac depolarization (cardiac arrhythmia) is called tachyarrhythmia.','(terms occurring on more labels are shown first): tachycardia, increase in pulse rate, heart rate increased, increase pulse rate, increased heart rate, rapid heartbeat, pulse increased, tachycardias, increased pulse rate, rapid pulse, fast heartbeat, rapid heart rate, fast pulse, tachycar dia, t achycardia, pulse rate increased, increasedHeart rate'),('http://sideeffects.embl.de/se/C0039240/','Supraventricular tachycardia',': A disorder characterized by a dysrhythmia with a heart rate greater than 100 beats per minute that originates above the ventricles.','(terms occurring on more labels are sh