embl.de/se/C0040485/','Torticollis',': A symptom, not a disease, of a twisted neck. In most instances, the head is tipped toward one side and the chin rotated toward the other. The involuntary muscle contractions in the neck region of patients with torticollis can be due to congenital defects, trauma, inflammation, tumors, and neurological or other factors.','(terms occurring on more labels are shown first): torticollis, retrocollis'),('http://sideeffects.embl.de/se/C0040822/','Tremor',': Cyclical movement of a body part that can represent either a physiologic process or a manifestation of disease. Intention or action tremor, a common manifestation of CEREBELLAR DISEASES, is aggravated by movement. In contrast, resting tremor is maximal when there is no attempt at voluntary movement, and occurs as a relatively frequent manifestation of PARKINSON DISEASE.','(terms occurring on more labels are shown first): tremor, tremors, tremo r, Shaking'),('http://sideeffects.embl.de/se/C0040997/','Trigeminal neuralgia',': A syndrome characterized by recurrent episodes of excruciating pain lasting several seconds or longer in the sensory distribution of the TRIGEMINAL NERVE. Pain may be initiated by stimulation of trigger points on the face, lips, or gums or by movement of facial muscles or chewing. Associated conditions include MULTIPLE SCLEROSIS, vascular anomalies, ANEURYSMS, and neoplasms. (Adams et al., Principles of Neurology, 6th ed, p187)','(terms occurring on more labels are shown first): trigeminal neuralgia, tic douloureux'),('http://sideeffects.embl.de/se/C0041582/','Ulcer',': The formation of a break on the skin or on the surface of an organ. An ulcer forms when the surface cells die and are cast off. Ulcers may be associated with cancer and other diseases.','(terms occurring on more labels are shown first): ulceration, ulcer, ulcers, ulcerative, ulcerations, ulcerated'),('http://sideeffects.embl.de/se/C0041834/','Erythema',': Redness of the skin produced by congestion of the capillaries. This condition may result from a variety of causes.','(terms occurring on more labels are shown first): erythema, skin erythema, skin redness, Erythemas, redness of skin, Skin - Erythema, Skin -- erythema, SkinErythema, Er ythema'),('http://sideeffects.embl.de/se/C0041912/','Upper respiratory tract infection',': An infectious process affecting the upper respiratory tract (nose, paranasal sinuses, pharynx, larynx, or trachea). Symptoms include congestion, sneezing, coughing, fever, and sore throat.','(terms occurring on more labels are shown first): upper respiratory tract infection, upper respiratory infection, upper respiratory tract infections, upper respiratory infections, Upper resp tract infection, infection upper respiratory, URTI, upper-respiratory tract infections, upper- respiratory tract infections, upper-respiratory tract infection, Upper RespiratoryTract Infection, u pper respiratory tract infection'),('http://sideeffects.embl.de/se/C0042023/','Pollakiuria',': Urination at short intervals; it may result from increased urine formation, decreased bladder capacity, or lower urinary tract irritation.','(terms occurring on more labels are shown first): urinary frequency, micturition frequency, pollakiuria, frequent urination, urination frequency, increased urinary frequency, micturition frequency increased, increased frequency of urination, Frequency of urination, frequency of micturition, Frequency Urinary, pollakisuria, Increased UrinaryFrequency, increased frequency of micturition, Frequency Urination, micturitionfrequency'),('http://sideeffects.embl.de/se/C0042024/','Urinary incontinence',': Involuntary loss of URINE, such as leaking of urine. It is a symptom of various underlying pathological processes. Major types of incontinence include URINARY URGE INCONTINENCE and URINARY STRESS INCONTINENCE.','(terms occurring on more labels are shown first): urinary incontinence, incontinence of urine, urine incontinence, urinary inconti- nence, urinar y incontinence, Involuntary urination'),('http://sideeffects.embl.de/se/C0042029/','Urinary tract infection',': A bacterial infectious process affecting any part of the urinary tract, most commonly the bladder and the urethra. Symptoms include urinary urgency and frequency, burning sensation during urination, lower abdominal discomfort, and cloudy urine.','(terms occurring on more labels are shown first): urinary tract infection, urinary tract infections, urinary infection, infection urinary tract, UTIs, Urinary tractinfection, Urinary tract infect, Urinarytractinfection, urinarytract infection'),('http://sideeffects.embl.de/se/C0042075/','Urinary tract disorder',': condition in which there is a deviation from or interruption of the normal structure or function of the urinary tract.','(terms occurring on more labels are shown first): renal and urinary disorders, urinary system disorders, urinary tract disorder, urinary tract disorders, Urinary system disorder, Renalandurinarydisorders, Renaland urinary disorders, Renal urinary disorders'),('http://sideeffects.embl.de/se/C0042109/','Urticaria',': A vascular reaction of the skin characterized by erythema and wheal formation due to localized increase of vascular permeability. The causative mechanism may be allergy, infection, or stress.','(terms occurring on more labels are shown first): urticaria, hives, urticarial rash, Urticarial, urticarias, urt icaria'),('http://sideeffects.embl.de/se/C0042130/','Uterine contractions',': A process in which force is generated within smooth muscle tissue, resulting in a change in muscle geometry. This process occurs in the uterus. Force generation involves a chemo-mechanical energy conversion step that is carried out by the actin/myosin complex activity, which generates force through ATP hydrolysis. The uterus is a muscular organ of the female mammal for containing and usually for nourishing the young during development prior to birth. [GOC:sl]','(terms occurring on more labels are shown first): uterine contractions'),('http://sideeffects.embl.de/se/C0042267/','Vaginal inflammation',': A disorder characterized by inflammation involving the vagina. Symptoms may include redness, edema, marked discomfort and an increase in vaginal discharge.','(terms occurring on more labels are shown first): vaginitis, Colpitis, inflammation of vagina, vaginal inflammation, v aginitis'),('http://sideeffects.embl.de/se/C0042373/','Angiopathy',': A non-neoplastic or neoplastic disorder affecting the arteries, veins, or lymphatic vessels. Examples include vasculitis, thrombophlebitis, arteriosclerosis, lymphedema, hemangioma, and angiosarcoma.','(terms occurring on more labels are shown first): vascular disorders, vascular disorder, vascular disease, angiopathy, blood vessel disease, vascular diseases, Vasculardisorders, Vascu lar Disorders'),('http://sideeffects.embl.de/se/C0042401/','Vasodilation',': An increase in the internal diameter of blood vessels, especially arterioles or capillaries, usually resulting in a decrease in blood pressure. [ISBN:0192800981]','(terms occurring on more labels are shown first): vasodilation, peripheral vasodilation'),('http://sideeffects.embl.de/se/C0042571/','Vertigo',': An illusion of movement, either of the external world revolving around the individual or of the individual revolving in space. Vertigo may be associated with disorders of the inner ear (EAR, INNER); VESTIBULAR NERVE; BRAINSTEM; or CEREBRAL CORTEX. Lesions in the TEMPORAL LOBE and PARIETAL LOBE may be associated with FOCAL SEIZURES that may feature vertigo as an ictal manifestation. (From Adams et al., Principles of Neurology, 6th ed, pp300-1)','(terms occurring on more labels are shown first): vertigo, spinning sensation, ver- tigo'),('http://sideeffects.embl.de/se/C0042907/','Vitreous detachment',': Detachment of the corpus vitreum (VITREOUS BODY) from its normal attachments, especially the retina, due to shrinkage from degenerative or inflammatory conditions, trauma, myopia, or senility.','(terms occurring on more labels are shown first): vitreous detachment'),('http://sideeffects.embl.de/se/C0042963/','Vomiting',': A disorder characterized by the reflexive act of ejecting the contents of the stomach through the mouth.','(terms occurring on more labels are shown first): vomiting, emesis, vomits, Vomitin g, vomited, vom- iting, throwing up, vomiting symptoms, vomit- ing, vomit ing, v omiting'),('http://sideeffects.embl.de/se/C0043049/','Water intoxication',': A condition resulting from the excessive retention of water with sodium depletion.','(terms occurring on more labels are shown first): water intoxication'),('http://sideeffects.embl.de/se/C0043094/','Weight increased',': A finding characterized by an increase in overall body weight; for pediatrics, greater than the baseline growth curve.','(terms occurring on more labels are shown first): weight gain, weight increase, weight increased, increased weight, increase in body weight, body weight gain, gained weight, weight gains, W eight gain, body-weight gain'),('http://sideeffects.embl.de/se/C0043096/','Weight decreased',': the reduction of overall body mass; may be due to disease, diet, or drugs; can be permanent or temporary, and may involve any tissue.','(terms occurring on more labels are shown first): weight loss, weight decrease, weight decreased, decreased weight, weight reduction, body weight decreasing, loss of weight, decreased body weight, reduced body weight, lower body weight, lose weight, weightdecrease, weight re- duction, reduction Weight, decreasedweight, decrease in body weight'),('http://sideeffects.embl.de/se/C0043251/','Trauma',': damage inflicted on the body as the direct or indirect result of an external force, with or without disruption of structural continuity; for emotional trauma use PSYCHOLOGICAL SHOCK.','(terms occurring on more labels are shown first): trauma'),('http://sideeffects.embl.de/se/C0043352/','Dry mouth',': A disorder characterized by reduced salivary flow in the oral cavity.','(terms occurring on more labels are shown first): dry mouth, mouth dry, xerostomia, aptyalism, mouth dryness, hyposalivation, oral dryness, drymouth, dry mout h, d ry mouth'),('http://sideeffects.embl.de/se/C0080274/','Urinary retention',': A disorder characterized by accumulation of urine within the bladder because of the inability to urinate.','(terms occurring on more labels are shown first): urinary retention, inability to empty bladder, urine retention, bladder retention, retention of urine, u rinary retention'),('http://sideeffects.embl.de/se/C0085593/','Chills',': A disorder characterized by a sensation of cold that often marks a physiologic response to sweating after a fever.','(terms occurring on more labels are shown first): chills, chilling'),('http://sideeffects.embl.de/se/C0085605/','Hepatic failure',': A disorder characterized by the inability of the liver to metabolize chemicals in the body. Causes include cirrhosis and drug-induced hepatotoxicity. Signs and symptoms include jaundice and encephalopathy. Laboratory test results reveal abnormal plasma levels of ammonia, bilirubin, lactic dehydrogenase, and alkaline phosphatase.','(terms occurring on more labels are shown first): hepatic failure, liver failure, liver decompensation'),('http://sideeffects.embl.de/se/C0085624/','Burning sensation',': A sensation of stinging or heat, not necessarily accompanied by redness or physical signs of irritation.','(terms occurring on more labels are shown first): burning sensation, burning sensations, burningsensation'),('http://sideeffects.embl.de/se/C0085628/','Stupor',': A state of reduced sensibility and response to stimuli which is distinguished from COMA in that the person can be aroused by vigorous and repeated stimulation. The person is still conscious and can make voluntary movements. It can be induced by CENTRAL NERVOUS SYSTEM AGENTS. The word derives from Latin stupere and is related to stunned, stupid, dazed or LETHARGY.','(terms occurring on more labels are shown first): stupor, obtundation, obtunded'),('http://sideeffects.embl.de/se/C0085631/','Agitation',': A condition in which a person is unable to relax and be still. The person may be very tense and irritable, and become easily annoyed by small things. He or she may be eager to have an argument, and be unwilling to work with caregivers to make the situation better.','(terms occurring on more labels are shown first): agitation, restlessness, psychomotor agitation, psychomotor hyperactivity, agitated, agitated behavior, psychomotor restlessness, psychomot or restlessness, restless, Agitate, agita- tion'),('http://sideeffects.embl.de/se/C0085636/','Photophobia',': Abnormal sensitivity to light. This may occur as a manifestation of EYE DISEASES; MIGRAINE; SUBARACHNOID HEMORRHAGE; MENINGITIS; and other disorders. Photophobia may also occur in association with DEPRESSION and other MENTAL DISORDERS.','(terms occurring on more labels are shown first): photophobia, light sensitivity'),('http://sideeffects.embl.de/se/C0085642/','Livedo reticularis',': A recurrent purple discoloration of the skin involving most often the lower extremities. It may be aggravated by exposure to cold and is classified as idiopathic or secondary. Secondary livedo reticularis may be a cutaneous manifestation of immune system disorders (e.g., lupus erythematosus, rheumatoid arthritis, cryoglobulinemia, lymphoma, etc), and hematologic disorders (polycythemia vera).','(terms occurring on more labels are shown first): livedo reticularis'),('http://sideeffects.embl.de/se/C0085649/','Oedema peripheral',': A disorder characterized by swelling due to excessive fluid accumulation in the upper or lower extremities.','(terms occurring on more labels are shown first): peripheral edema, edema peripheral, peripheral oedema, oedema peripheral, oedema of extremities, edema of extremities, Oedema - peripheral, Oedemaperipheral, Edema - Peripheral, peri